INSERT INTO `Approach` VALUES (1,'Group 1','<ul><li>	Diverse in terms of population ageing and economic situation.</li><li>	Population / workforce ageing and the related challenges for workplaces have not been the main priority for policy development.</li></ul>',NULL,NULL),(2,'Group 2','<ul><li>	Diverse in terms of population ageing. Some with a relatively young population until recently but facing rapid ageing. </li><li>	Policies have been mainly focusing on increasing older workers\' employment rates.</li></ul>',NULL,NULL),(3,'Group 3','<ul><li>Relatively old population.</li><li>	Population / workforce ageing and related challenges for workplaces is a policy priority.</li><li>	Initiatives in several policy areas.  Role of working conditions and OSH recognized.</li></ul>',NULL,NULL),(4,'Group 4','<ul><li>	Population ageing started relatively early.</li><li>	Population / workforce ageing has been a policy priority for longer.</li><li>	Integrated policies, formal coordination structures, concerted implementation.</li></ul>',NULL,NULL);
