INSERT INTO `Country` VALUES ('AT','Austria',3,'0','<ul><li>Work-related health problems reported by older workers are more prevalent than the EU average: 24 % of older workers reported suffering from health problems in the past 12 months (16 % in the EU). \r\n</li>\r\n<br><li>There is a lack of measures in small and micro enterprises, often because of a lack of awareness. Additional support to companies, outside the large Fit for the Future and fit2work programmes, is greatly needed from the government and from intermediary organisations.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The population in Austria has been ageing since the 1980s, and this is projected to continue until at least 2060. Austria has a moderately old to older population, and will experience a very moderate pattern of ageing from 2040.</br>\r\n<br>Expenditures on pensions were above the EU average in 2011.</li></br>\r\n<li>According to the results of ESENER, Austria has relatively low OSH management composite scores (i.e. a low number of measures). This can be explained by the fact that it had to change the orientation of its regulatory strategies on OSH towards a process-based participatory OSH management approach when transposing the European Framework Directive.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Austria is characterised by a Bismarckian welfare system with variable trade union and state influence and high expenditure on old-age pensions, which reflects the low labour-force participation of older workers and early retirement ages in this country. The well-funded welfare system enables poverty reduction, high-quality health care and disability pensions, but one of the weaknesses of the model is that it is sensitive to employment conditions and demographics.</li></br>\r\n	<li>A particular strength in Austria are the coordinating mechanisms in place to include social partners in all discussions related to OSH, at the federal, regional and company levels.</li></br>\r\n	<li>Another interesting feature of the Austrian system is the strong involvement of the social insurance institutions. Social insurance institutions — and in particular the AUVA — play a major role in the promotion of healthier and safer working conditions and the implementation of company-centred programmes for the prevention of early exit from the workplace, such as <em>Fit for the Future</em> and <em>fit2work programmes</em>.</li></br></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Austria','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-austria/view'),('BE','Belgium',3,'0','<ul><li>The low employment rate of older workers suggests that Belgium still needs to make an effort to retain older workers at work. The lack of a coordinated and integrated approach has been hindering progress in this area. In addition, the implementation of policies for sustainable working conditions is particular in small and micro companies, is proving particularly challenging, and financial and technical support is needed for workplace actors.</li></br>\r\n\r\n <li>The legislation concerning return to work is extensive and complex in Belgium, the regulatory framework is not well known among the relevant stakeholders and this can be a barrier to rehabilitation. There is a need for workers and employers to be better informed about the current legislation and the existing measures.\r\n\r\n</li></br>\r\n\r\n <li>There are little or no incentives for employers to implement reintegration programmes in their companies.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Belgium’s population ageing is projected to be less pronounced than in the EU as a whole. Largely thanks to migration, Belgium’s population is projected to grow by about 10 % by 2050. Belgium is projected to experience a very moderate pattern of ageing from 2040.</li><br/>\r\n\r\n <li>In Belgium, many workers retire early: although the official retirement age is 65 years and the employment rate of 55- to 64-year-olds has been steadily rising, only 39 % of this age group were employed in 2012 (lower than the EU-27 average) and only 2 % were unemployed (and thus actively looking for a job).</li><br/>\r\n\r\n <li>On 1 September 2014, the new legislation on “psychosocial risks at work” entered into force. The new legislation introduces a wider definition of psychosocial risks that includes violence and harassment at work. The new laws aim to reinforce the prevention of psychosocial risks at work.</li><br/>\r\n\r\n<li>The recent legal or policy instruments put in place to promote the labour participation of older workers have a strong focus on the development of skills and the management of careers.</li></ul><br/>',NULL,NULL,NULL,NULL,'<ul><li><strong>Belgium has a continental welfare state model</strong> characterised by a Bismarckian welfare system with variable trade union and state influence. The model is characterised by a high proportion of expenditure on old-age pensions, reflecting the low labour-force participation of older workers and early retirement ages. \r\nThe well-funded welfare system enables poverty reduction, high-quality health care and disability pensions.</li></br>\r\n	<li>External Services for Occupational Safety and Health play a central role. These are private institutions, recognised by the federal authority competent for OSH and the regional authority competent for healthcare. Since 1996 these external OSH services deal with all aspects of both occupational health and occupational safety.</li></br>\r\n	<li>An affiliation to these services is mandatory for most employers; their work is considered to be an extension of the internal OSH policy of the affiliated company.</li></br>\r\n<li>National and sectoral social dialogue make important contributions to the improvement of working conditions in Belgium. Bipartite negotiated agreements exist on a range of OSH matters.</li></br>\r\n<li>The social partners have also concluded national collective agreements for companies to implement action plans for the employment of older workers, which include the improvement of working conditions.</li></br>\r\n<li>Belgium is the only OECD country in which trade union density has increased from 52.1 % to 55 % over the past 20 years. The main Belgian trade unions play an important role in the preparation and implementation of anti-discrimination and OSH legislation.</li></br>\r\n</ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Belgium','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-belgium/view'),('BG','Bulgaria',2,'0','<ul><li>Improving social dialogue at all levels.</li>\r\n <br><li>Addressing musculoskeletal disorders and psychosocial risks associated with work, as statistics show that these are some of the main concerns of employees and present a growing problem.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The median age in Bulgaria is similar to the EU average. The proportion of the population aged 65 or over is currently (2015) low in comparison with the EU average, and is projected to increase slowly until 2020. However, it is then set to rise rapidly by 2050s.</li>\r\n <br><li>Bulgaria was badly affected by the economic crisis and, consequently, experienced increasing unemployment. The population decreased by nearly 15 % in 20 years, with many young and especially skilled workers moving abroad for work.</li>\r\n <br><li>Early retirement is, in general, not an option in Bulgaria and is possible only for those working under hazardous and very unhealthy working conditions.</li>\r\n<br><li>Bulgaria joined the EU in 2007 and has relatively recently adopted EU measures on systematic OSH management. This has meant changes in the orientation of regulatory strategies on OSH and a move from a prescriptive approach to regulation to a process-based approach (as required by the Framework Directive). The transition has been hampered by a lack of workplace representation and the comparative immaturity of independent trade unions. In addition, the independent labour inspectorate has only recently been established.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Bulgaria follows the Central and Eastern European welfare model, although its system has some similarities with the Bismarckian welfare model. The level of welfare is below the EU average, and there is a low level of social protection and low living standard. Social partners have a very limited role in and little influence on the development of socio-economic policies.</li>\r\n <br><li>The Ministry of Labour and Social Policy develops, coordinates and implements the national policy related to safety and health at work; participates in drafting labour and OSH legislation; and carries out integrated control through the General Labour Inspectorate Executive Agency in all branches and activities. \r\n</li></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Bulgaria','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-bulgaria/view'),('CH','Switzerland',2,'0','<ul><li>Coordination of initiatives focusing on issues affecting older workers by one body (e.g. at federal level) would be useful.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The median age of the Swiss population was around the EU average in 2015. The old-age dependency ratio was below the EU average, at 26.4 compared with 28.8 %, and by 2060 it is projected to reach 44.4 %, which is considerably lower than the projection for the EU, at around 50 %.</li>\r\n <br><li>The employment rate of older workers (aged 55 to 64) is very high; in 2013, it was 72 % compared with 50 % in the EU on average. In Switzerland, the employment rate among the oldest age group (65 and over) was almost twice as high as the EU average over the past 10 years.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>OSH is regulated by the Federal Government and is addressed in particular by two federal laws: the Accident Insurance Act (UVG) and the Work Act (ArG).</li>\r\n <br><li>Switzerland has a strong tradition of social dialogue that is carried out through formal and informal networks. Both employer associations and trade unions are routinely involved in the shaping of public policy. Collective agreements are the central instrument for social dialogue at sectoral level.</li></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Switzerland','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-switzerland-lichtenstein/view'),('CY','Cyprus',1,'0','<ul><li>Occupational health services are still at a very early stage in their development in Cyprus and are currently provided to only a limited number of enterprises.</li></br>\r\n\r\n <li>Vocational rehabilitation and RTW policies and systems need to be developed.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The population of Cyprus is considerably younger than the population of Europe as a whole. While in 2013 the median age in the EU-28 was around 42 years, it was 36 years in Cyprus. The proportion of the population aged 65 or over is currently (in 2015) comparatively low and is projected to increase slowly until 2020. However, it is set to grow rapidly throughout the 2040s and 2050s.</li></br>\r\n\r\n <li>The employment rate among people aged 65 or over has been at least twice as high in Cyprus as at EU level over the last 10 years (9.5% in Cyprus and 5% in the EU in 2012). </li></br>\r\n\r\n <li>In Cyprus, social dialogue at enterprise level plays an important role in the implementation of measures for the protection of workers’ safety and health. The Safety and Health at Work Laws (89(I)/1996-2003, Articles 9-12) and the Management of Safety and Health Issues at Work Regulations of 2002 (173/2002, Article 11) stipulate the role and function of workplace safety committees. The members of each safety committee include safety representatives who are elected by the employees, the employer or a representative of the employer, the safety officer and, if available, a medical practitioner. Safety representatives are elected for a three-year period. Among other responsibilities, the committee submits proposals on OSH measures and collaborates with the labour inspector on all OSH matters. The number of safety representatives in a workplace depends on the number of employees. </li>\r\n\r\n</ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Cyprus’s welfare state follows the Southern/Mediterranean welfare state model. It has recently undergone several reforms. In general, there was a shift from universality to a more targeted approach, and benefit rates were reduced.</li></br>\r\n\r\n <li>In 2014, the guaranteed minimum income scheme was introduced. The scheme provides an allowance for every low-income family that meets certain criteria; the aim is to ensure a minimum standard of living.</li></br>\r\n\r\n <li>There is a long tradition of social dialogue in Cyprus; the implementation of almost all proposals and policies regarding industrial relations has been the result of social dialogue between the government, employers’ organisations and the trade unions. Social dialogue in the field of OSH takes place through the Labour Advisory Board and the Pan Cyprian Safety and Health Council.</li></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Cyprus','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-cyprus/view'),('CZ','Czech Republic',2,'0','<ul><li>Considering the magnitude of projected population ageing in the upcoming decades, and the fact that the employment rate of the 55-64 age group is similar to the EU average, increasing the employment rates of older age groups will be a challenge.</li></br>\r\n\r\n <li>Life expectancy and healthy life years expectancy are below the EU average, and reducing health inequalities within the country is recognised as a priority in the Health 21 programme. The role of workplaces in improving public health is acknowledged in the programme.\r\n\r\n</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The proportion of the population aged 65 or over is currently (2015) comparatively low, and is projected to increase slowly until 2020. However, it is then set to grow rapidly throughout the 2040s and 2050s.</li></br>\r\n\r\n <li>The employment rate of those aged 15-24 has decreased significantly since 2008.</li></br>\r\n\r\n <li>Early retirement is common in the Czech Republic, although one’s pension is reduced if one retires early. The basic condition that has to be fulfilled to enable a person to retire early is that they have accumulated pension contributions for the required number of years.</li></br>\r\n\r\n<li>The Czech Republic joined the EU in 2004 and has relatively recently adopted EU legislation on systematic OSH management. This has meant changes to the orientation of regulatory strategies on OSH and a rapid move from a prescriptive approach towards process-based OSH management (as required by the OSH Framework Directive). The transition has been hampered by a lack of workplace representation.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The Czech welfare state follows the Central and Eastern European social welfare model, which is still in a transitional phase and underwent major reforms in the 1990s, e.g. the a modern  pension insurance system was introduced based on employee contributions. Social security spending is comparatively low. Social partners have a relatively limited role in and relatively little influence on the development of socio-economic policies.\r\n\r\n</li></br>\r\n\r\n <li>In the Czech Republic, the responsibility for OSH is split between the Ministry of Labour and Social Affairs and the Ministry of Health. Health insurance companies have an important role in the promotion of healthy working conditions and in the organisation and implementation of preventive programmes targeting both employers and employees.\r\n\r\n</li></br>\r\n\r\n <li>The Czech tripartite body — the Council of Economic and Social Agreement — includes representatives of the largest trade union organisations, of the main employers’ organisations and of the government. OSH policies are part of the agenda of the council, including through the work of its Task Force for OSH.</li></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Czech_Republic','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-czech/view'),('DE','Germany',4,'0','<ul><li> The expected shortage of skilled labour is a concern. A shortage in skilled labour would seriously affect the German model of production, which focuses on the production of high-quality, high-tech goods and thus relies heavily on skilled labour.</li> </ul>\r\n\r\n<ul> <li>There is a continuous need for policies promoting sustainable working conditions because:\r\n\r\n<ul> <li> the majority of those who retire early do so for health reasons;</li>\r\n\r\n<li> many workers report that they suffer from long-standing illnesses and the prevalence of long-standing illnesses among the employed is higher in Germany than in the EU-28 generally. Employees between 55 and 64 are the most affected by these illnesses, with 40.9 % affected.</li> </ul></li> </ul>\r\n\r\n<ul> <li> The dual nature of the regulatory system and the sectoral nature of the organisation of social insurance institutions present a challenge for coordinated prevention strategies and in terms of avoiding duplications.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>In Germany, the population has been ageing since 1960 and, with a population older than the EU average, Germany has been working on the issue of demographic change in society and in the world of work for many years.\r\n\r\n<ul> <li>The median age in Germany is 45.3. This is more than 3 years over the median age in the EU-28. It will continue to rise but will come to a standstill at 50 by the year 2040, which will still be 4 years higher than the projected European median age.</li>\r\n\r\n<li>Of pensioners aged 50-69, 30.5 % quit working for health or disability reasons.</li>\r\n\r\n<li>The healthy life years expectancy at the age of 65 (and 50) is below the EU-28 average, especially for men.</li></ul>\r\n\r\n\r\n\r\n<br><li>In 2013, psychological risk factors were added to the Occupational Safety and Health Act. In particular, employers have to conduct workplace risk assessments of physical and psychological risk factors (§5 ArbSchG). </li> </ul>\r\n\r\n<ul><li>According to the ESENER results, Germany has low average OSH management composite scores (i.e. a low number of measures). This can be explained by the fact that Germany had to change the orientation of its regulatory strategies on OSH towards a process-based participatory OSH management approach when transposing the European Framework Directive. The dual nature of the regulatory system, in combination with its federalism, presented a number of challenges to implementing the Framework Directive.</li>',NULL,NULL,NULL,NULL,'<ul><li><b>The continental welfare state model, which applies to Germany,</b> is characterised by a Bismarckian welfare system, i.e. a system of welfare benefits financed by workers’ and employers’ contributions and based on income rather than risks. It includes variable trade union and state influence and a high proportion of expenditure on old-age pensions, reflecting the low labour-force participation of older workers and early retirement ages. The well-funded welfare system enables poverty reduction, high-quality health care and disability pensions, but one of the weaknesses of the model is that it is sensitive to employment conditions and demographics.</li><br/>\r\n\r\n	<li>Social insurance organisations play an important role in prevention and rehabilitation and return-to-work activities. \r\n\r\nIn Germany there is a dual system of OSH characterised by:<ul>\r\n\r\n	<li>Regulation by the Federal Government and enforcement by the 16 regional states (Länder)</li>\r\n\r\n	<li>Autonomous accident insurance institutions for the industrial and public sectors.</li></ul>\r\n\r\n	<li>There are also several platforms to support stakeholder cooperation, and social partners play an important role in OSH in Germany.</li></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Germany','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-germany/view'),('DK','Denmark',4,'0','<ul><li>Socio-demographic disparities in mortality have increased during recent decades in Denmark. This is a concern, as the statutory retirement age is increasing. Efforts should focus on occupations with arduous working conditions. Preventive measures with regard to these hazardous occupations should be prioritised not only by the authorities but also by social partners.</li></br>\r\n\r\n <li>Another challenge is helping small and medium-sized enterprises (SMEs) to improve safety and health at work. Age management needs to be promoted more particularly in SMEs.\r\n\r\n</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Denmark’s population is moderately old, and will experience a relatively slow pattern of ageing from 2040. Population ageing is less rapid in Denmark than in other EU countries on average.</li></br>\r\n\r\n <li>The labour market participation rates of older people in Denmark are already among the highest in the EU.</li></br>\r\n\r\n <li>The statutory pension age — currently 65 years — will increase gradually to 67 during the period 2019-2022. Subsequently, it will be linked to changes in life expectancy.\r\n\r\n</li></br>\r\n\r\n<li>The mandatory retirement age of 70 for civil servants was abolished in 2008.</li></br>\r\n\r\n<li> According to the results of the European Survey of Enterprises on New and Emerging Risks (ESENER), Denmark has the highest average number of OSH management measures. A process-oriented regulatory framework for OSH had been implemented in Denmark long before the transposition of the Framework Directive.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Denmark can be grouped among the Nordic welfare states. The welfare system is characterised by the universality of its social welfare protection, the uniformity of benefits — based on need rather than income — and the unity of the state-centred management of welfare, based on taxation. The model features high social inclusion, high trade union density (in 2013, the rate was at 66.8%) and strong national institutions. The welfare system provides childcare facilities, as well as care for the aged and the handicapped, which are seen as necessary to empower people to combine gainful employment with family obligations, thus fostering participation (in particular women’s participation), a healthy work–life balance and equality in the modern ageing society.</li></br>\r\n\r\n <li>The Danish system for OSH and employment is based on a division of tasks between the state and social partners. Denmark has a long tradition of tripartite social dialogue in the field of the work environment and working conditions. Social partners have an important role in the development of policies related to OSH through the Working Environment Council.</li></br>\r\n\r\n <li>Collective agreements have a strong regulatory function in Denmark.</li></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Denmark','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-denmark/view'),('EE','Estonia',2,'0','<ul><li>At policy level, Estonia has recognised the challenges of an ageing population, including for employment and safety and health at work. The Active Ageing Development Plan 2013-2020 is the first general framework for addressing the challenges of an ageing workforce, linking health, skills development and participation in the labour market. The strategy now needs to be developed into a concrete action plan.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Estonia’s population is still somewhat younger than the EU population on average. However, there has been a noticeable increase in median age since the 1970s — from 34 in 1970 to 40 in 2012. The proportion of the population aged 65 or over is currently (2015) comparatively low, and is projected to increase slowly until 2020. However, it is then set to grow rapidly throughout the 2040s and 2050s.</li></br>\r\n\r\n <li>Estonia joined the EU in 2004 and has relatively recently adopted EU measures on systematic OSH management. This has meant changes to the orientation of regulatory strategies on OSH and a rapid move from a prescriptive approach towards process-based OSH management (as required by the OSH Framework Directive). The transition has been hampered by a lack of workplace representation. This could explain the country’s relatively low average score for number of OSH management measures, according to the European Survey of Enterprises on New and Emerging Risks (ESENER).</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Estonia’s welfare state follows the Central and Eastern European welfare model, which is still in a transitional phase. The system in general is strongly state-centred, with moderate redistribution of income and relatively high levels of unemployment, low social spending, high income inequality and a low minimum wage. Social partners have a limited role in and relatively little influence on the development of socio-economic policies.</li></br>\r\n\r\n <li>The single administrating institution for the Work Ability Reform will be the Estonian Unemployment Insurance Fund, which will organise:</li>\r\n\r\n <ul><li>assessment of working ability;</li>\r\n\r\n <li>payment of working ability benefits;</li>\r\n\r\n <li>provision of labour market services; and</li>\r\n\r\n <li>work-related rehabilitation and provision of technical aids.</li></ul></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_%E2%80%93_Estonia','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-estonia/view'),('ES','Spain',2,'0','<ul><li>Considering the continuing ageing of the population and the low employment rates of older workers, especially women, there is a need for more emphasis in policy development on increasing labour market participation by improving employability and working conditions, and developing vocational rehabilitation and RTW systems.</li>',NULL,NULL,NULL,NULL,'<ul><li>Spain has a population that was already relatively old in 2010. The median age today is more or less the same as in the EU population as a whole (around 42 years). The ageing of the Spanish population is predicted to continue and the old-age dependency ratio will increase from 26 % in 2012 to 54 % in 2060.</li>\r\n <br><li>The employment rate of workers aged between 55 and 64 in Spain has been increasing since 2002, although not as rapidly as in the EU as a whole. In 2015, it was more or less at the same level it had reached before the crisis in 2008 (47 % compared with 53 % in the EU-28).</li>\r\n <br><li>In Spain, the OSH of older workers, sustainable work, and rehabilitation and return-to-work issues have not been a priority, and strategies, programmes and policies dedicated to safety and health at work or to employment policies address these issues only marginally. Policy areas are not joined up and high youth unemployment and the curbing public expenditure militate against taking a longer term perspective on sustainable work and investing in programmes to promote early return to work.</li>\r\n<br><li>On joining the EU, Spain had to change the orientation of its regulatory strategies on OSH to a process-based, participatory OSH management approach when transposing the European Framework Directive. Spain used the implementation of the Framework Directive as an opportunity to undertake major reform of its OSH regulatory system, including by introducing structures for workers’ participation. This may explain why Spain achieves such high scores in ESENER (the European Survey of Enterprises on New and Emerging Risks) for number of OSH management measures.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Spain follows the Southern/Mediterranean welfare state model. It is a mixed system due to reforms of the healthcare system and the decentralisation of administration to regions and local communities. The model is characterised by a high proportion of expenditure on old-age pensions, reflecting the low labour-force participation of older workers and early retirement ages; it is also characterised by reliance on support from family networks. </li>\r\n <br><li>Safety and health technicians have a central role in OSH activities in Spain. Prevention services must be accredited and able to offer services in occupational medicine, occupational safety, industrial hygiene, ergonomics and occupational psychology.</li></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Spain',NULL),('FI','Finland',4,'0','<ul><li> Finland’s main challenge is to instil a culture of workplace well-being and sustainable work in all workplaces, in particular in small and micro enterprises.</li> </ul>\r\n\r\n<ul> <li> Compared with the EU average, a higher proportion of pensioners aged 50 to 69 years in Finland reported that they quit work because of their own health or disability (31 % in Finland; 21 % in the EU-28). In addition, Finnish workers report less painful working conditions but more work-related health problems than the EU average: a much larger proportion of older employees have reported work-related health problems in Finland (32 %) than the EU average (11 %).</li> </ul>',NULL,NULL,NULL,NULL,'<ul><li>Finland has a moderately old to older population, and will experience a very moderate pattern of ageing from 2040.\r\n\r\nIn 2013, its median age was about the same as the European average, and in 2020 it is projected to be lower than the EU average.</br>\r\n\r\n<br>The ageing process started earlier in Finland than in most European Member States, and the first programme ‘The Finnish National Programme on Ageing Workers’ ran from 1998 to 2002.</br>\r\n\r\n<br>Finland has been addressing the challenges of an ageing population, including working conditions, for several decades now, having understood early the necessity of prolonging working lives and, in order to do this, of adopting a sustainable approach to work and working conditions.</br>\r\n\r\n<br>The concept of work ability was developed in the 1980s and is central to Finland’s legislation and policies on health and safety at work.</br></li>\r\n\r\n <br><li>The Occupational Health Care Act makes it mandatory for all employers to arrange professional occupational health care services for employees, either by contracting a public health centre or by contracting a private clinic that has staff qualified in occupational health care. Occupational health care services are required to conduct workplace assessments and related action plans; to implement health inspections, including work ability assessments and ergonomic assessments; to arrange professional rehabilitation; to plan and implement programmes to improve and maintain work ability; and to monitor the work ability of employees with reduced capacity to work. The Act specifically aims to improve work ability at all stages of a person’s career.</li>\r\n\r\n <br><li>According to the ESENER results, Finland has high OSH management composite scores (i.e. a high number of measures). This might be explained by the fact that Finland’s process-based participatory OSH management approach largely predates the Framework Directive and there is a tradition in Finland of well-established industrial relations with a strong role of trade union representation and consultation.</li>',NULL,NULL,NULL,NULL,'<ul><li><strong>The Nordic welfare model</strong>, which applies to Finland is based on the Beveridgian welfare model, which is characterised by the universality of its social welfare protection, the uniformity of its benefits, the fact that it is based on needs rather than income, and the unity of the state-centred management of welfare, based on taxation. The model features high social inclusion, high trade union density and strong national institutions. It includes child care facilities, together with the provision of care for older people and those with disabilities, which are seen as necessary to empower people to combine gainful employment with family obligations, thus fostering (female) participation, work–life balance and equality in the modern ageing society.</li></br>\r\n\r\n	<li>The social partners have an important role in the development of policies related to OSH.</li></br>\r\n\r\n	<li>There is a long tradition of cross-policy cooperation on issues related to demographic change. The Ministry of Social Affairs and Health has played a key role in coordinating the development and implementation of policies, programmes and strategies.</li>\r\n\r\n</ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Finland','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-finland/view'),('FR','France',3,'0','<ul><li>The emphasis on middle age groups is insufficient in the current legal and policy framework, and most measures come too late in the worker’s career to be effective and ensure a sustainable working life. A life-course approach to career management, professional mobility, training and the diversity of career paths, is needed for keeping workers in employment for longer</li></br>\r\n\r\n <li>The main issues preventing an effective approach to sustainable working lives are the fragmentation of the legal and policy initiatives, the lack of coordination among various actors in the field and the limited number of awareness-raising and dissemination activities.</li></br>\r\n\r\n <li>The complexity of the current system leads to a lack of awareness of existing instruments, tools and initiatives.</li></br>\r\n\r\n<li>There are concerns about a dual labour market being created, with an increasing number of workers who are significantly exposed to risks and for whom existing prevention mechanisms would be irrelevant or inapplicable.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>France has a moderately old population, and will experience a very moderate pattern of ageing from 2040.</li></br>\r\n\r\n <li>A high proportion of older workers in France (47.1 %) reported work-related health problems in 2013 compared with the EU average (11.4 %). Work-related psychosocial health problems are comparatively more frequent, maybe as a result of the higher proportion of service-related occupations, in France than in the EU generally.</li></br>\r\n\r\n <li>The concept of arduous work is incorporated in French labour law.</li></br>\r\n\r\n<li>According to the ESENER results, France has medium composite scores, as regards the number of OSH management measures, which might be explained by the challenge of accommodating the requirements of process-based participatory OSH management when transposing the Framework Directive.</li></br>\r\n\r\n<li>Historically, occupational medicine and occupational physicians have played a central role. There is a relatively high number of labour inspectors. The role of trade unions and social dialogue in the labour market and in health and safety is significant, and health and safety committees are an important element of OSH management.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The <strong>French OSH system</strong>  is composed of two major public authorities: the <strong>General Labour Directorate of the Ministry of Labour,</strong> responsible for labour policy, and the <strong>Ministry of social affairs and health</strong>, responsible for social security services.</li></br>\r\n	<li><strong>Occupational health services:</strong> employers are obliged to set up an internal company occupational health service if they have more than 500 employees or to subscribe to an intercompany service if they employ fewer than 500 employees or do not want to create an internal service.</li></br>\r\n<li>Intercompany services are non-profit bodies structured into one or more geographical, and sometimes trade, sectors. They are funded by their member companies. The working teams are composed of occupational physicians, authorised occupational risk prevention officers (IPRPs) and nurses. The independent and inter-enterprise occupational health services are regulated in French Law No. 2011-867 of 20 July 2011 on the organisation of occupational health care.</li></br>\r\n	<li>This model is characterised by a variable trade union and state influence and a high proportion of expenditure on old-age pensions, reflecting the low labour-force participation of older workers and early retirement ages in this country.</li></br>\r\n<li>The well-funded welfare system enables poverty reduction, high-quality health care and disability pensions, but one of its weaknesses is that it is sensitive to employment conditions and demographics.</li></br>\r\n<li>While trade union density is very low in France (around 8 %), social dialogue is considered strong due to very high levels of collective-bargaining coverage (93 %). Collective bargaining at national and company level is very institutionalised and influential, in particular for working conditions and health and safety at work, which is also demonstrated by the large number of social partners’ agreements and initiatives in this area.</li></br>\r\n</ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_France','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-france/view'),('HR','Croatia',1,'0','<ul><li>Although the employment rate of 55- to 64-year-olds rose significantly between 2002 (23%) and 2013 (38%), it is still low compared with an EU average of 50%. This is a challenge, considering the magnitude of projected population ageing in the upcoming decades.</li></br>\r\n <li>Although the prevalence of shift work decreases with increasing age, the proportion of older workers having to work shifts is significantly higher in Croatia (30%) than in the EU as a whole (14%). The exposure of older workers to shift work needs to be addressed.</li></br>\r\n <li>Taking into account that the share of older workers who reported that work had affected their health negatively is relatively high in Croatia and that satisfaction with working conditions among older workers is considerably lower than the EU average, the is a need to develop policies and measures promoting sustainable work.</li>\r\n</ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The median age in Croatia is similar to that of the EU population’s as a whole (41.7). The proportion of the population aged 65 or over is currently (in 2015) comparatively low and is projected to increase slowly until 2020. However, it is set to grow rapidly throughout the 2040s and 2050s.</li></br> \r\n <li>In 2010, the proportion of older workers who thought they would be able to do their current job at the age of 60 was considerably lower in Croatia (58%) than in the EU as a whole (71%).</li></br> \r\n <li>Satisfaction with working conditions among older workers in Croatia decreased between 2005 (72%) and 2010 (68%) and was at a considerably lower rate than the EU average for 2010 (84%).</li></br> \r\n<li>Croatia joined the EU in 2013 and has relatively recently adopted the EU approach to systematic OSH management. This has meant changes to the orientation of regulatory strategies on OSH and a rapid move from a prescriptive approach towards process-based participatory OSH management (as required by the OSH Framework Directive). The transition has also been hampered by a lack of workplace representation.\r\n</li></br></ul>',NULL,NULL,NULL,NULL,'<ul><li>In Croatia, institutional competences related to the field of OSH in general are shared by three main authorities:</li></br>\r\n<ul><li>the Ministry of Labour and Pension System</li>\r\n <li>the Ministry of Health</li>\r\n <li>the Ministry of Social Policy and Youth</li></ul></br>\r\n <li>The National Council for the Protection of Work is composed of thirteen members, five representatives of the state, two representatives of employers, two representatives of workers and four experts in the field of the labour market.</li></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_National_Level_-_Croatia','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-croatia/view'),('HU','Hungary',2,'0','<ul><li>Considering the projected rapid increase of the old-age dependency ratio, the low employment rates of older age groups, and the health status of the population, there is an urgent need to develop and implement polices addressing the consequences of workforce ageing and longer working lives.</li>\r\n <br><li>Age discrimination also needs to be addressed, as discrimination against those over 55 years old is thought to be widespread in Hungary, where three quarters (75%) of respondents to the Special Eurobarometer Survey 393 believed that this was the case.</li>\r\n <br><li>There is a lack of awareness of and communication about the initiatives that are in place. Moreover, (post hoc) impact assessments of the programmes are often not carried out, making it almost impossible to assess the effectiveness of their implementation.\r\n</li>\r\n<br><li>The criteria of reduced work capacity that must be met for a person to receive support for rehabilitation are quite stringent, meaning that people with health problems who have a work capacity of more than 60% do not receive support to help them stay employed or go back to work.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The median age in Hungary in 2012 was below the EU average (42). The proportion of the population aged 65 or over is currently (2015) comparatively low and is projected to increase slowly until 2020. However, it is then set to grow rapidly between 2020 and 2040. The old-age dependency ratio will increase from 25% to 52% between 2012 and 2060.\r\n</li>\r\n <br><li>Both life expectancy and estimated healthy life years at the age of 65 were lower by several years in Hungary than in the EU as a whole.</li>\r\n <br><li>Since the Hungarian social care and pension system is unable to finance itself, the government has taken radical steps to guarantee the viability of the pension system and to achieve the objective of increasing the employment rate of older workers.</li>\r\n<br><li>Hungary joined the EU in 2004 and has relatively recently adopted EU measures on systematic OSH management. This has meant changes to the orientation of regulatory strategies on OSH and a rapid move from a prescriptive approach towards process-based OSH management (as required by the OSH Framework Directive). The transition has also been hampered by a lack of workplace representation.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Hungary belongs to the Central and Eastern European social welfare model, mainly characterised by a Bismarckian approach to social welfare, in general strongly state-centred and dependent on general taxation rather than contributions. Social partners have a very limited role in and little influence on the development of socio-economic policies in Hungary.</li>\r\n <br><li>Over the past couple of years, the institutional system has changed several times and it has therefore been difficult to keep up to date with the authorities responsible for coordination between the various OSH actors. \r\n</li>\r\n <br><li>The involvement of social partners has decreased. </li>\r\n<br><li>The National Economic and Social Council (NESC), established in 2011, includes a wider range of organisations than it has done in the past, but the government is not represented and the NESC’s powers are limited to giving advice. </li>\r\n<br><li>At present, key negotiations on OSH issues usually take place at company or organisation level.</li></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Hungary','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-hungary/view'),('IE','Ireland',2,'0','<ul><li>There is a lack of systems and structures promoting the return to work of people who have suffered a health problem. Vocational rehabilitation and return to work will need to be better addressed, in a systematic and comprehensive way.</li>\r\n <br><li>The Workplace Health and Well-Being Strategy, which was a comprehensive review of the whole field, did deal with age-related issues and disability. However, this strategy seems to have fallen victim to the economic crisis and a lack of coordination with other departments. The HSA were taking a number of positive and holistic steps up to 2008 to tackle health and work ability issues, but these were derailed by the crisis. </li>\r\n <br><li>There is a lack of considerations related to the world of work in the wider government initiative Health Ireland (of which the National Positive Ageing Strategy is part). However, the success of such an initiative depends on the inclusion at its core of considerations related to work. The presence of HSA on the implementation group may help to introduce a focus on work.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The Irish population is much younger than the overall EU population (in 2013, the median age in Ireland was 35 compared with 42 in the EU). Ireland shows a moderate ageing pattern, with sustained ageing expected to take place until 2050.</li>\r\n <br><li>The crisis has had a strong impact on the youth employment rate, which decreased drastically between 2008 and 2012, and fell below the EU average in 2012 (28.2% compared with 32.9%).</li>\r\n <br><li>The effects of the economic crisis put additional pressure on Ireland to reduce public spending on pensions as a percentage of GDP.</li>\r\n<br><li>There is no single fixed retirement age for employees and retirement age is usually fixed in contracts of employment. Tripartite bargaining is very common in Ireland.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Ireland belongs to the Anglo-Saxon welfare model, with a liberal (not state-centred) approach to welfare; a targeted, rather than redistributive, system of social services provision; and less decision-making power for and lower interest among trade unions in relation to OSH-related issues. The model is characterised by a limited proportion of social expenditure on pensions, with subsidies directed mostly towards the working-age population. Involvement of social partners on the development of socio-economic policies is limited.</li>\r\n <br><li>The HSA is the national statutory body responsible for enforcing safety and health law. The authority reports to the Minister for Jobs, Enterprise and Innovation. The HSA is concerned almost exclusively with OSH and has virtually no involvement in issues to do with general conditions of work. In addition to enforcement, HSA tasks include providing guidance and advice and organising training. The Board of the HSA is a tripartite organisation that includes social partners and representatives of other interests associated with OSH.</li>\r\n <br><li>Approximately a third of employees in Ireland belong to a union. Collective bargaining in Ireland is a voluntary process in that there is no obligation on either the employer or the union to enter into negotiations.</li></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Ireland','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-ireland/view'),('IT','Italy',2,'0','<ul><li>Considering the continuing ageing of the population and the low employment rates of older workers, especially women, there is a need for more emphasis in policy development on increasing labour market participation by improving employability and working conditions and developing vocational rehabilitation and RTW systems.\r\n</li>\r\n <br><li>There is a need for a more holistic approach to vocational rehabilitation and reintegration into work, and for the creation of an institutional network that facilitates the effective and full provision of vocational rehabilitation services. \r\n</li>\r\n</ul>',NULL,NULL,NULL,NULL,'<ul><li>Italy’s population has been continuously ageing since 1960. The median age in 2015 was 3 years older than the median age of the EU overall population (45 compared with 42). The ageing of the Italian population is predicted to continue and although the country will experience a very moderate pattern of ageing from 2040, the old-age dependency ratio will increase from 33.7 % (the highest in the EU) in 2015 to 53 % in 2060 (above the predicted EU average of 50 %).</li>\r\n <br><li>Italy, strongly affected by the 2008 economic crisis, has been focusing over the past few years on increasing the employment rate of all age groups, with a particular focus on younger workers.</li>\r\n <br><li>The employment rate of those aged 55-64 is relatively low in Italy, around 48 % compared with the EU average of more than 53 % in 2015. </li>\r\n <br><li>The proportion of pensioners (aged 50-69) who stopped working for health or disability reasons is 12.5 % in Italy, lower than the EU average (21 %).</li> <br><li>	Part-time sick leave is possible in Italy. A worker can return to work part-time during their recovery period while still receiving partial sickness benefit.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Italy follows the Southern/Mediterranean welfare state model. It is a mixed system due to reforms of the healthcare system and the decentralisation of administration to regions and local communities. The model is characterised by a high proportion of expenditure on old-age pensions, reflecting the low labour-force participation of older workers and early retirement ages; it is also characterised by reliance on support from family networks. Social inequality and regional disparities are on the rise again.</li>\r\n<br><li>Social dialogue is very strong in Italy, with a long-standing above-average trade union density, and social partners have recently focused on the issue of the employment rate of older workers, although they have not yet addressed the question of their working conditions.\r\n</li>\r\n <br><li>The regions play an important role; for example, the National Programme Promoting Active, Vital and Dignified Ageing encourages regions and local authorities to set up programmes to fully implement the national strategy and exchange information and ideas.</li>\r\n<br><li>The OSH system in Italy is characterised by the close involvement of the occupational physician, who has a legally defined role in the RTW process.\r\n</li>\r\n</ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Italy','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-italy/view'),('LT','Lithuania',1,'0','<ul><li>In general, Lithuania has not been addressing sustainable work in the context of an ageing workforce in a systematic and coordinated way, although some actors in the field have started paying attention to the question of the work ability and employability of older workers through individual projects and initiatives.</li></br>\r\n <li>The challenges for Lithuania will be to further increase the employment rates of older age groups as the ageing process accelerates after 2020 and to address health inequalities through integrated policies and coordinated implementation.</li></br>\r\n <li>At workplace level, the role of OSH services for early detection of work-related health problems (and early intervention) needs to be strengthened.</li></br>\r\n<li>The system for rehabilitation and vocational rehabilitation is quite well developed in Lithuania, but covers only people with severe and moderate physical disabilities.</li>\r\n</ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Lithuania’s population has been ageing since 1970, and by 2014 the median age had risen to around 42 years (the same as the EU average). The proportion of the population aged 65 or over is currently (in 2015) comparatively low, and is projected to increase slowly until 2020. However, it is set to grow rapidly after that. The old-age dependency ratio will increase from around 27% in 2014 to 46% in 2060.</li></br>\r\n <li>Both life expectancy and estimated Healthy Life Years at the age of 65 are lower than the EU average, in particular for men. </li></br>\r\n <li>Lithuania joined the EU in 2004 and has relatively recently adopted EU legislation on systematic OSH management. According to the results of the European Survey of Enterprises on New and Emerging Risks (ESENER), Lithuania has relatively few OSH management measures. This can be explained by the fact that the country had to change the orientation of its regulatory strategies on OSH from a prescriptive approach to process-based participatory OSH management when transposing the European Framework Directive. The transition has been also hampered by a lack of workplace representation.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Lithuania, with other Baltic, Central and Eastern European countries, can be categorised as having a post-socialist welfare state model, which has such features as high coverage, but with relatively low benefit levels. Insurance-based schemes play a major part in the system of social protection. The model is mainly characterised by a Bismarckian approach to social welfare. Social partners have a relatively limited role in and little influence on the development of socio-economic.</li></br>\r\n <li>Trade union density is low in Lithuania, with a generally weak sectoral social dialogue, and there is a lack of consolidated system of industrial relations. Social dialogue on safety and health issues is limited.</li></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Lithuania','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-lithuania/view'),('LU','Luxembourg',2,'0','<ul><li>The employment rate of workers aged between 55 and 64 in Luxembourg remains one of the lowest in the EU at 41 % in 2012.\r\n</li>\r\n <br><li>The new bill modifying Luxembourg\'s Labour Code and introducing measures on age management (Bill No 6678) will create a comprehensive policy framework for promoting age management in companies.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Although the Luxembourgish population is ageing, the median age of the population in Luxembourg was still younger in 2015 than the EU-27 average (39 compared with 42). The ageing of the population is predicted to continue, albeit very moderately.  The old-age dependency ratio will increase from 20.6 % in 2015 to 35 % in 2060, which is substantially lower than the EU average (50 % in 2060).</li>\r\n <br><li>Luxembourg is a country with a permanently increasing immigration. Immigrants are on average quite young, which partly explains the country’s relatively young population.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Luxembourg follows the Continental welfare state model, based on a Bismarckian welfare system, and has developed a generous and comprehensive welfare regime over the previous 100 years, with a further important push during the last two decades. Unlike some European countries, many of which have had to implement cutbacks due to the economic downturn, Luxembourg has expanded and improved its system, partly due to a steady increase in young foreign contributors (immigrants and border-crossing commuters).</li>\r\n <br><li>Despite a relatively strong trade union presence, social dialogue on OSH issues is limited in Luxembourg, both at national level and inside companies.</li></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Luxembourg','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-luxembourg/view'),('LV','Latvia',2,'0','<ul><li>Taking into account demographic developments in the country, the challenge will be to further increase labour force participation. The national OSH strategy until 2013 included the objective of maintaining work ability for longer working lives. However, concrete activities have been lacking and the concepts of age management and sustainable work are not yet an integral part of employment policies in Latvia.</li></br>\r\n <li>According to the results of Eurostat Special Eurobarometer 393 (2012), discrimination against workers over 55 years old is thought to be widespread in Latvia (63 % of respondents believed this type of discrimination was widespread). Therefore, changing attitudes towards older workers also presents a challenge.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Latvia’s population has been continuously ageing since 1970 and the median age reached 42 in 2012, which was the same as the EU median age. The proportion of the population aged 65 or over is currently (2015) comparatively low, and is projected to increase slowly until 2020. However, it is then set to grow rapidly throughout the 2040s and 2050s.</li></br>\r\n <li>Both life expectancy and estimated healthy life years at the age of 65 were much lower in Latvia than in the EU in general in 2011.</li></br>\r\n <li>Latvia joined the EU in 2004 and has relatively recently adopted EU measures on systematic OSH management. This has meant changes to the orientation of regulatory strategies on OSH and a rapid move from a prescriptive approach towards process-based participatory OSH management (as required by the OSH Framework Directive). The transition has been hampered by a lack of workplace representation.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Latvia’s welfare state follows the Central and Eastern European welfare model, which is still in a transitional phase and could also be characterised as the Bismarckian model of social welfare, in general strongly state-centred, with moderate redistribution of income and relatively high levels of unemployment, low welfare state spending, high income inequality and a low minimum wage. Latvia was also hit hard by the economic crisis, which presented a serious challenge to the social security system.</li></br>\r\n <li>Social partners have a limited role in and relatively little influence on development of OSH policies. Social dialogue is mostly focused on areas such as social and economic policy and relations between employers and employees, and only seldom extends to OSH.</li></br>\r\n <li>Social partners do not appear to have actively addressed the challenges of an ageing workforce. Their activities have been focusing on general OSH conditions, awareness-raising, training and provision of OSH support.</li></br>\r\n <li>The State Labour Inspectorate and the Institute of Occupational Safety and Environmental Health are starting to disseminate good practice examples, through guidelines and seminars, and to undertake awareness-raising activities to support companies. However, these activities are not yet systematic and are not based on any national policy document.</li></ul></br>','https://oshwiki.eu/wiki/OSH_systems_at_national_level_-_Latvia','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-latvia/view'),('MT','Malta',2,'0','<ul><li>Considering the accelerating ageing of the population and the low employment rates of older age groups, there is a need to tackle the related challenges in policy development by public authorities and social partners.</li>\r\n<br><li>Occupational pension schemes and personal pension provisions are still at a very early stage of development.</li>\r\n <br><li>A lower proportion of workers (22 %) in all age categories receive on-the-job training compared with the EU average (26 %). The 55-64 age group accounts has the lowest rate of participation in lifelong learning (17 %). Older workers face various barriers when participating in skills development (e.g. negative employer attitudes, discrimination, lack of information about options, financial issues, etc.)</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The median age of Malta’s population increased considerably between 1980 (29 years) and 2012 (40 years), but is still slightly lower than the EU average. However, it is predicted that population ageing will speed up during the decades to come. The proportion of the population aged 65 or over is currently (2015) comparatively low and is projected to increase slowly until 2020. However, it is then set to grow rapidly until 2050.\r\n</li><br><li>In 2013, the employment rate of people aged 55-64 years was, at 36 %, particularly low compared with the EU average of 50 %.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Malta follows the Southern/Mediterranean welfare state model, with a mixed system as a result of various reforms. The model is characterised by a high proportion of expenditure on old-age pensions, reflecting the low labour-force participation of older workers and early retirement ages.\r\n</li>\r\n <br><li>Industrial relations in Malta are traditionally based on voluntary, bipartite, collective bargaining at enterprise level. However, in recent decades, a pattern of corporate, national-level bargaining, based on a social dialogue model, began to emerge. This is reflected in OHSA’s structure which ensures that tripartite cooperation and social dialogue take place in all its work. As a result, social dialogue and tripartite cooperation is very strong on OSH aspects in Malta.</li>\r\n <br><li>None of the social partners has its own OSH-related strategy, initiative or work programme relating to active ageing.</li>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Malta','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-malta/view'),('NL','Netherlands',4,'0','<ul><li>The issue of OSH and sustainable work for the growing number of self-employed people is a growing concern. Since 2000, the number of self-employed workers has risen significantly in the Netherlands, particularly among older workers. The number is nearly twice as high as the EU average and is predicted to increase further (if tax benefits for the self-employed continue to exist). Many of these people are in a disadvantageous situation as regards OSH, workers’ representation, etc.</li></br>\r\n	<li>There is a need for a more targeted approach to RTW (e.g. a focus on specific diseases such as cancer), including where the employee returns to the workforce with a new company. The use of an RTW policy should also be introduced earlier in the rehabilitation process.\r\nThe insufficient number of occupational physicians is a challenge for the implementation of re-integration and coaching services for workers returning to work after sick leave. </li>\r\n</ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The population in the Netherlands has been ageing since the 1960s, and this is expected to continue, with the fastest ageing happening between now and 2040, after which the country will experience a very moderate pattern of ageing.</li></br>\r\n <li>Since 2004, employers have been obliged to pay (at least) 70 % of workers’ salaries for a maximum duration of two years’ sickness absence. This creates an incentive for employers to use OSH services to improve working conditions and to ensure that employees who are on sick leave return to work as soon as possible. If necessary, employers are obliged to implement workplace adaptations.</li></br>\r\n <li>Working Condition Catalogues (Arbo-catalogi) are social partners’ agreements on managing (specific) safety and health risks at sector, branch or company level. They provide practical solutions to meet the requirements of the Working Conditions Act and other legislation. They exist in all major sectors and branches of the economy.</li></br>\r\n<li>The Netherlands had a process-oriented regulatory framework for OSH long before the transposition of the Framework Directive. Participative OSH management is widespread, with works councils having a central role.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The Netherlands can be characterised as following the Continental welfare state model; however, there are also similarities between the Netherlands and the Nordic countries in terms of the generosity of the welfare state and of labour market characteristics. The Netherlands has, over time, reformed its welfare system, for example by introducing legislation that increases employers’ responsibility for the provision of sickness benefits.</li></br>\r\n	<li>The Netherlands has a strong culture of social dialogue.</li></br>\r\n	<li>Several platforms have been set up to support stakeholder cooperation.</li></br>\r\n<li>The Dutch system has emphasised the role of the employer and the occupational physician, rather than the medical specialist, in rehabilitation and return-to-work processes. This has been praised by many international organisations, such as the Organisation for Economic Co-operation and Development.</li></br></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Netherlands','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-netherlands/view'),('NO','Norway',3,'0','<ul><li> Negative stereotypes concerning older workers still need to be combatted actively. Prohibition of discrimination because of age is not always followed by employers.</li></ul>\n\n<ul><li>A key political challenge is how to encourage employers to take on more senior initiatives in their companies and, to a larger extent, to follow the legal ‘senior’ rights in the Working Environment Act. Another challenge will be to ensure that employers are active in the return-to-work process of workers on sickness absence and that coordination between the employer and the NAV is efficient so that the necessary rehabilitation measures can be put in place as early as possible in the process.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Norway has a moderately old to older population, and will experience a very moderate pattern of ageing from 2040.</li></ul>\r\n\r\n<ul><li>Norway has a large proportion of older people receiving disability benefits:  in the first quarter of 2012, 19.6 % of those aged 55-59 and 30.5% of those aged 60-64 received benefits.</li></ul>\r\n\r\n<ul><li>There is no official retirement age in Norway. The take-up of pension benefits is possible at any age between 62 and 75. The effective retirement age relatively high in Norway. A Norwegian employee stays 2-4 years longer in the labour market than the EU average.</li></ul>\r\n\r\n<ul><li>The proportion of people aged over 50 who think they could do their current job at the age of 60 is higher in Norway (91 %) than the EU average (71 %).</li></ul>\r\n\r\n<ul><li>The role of the employer in the return-to-work process is quite central in Norway. The employer must demonstrate that they have done everything they can to reintegrate the worker (through work adaptations).</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>This model is characterised by high social inclusion, high trade union density and strong national institutions. It includes child care facilities, together with the provision of care for elderly people and those with disabilities, which are seen as necessary to empower people to combine gainful employment with family obligations, thus fostering (female) participation, work–life balance and equality in the modern ageing society.</li></br>\r\n	<li>There is a strong tradition of social dialogue on issues concerning working conditions in Norway, based on legislation and collective agreements. The social partners are very active in all aspects of the development of senior policies.</li></br>\r\n	<li>Cooperation between the government, employer organisations and trade unions takes place at many levels (e.g. in the Advisory Committee of the Norwegian Labour Inspection Authority).</li></br>\r\n<li>The Centre for Senior Policy plays an important role in the continuous development of senior policy in Norway.  CSP’s main actions include raising awareness among employers and employees on issues related to the ageing of the workforce.</li></br></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_%E2%80%93_Norway','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-norway/view'),('PL','Poland',2,'0','<ul><li>Given that Poland’s population will be ageing at a growing rate during the next decades, and bearing in mind the low employment rates of older age groups, there is an urgent need to address the related challenges. Employment policies and strategies need to be complemented with initiatives aiming to improve working conditions.</li></br>\r\n <li>Occupational and social rehabilitation mainly targets disabled people. General practitioners (GPs) are reluctant to recommend the early return to work of people suffering from health problems, fearing that going back to work too early may exacerbate the person’s condition, and there is a lack of cooperation between GPs and workplaces. The proportion of enterprises in Poland that have a procedure to support employees returning to work after long-term sickness absence is much lower than the EU average. The issue of vocational rehabilitation and RTW needs to be addressed.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The population in Poland is younger than the EU average (the median age in 2012 was 38 in Poland and 42 in the EU). The proportion of the population aged 65 or over is currently (2015) comparatively low, and is projected to increase slowly until 2020. However, it is then set to grow rapidly throughout the 2040s and 2050s.</li></br>\r\n <li>The employment rate of 55- to 64-year-olds is low in Poland, at around 44 % compared with 53 % in the EU as a whole</li></br>\r\n <li>Until recently, the official retirement age in Poland was 60 for women and 65 for men; however, in 2012 these thresholds were raised to 67 for both genders (effective from January 2013). The transition will take place gradually. Early retirement is largely a profession-related benefit and not an age-related one.</li></br>\r\n<li>Poland joined the EU in 2004 and has relatively recently adopted EU measures on systematic OSH management. This has meant changes to the orientation of regulatory strategies on OSH and a rapid move from a prescriptive approach towards process-based participatory OSH management (as required by the Framework Directive).</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Poland’s welfare state follows the Central and Eastern European welfare model, which is still in a transitional phase mainly characterised by a Bismarckian model of social welfare, in general strongly state-centred and dependent on general taxation rather than contributions. Poland’s welfare spending is lower than that of any other EU Member State.</li></br>\r\n <li>The responsibility for OSH is split between different stakeholder groups. There is no single occupational health service in Poland; instead, there are two independent services (the in-house work safety and hygiene service and the external occupational medicine service), supervised by two different ministries, the Ministry of Labour and Social Affairs and the Ministry of Health, and there is a lack of coordination between the two ministries.</li></br>\r\n <li>There is a relatively strong tradition of social dialogue in Poland, especially since the late 1980s, but it remains hard for parties to reach an agreement on sensitive topics concerning OSH.</li></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Poland','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-poland/view'),('PT','Portugal',2,'0','<ul><li>Considering the magnitude of the projected ageing of the population in the coming decades and the fact that the employment rate of 55- to 64-year-olds is relatively low, increasing the employment rate of older age groups will be a challenge, especially in view of the high unemployment rate in the country.\r\n</li>\r\n <br><li>The inequity of the pension system, which favours civil servants, also needs to be addressed.</li>\r\n</ul>',NULL,NULL,NULL,NULL,'<ul><li>The demographic situation in Portugal is similar to that of the overall EU population, although with a somewhat higher median age, 43.5 years in Portugal versus 42.4 years in the EU-28 in 2015. The ageing of the population is predicted to continue and the old-age dependency ratio is projected to increase from 29 % in 2012 to 64 % in 2060 (14 percentage points higher than the estimated EU average in 2060).</li>\r\n <br><li>The employment rate of 55- to 64-year-olds was consistently above the EU average between 2002 and 2011. However, it has been decreasing since 2008 and was lower than the EU average employment rate in 2015 (below 50 % in Portugal compared with above 53 % in the EU as a whole).\r\n</li>\r\n <br><li>Portugal was hit hard by the financial crisis, which led to a severe economic recession and high unemployment rates in the country, increasing inequality and poverty. </li>\r\n <br><li>When joining the EU, Portugal had to change the orientation of its regulatory strategies from a rather prescriptive approach to a process-based, participatory OSH management approach (as required by the European Framework Directive).</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>Portugal follows the Southern/Mediterranean welfare state model. Its welfare system dates back only 40 years and is characterised by universality. State spending on pensions is at one of the highest levels in Europe, but only partly due to population ageing. The economic crisis has placed severe pressure on Portugal’s welfare services, increasing poverty and inequality.\r\n</li></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Portugal','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-portugal/view'),('RO','Romania',1,'0','<ul><li>The OSH and working conditions of the older workforce have been issues of limited concern in Romania and have not been a priority for the various stakeholders and social actors active in the OSH field.</li></br>\r\n <li>Romania has developed a number of policies, focused primarily on increasing the employment rate of older workers. There are initiatives related improving employability of and changing attitudes towards older workers, but they are isolated and not linked to a general policy framework. Considering the demographic development and the low employment rates in Romania, there is a need for more emphasis in policy development on improving working conditions and employability of older workers.</li></br>\r\n <li>Rehabilitation has focused solely on the victims of occupational diseases or accidents or those with a recognised degree of disability. In addition, most measures relate to medical rehabilitation rather than to supporting return to work. There is no coordinating mechanism in place (e.g. between general practitioners and occupational doctors or employers) to encourage the early return to work of people on long-term sick leave. Vocational rehabilitation and RTW policies and systems need to be developed.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The population is somewhat younger than the population of the EU as a whole. The proportion of the population aged 65 or over is currently (in 2015) comparatively low, and is projected to increase slowly until 2020. However, it is set to grow rapidly throughout the 2040s and 2050s. The old-age dependency ratio is projected to increase from 24% in 2012 to 52% in 2060 (similar to the EU average).</li></br>\r\n <li>For a number of physical risk factors (e.g. exposure to tiring positions and carrying heavy loads), older workers in Romania report being more exposed than do older workers in the EU as a whole.</li></br>\r\n <li>Romania joined the EU in 2007 and has relatively recently adopted EU measures on systematic OSH management. It has meant changes in the orientation of regulatory strategies on OSH and a rapid move from a prescriptive approach to regulation to a process-based participatory approach (as required by the Framework Directive). The transition has been hampered by a lack of workplace representation.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The Romanian welfare state follows the Central and Eastern European social welfare model, which is still in a transitional phase and underwent major reforms in the 1990s. The model is in general strongly state-centred and dependent on general taxation rather than contributions. Social security spending is comparatively low in Romania and income inequality is high. Social partners have a relatively limited role in and relatively little influence on the development of socio-economic policies.</li></br>\r\n <li>In Romania, tripartite social dialogue is carried out within institutionalised structures (the National Tripartite Council for Social Dialogue and commissions for social dialogue) established at national, central and local levels, based on Law No 62/2011 on social dialogue, as well as within other consultation frameworks, such as parliamentary work commissions or ad hoc tripartite structures. OSH-related matters are debated in these bodies.</li></ul></br>','https://oshwiki.eu/wiki/OSH_systems_at_national_level_-_Romania','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-romania/view'),('SE','Sweden',4,'0','<ul><li>Preventing sickness absence and creating a work environment that allows more people to participate in the labour market, including those with health problems and disabilities. </li></br>\r\n	<li>Improving OSH in physically and mentally demanding work environments and monotonous or strenuous jobs.</li></br>\r\n	<li>Addressing the trend for women to leave the labour market earlier than men and suffer from more health problems.</li></br></ul>',NULL,NULL,NULL,NULL,'<ul><li>Sweden was Europe’s ‘oldest country’ throughout the 1970s and 1980s. Now the median age is around the EU average, and, as Sweden will experience a very moderate pattern of ageing in the upcoming decades, by 2060 Sweden’s population will be younger than the EU average.</li></br>\r\n	<li>The employment rate for those aged 55-64 is high (over 74 %) compared with the EU average (53 %). Satisfaction with working conditions was slightly higher among older workers in Sweden (88 %) than among older workers across the EU (84 %) in 2010.</li></br>\r\n	<li>Sweden is one of the EU Member States with the most active lifelong learning framework, including with regard to on-the-job training. The proportion of workers receiving on-the-job training (44 %) is substantially higher than the EU average (26 %)</li></br>\r\n<li>The public pension system was reformed in 1999; those changes have allowed flexible retirement from the age of 61 and the possibility to withdraw a full or partial pension and continue to work full time. In the pension system, no early retirement from the public scheme is possible before the age of 61. A mandatory retirement age has been abolished, but the employer’s consent is required for an employee to continue working after the age of 67.</li></br>\r\n<li>According to the results of the European Survey of Enterprises on new and Emerging Risks (ESENER), the Nordic countries, including Sweden, have a high average number of OSH management measures. These Member States have a longer tradition of process-based participatory OSH management and did not have to change the orientation of their regulatory strategies on OSH when transposing the European Framework Directive.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Sweden’s welfare model is characterised by the universality of its social welfare protection, the uniformity of benefits — based on needs rather than income — and the unity of the state-centred management of welfare, based on taxation. The model features high social inclusion, high trade-union density and strong national institutions. The welfare system provides childcare facilities, as well as care for the aged and the handicapped, which are seen as necessary to empower people to combine gainful employment with family obligations, thus fostering participation  - in particular women’s participation - a healthy work-life balance and equality in the modern ageing society.</li></br>\r\n	<li>Social dialogue is very strong in Sweden and social partners play a key role in the promotion of more sustainable working lives. The country has a long tradition of social dialogue, a high level of union representation (with the second-highest trade union density in the EU) and a generally high level of awareness of OSH. About 88 % of Swedish employees are covered by collective agreements.</li></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Sweden','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-sweden/view'),('SI','Slovenia',2,'0','<ul><li>The government makes efforts to promote better working conditions throughout working life, and specifically for the older workforce, and there is a push to implement the concepts of work ability and workplace health promotion. More assistance and guidance is needed to encourage workplaces to implement these theoretical concepts in practice. \r\n</li>\r\n <br><li>Better integration between different policy areas is needed.\r\n</li>\r\n \r\n</ul>',NULL,NULL,NULL,NULL,'<ul><li>The demographic situation in Slovenia is very similar to that in the population of the EU as a whole, with a similar median age (41.7 years) and similar age structure. The ageing of the Slovenian population is predicted to continue, and the old-age dependency ratio will increase from 25 % in 2012 to 53 % in 2060.\r\n</li>\r\n <br><li>Although it increased continuously between 2000 and 2015, the employment rate of 55-64 year olds in Slovenia is still much lower than the EU average (36.6 % in Slovenia compared with 53.3 % in the EU in 2015). </li>\r\n <br><li>	Following the 2013 Employment Relationships Act, greater emphasis has been placed on the employment of older workers, with special rights granted to older workers in terms of opportunities for part-time work/partial retirement and also in terms of incentives for employers to retain older workers in the workplace. This is in line with the government’s strategy to extend working life. </li>\r\n <br><li>	Slovenia joined the EU in 2004 and has relatively recently adopted EU OSH legislation. This has meant changes in the orientation of regulatory strategies on OSH and a move from a prescriptive approach to a more process-based approach to OSH management (as required by the Framework Directive). The transition has been hampered by a lack of workplace representation.</li>\r\n</ul>',NULL,NULL,NULL,NULL,'<ul><li>	Slovenia follows the Central and Eastern European social welfare model. However, Slovenia’s welfare system is still in a transitional phase. Social partners have a relatively limited role in and relatively little influence on the development of socio-economic policies.</li>\r\n <br><li>	Social partners are showing increasing interest in the issue of the employability of older workers and are focusing on the stereotypes that stop employer’s recruiting older people, as well as issues related to increasing older workers’ skills and competences through training.</li>\r\n <br><li>Social partners have also developed tools to help employers put in place health promotion programmes in the workplace.\r\n</li>\r\n</ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Slovenia',NULL),('SK','Slovakia',2,'0','<ul><li>The challenges of an ageing workforce are recognised in the OSH strategy and the National Programme for Active Ageing, but the awareness of employers and employees of this issue is low and in practice the age management concept is seldom applied in companies. Raising awareness will be a challenge.</li>\r\n <br><li>Considering the magnitude of projected population ageing in the upcoming decades and the low employment rate of those aged 55-64, increasing the employment rates of older age groups will present a challenge.</li>\r\n <br><li>Vocational rehabilitation and RTW policies and systems need to be developed.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The Slovak population has been ageing for the past 40 years but is still younger than the EU average of 42, with a median age of 38 (EU-42). The proportion of the population aged 65 or over is currently (2015) comparatively low, but population ageing is predicted to continue and even increase quite dramatically: the old-age dependency ratio (OADR) will rise from around 20 % in 2015 to 66% in 2060, which is significantly higher than the EU OADR.</li>\r\n <br><li>The employment rate among the Slovak population aged between 55 and 64 years has sharply increased over the past decade, from 22 % in 2000 to 45 % in 2015, although it is still significantly lower than the EU average.\r\n</li>\r\n <br><li>In Slovakia, a significantly higher proportion of workers from all age categories receive on-the-job training compared with the EU average. For older workers, the figure is 52 % in Slovakia, compared with 26 % in the EU.</li>\r\n<br><li>\r\nSlovakia joined the EU in 2004 and has relatively recently adopted EU measures on systematic OSH management. It has meant changes in the orientation of regulatory strategies on OSH and a rapid move from a prescriptive approach to regulation to a more process-based approach (as required by the Framework Directive). The transition has also been hampered by a lack of workplace representation.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The Slovak welfare state follows the Central and Eastern European social welfare model, which is still in a transitional phase and underwent major reforms in the 1990s. It has the typical features of the Continental, Bismarckian-type welfare state. The model is in general strongly state-centred and dependent on general taxation rather than contributions. Social security spending is comparatively low. There is high unemployment, including long-term unemployment, and social inequalities in the country are higher than in the rest of the EU on average.</li>\r\n <br><li>Slovakia has experienced the strongest decrease in trade union density since 1993. Social partners have a relatively limited role in and relatively little influence on the development OSH policies.</li></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Slovakia','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-slovakia/view'),('IS','Iceland',1,'0','<ul><li>Since Iceland’s population is relatively young and the circumstances are favourable - high employment rates of older age groups, effective retirement age higher than official retirement age, high healthy life years – there was no need for specific policies as concerns demographic change.\r\nHowever, the Government is monitoring the situation (50+ project).</li></br>\r\n <li>In 2012, the effective age of retirement was 67.2 for women and 68.2 for men; these are thus both above the official retirement age. However, the effective age of retirement has been decreasing for both genders since 1991 (actual pension age was 71 for women and 71.7 for men that year)</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The Icelandic population has a median age of 35.5 years, significantly lower than the EU-28 average of 42 years. Although the population will be ageing during the next decades, it will still remain considerably younger than the EU average.</li></br>\r\n <li>Healthy Life Years expectancy at the age of 65 is 13.7 for women and 14 for men, which is significantly higher than the EU-28 average (8.6 for both genders).</li></br>\r\n <li>The employment rate among those aged 55-64 is very high, at 81%, compared with the EU-28 average of 50%. The employment rate of those aged 65 years and above is 32.6%. This is much higher than the EU-28 average (5%).</li></br>\r\n<li>In Iceland, active labour-market policies focus on young workers and on the long-term unemployed regardless of age, because the employment rate of older workers is quite high and the population still young compared with those of other EU countries.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>Iceland maintains a Nordic social welfare system, characterised by the principle of universalism of social security benefits, tax-based benefits and services, public healthcare and education. The welfare system includes childcare facilities, together with the provision of care for the aged and the handicapped, which are seen as necessary to empower people to combine gainful employment with family obligations, thus fostering women’s participation in the workforce. However, the Icelandic system is less extensive than in other Nordic countries, entitlements are more limited and benefits lower, whether in old age and invalidity pensions, unemployment benefits or family benefits. The taxation system is much less redistributive in character, taxes are lower, especially income and property taxes.</li></br>\r\n <li>Trade union density is very high in Iceland (82.6%; the EU average is 17.1%). Social partners play an important role in the welfare system.</li></br>\r\n <li>Tripartite social dialogue is carried out in consultation meetings between government ministers and social partners.</li></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Iceland','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-iceland/view'),('GB','United Kingdom',3,'0','<ul><li>As regards the HSE strategy on an ageing workforce, sectoral analysis of age factors and risk would be a valuable element in developing a better approach.</li></br>\r\n\r\n <li>HSE guidance on the issue of older workers could include more detailed information on the practical issues that affect older people and some of the adjustments that can help them stay in work.</li></br>\r\n\r\n <li>With regard to rehabilitation and return to work, it will be essential to raise the awareness of general practitioners and allied health professionals; gain the commitment of employers and employees to the return-to-work plan; establish return to work as the agreed outcome; and review the rehabilitation process within the National Health Service and private providers.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The population in the UK is ageing at a slower speed than the EU average. The population is moderately old, and will experience a very moderate pattern of ageing from 2040. </li></br>\r\n\r\n <li>People in the UK stay in the labour market for around 2 years longer, on average, than across the EU, and pensioners stated non-financial reasons (e.g. work satisfaction) for continuing working to a larger extent than EU pensioners in general.</li></br>\r\n\r\n <li>Older people in the UK, in general, report better working conditions than the EU average: in the UK, the share of those who think they could do their current job when they are 60 among older workers is higher than the EU average (85 % in the UK and 71 % in the EU). The proportion of older workers who think their work negatively affects their health is much lower than the EU average (15 % and 27 %, respectively), while the proportion of UK older workers who are satisfied with their working conditions is a lot higher than the EU average (94 % and 84 %, respectively).</li></br>\r\n\r\n <li>The default retirement age (formerly 65) was phased out in 2011; most people can now work for as long as they want to.\r\n\r\n</li></br>\r\n\r\n <li>According to the ESENER results, the UK has high average scores as regards the number of OSH management measures. This can mainly be explained by the fact that the UK has a longer tradition of process-based participatory OSH management and did not have to change the orientation of its regulatory strategies on OSH when transposing the European Framework Directive.</li></ul>',NULL,NULL,NULL,NULL,'<ul><li>The UK has an Anglo-Saxon welfare system based on a Beveridgian welfare model, but with a liberal (not state-centred) approach to welfare; a targeted, rather than redistributive, system of social services provision; and less decision-making power for and lower interest among trade unions for OSH-related issues.</li></br>\r\n\r\n <li>A limited proportion of social expenditure is allocated to pensions, with subsidies directed mostly towards the working-age population.</li></br>\r\n\r\n <li>The influence of social partners in the development of socio-economic policies is limited.</li></br>\r\n\r\n <li>The approach to rehabilitation in the UK is different compared with many continental states, as the medical aspect and many vocational aspects are largely organised through the National Health Service.</li></br></ul>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_United_Kingdom','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-united-kingdom/view'),('GR','Greece',1,'0','<ul><li>The existing government policies on the employment of older people are scattered and not integrated into a broader context to create a coherent strategy dealing with the issue of an ageing population in a multidisciplinary way. There is no specific OSH policy, strategy or programme in Greece that is directly related to the safety and health or working conditions of older workers, although the OSH strategy 2007-2012 did recognise the ageing workforce as a new and emerging issue.</li></br>\r\n\r\n<li>Regarding the promotion of return-to-work as an outcome of rehabilitation, many stakeholders recognise that solid rehabilitation processes and structures have to be developed, to prevent early exit from the labour market and reduce the costs of disability benefits and pensions.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The population was already relatively old in 2010, and continues ageing, but will experience a very moderate pattern of ageing from 2040 onwards.</li></br>\r\n\r\n <li>The impact of the financial crisis is evident in the sharp decrease in employment rates in all age groups that took place between 2008 and 2012. The employment rate among 55- to 64-year-olds decreased from 42.8% to 36% between 2008 and 2012 and is consistently lower than the EU average.</li></br>\r\n\r\n <li>Fiscal sustainability problems became evident in the pension system as a result of the financial crisis. Changes to the pension system seem to have had a positive impact. Whereas 2009 projections of pension spending suggested that it would reach 24.1% of GDP in 2060, a more recent report projected that it would be around 14% of GDP in 2060.</li></br>\r\n\r\n<li>The economic recession has increased the risk of discrimination against vulnerable groups such as older people, by increasing the already significant socio-economic inequality in Greek society.</li></br>\r\n\r\n<li>A much larger proportion of older workers in Greece (48%) than across the EU (27%) stated that work affected their health negatively and a much smaller proportion (56%) than in the EU as a whole (84%) were satisfied with their working conditions.</li></br>\r\n\r\n<li>The modernisation of the legislative framework for OSH began with the enactment of Law 1568/1985 on the Health and Safety of Workers, which established criteria for considering working conditions with more consistency and completeness, broadening the narrow interpretation of OSH. Law 1568/1985 emphasises prevention and focuses on including safety and health aspects the initial stages of workplace design.</li></ul></br>',NULL,NULL,NULL,NULL,'<ul><li>The Greek welfare state follows the Southern/Mediterranean model; however, it is relatively new, as it did not begin to develop until 1974. Since then, it has undergone several reforms, including in relation to the pension and healthcare systems; some recent changes were triggered by the financial crisis.</li></br>\r\n\r\n <li>The model is in general characterised by dependency on social contributions rather than taxes, moderate redistribution of income, a low level of participation of women in the labour market and relatively high levels of unemployment. There is high expenditure on old-age pensions, reflecting the low level of workforce participation of older workers and early retirement ages.</li></br>\r\n\r\n <li>In Greece, preventive OSH policies and their practical implementation are not directly connected to the national health and insurance system. There is no reliable system for recording and monitoring occupational accidents and diseases.</li></br>\r\n\r\n<li>There is a relatively low trade-union density in Greece, although social dialogue is present in the formulation of policies and laws at national level in Greece.</li></ul></br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Greece','https://osha.europa.eu/en/tools-and-publications/publications/safer-and-healthier-work-any-age-country-inventory-greece/view'),('EU','European Union',NULL,'0',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
/*!40000 ALTER TABLE `Country` ENABLE KEYS */;
