INSERT INTO `Factors` VALUES (1,1,'Workforce ageing and the related challenges for workplaces have not been a main priority for policy development. In the countries hit by the economic crisis, efforts have focused on reducing youth unemployment.','Policy priorities','Workforce ageing and the related challenges for workplaces have not been a main priority for policy development. In the countries hit by the economic crisis, efforts have focused on reducing youth unemployment.','Workforce ageing and the related challenges for workplaces have not been a main priority for policy development. In the countries hit by the economic crisis, efforts have focused on reducing youth unemployment.',NULL,'1','0'),(4,2,'The need to address the consequences of workforce ageing is acknowledged but not yet seen as a priority. In most of these countries, the focus is on stabilising the economy and reducing unemployment.','Policy priorities','The need to address the consequences of workforce ageing is acknowledged but not yet seen as a priority. In most of these countries, the focus is on stabilising the economy and reducing unemployment.','The need to address the consequences of workforce ageing is acknowledged but not yet seen as a priority. In most of these countries, the focus is on stabilising the economy and reducing unemployment.',NULL,'1','1'),(5,3,'Countries in this group have a relatively old population; however, the median age is around the EU average. These countries were not as badly affected by the economic crisis as some, and unemployment rates are in general lower than the EU average.','Specific characteristics','Countries in this group have a relatively old population; however, the median age is around the EU average. These countries were not as badly affected by the economic crisis as some, and unemployment rates are in general lower than the EU average.','Countries in this group have a relatively old population; however, the median age is around the EU average. These countries were not as badly affected by the economic crisis as some, and unemployment rates are in general lower than the EU average.',NULL,'1','0'),(6,4,'In these countries, tackling the challenges of an ageing population and workforce has been a policy priority for many years. <a ui-sref=\'approaches-map\' id=\'approaches-map\' href=\'#/approaches-map\'>Approaches map</a>','Policy priorities','In these countries, tackling the challenges of an ageing population and workforce has been a policy priority for many years.','In these countries, tackling the challenges of an ageing population and workforce has been a policy priority for many years.',NULL,'0','0'),(7,1,'Pension reforms have been carried out in all these countries, and in countries with an older population the focus has been on increasing the labour market participation of older age groups, by raising the retirement age and restricting access to early retirement, as well as by providing economic incentives to employ older people. Active ageing policies, where they exist, focus mainly on the post-retirement population.','Policy areas','Pension reforms have been carried out in all these countries, and in countries with an older population the focus has been on increasing the labour market participation of older age groups, by raising the retirement age and restricting access to early retirement, as well as by providing economic incentives to employ older people. Active ageing policies, where they exist, focus mainly on the post-retirement population.','Pension reforms have been carried out in all these countries, and in countries with an older population the focus has been on increasing the labour market participation of older age groups, by raising the retirement age and restricting access to early retirement, as well as by providing economic incentives to employ older people. Active ageing policies, where they exist, focus mainly on the post-retirement population.',NULL,'0','0'),(11,4,'These countries have each developed an integrated policy framework to address the consequences of the ageing and shrinking of the workforce, covering all relevant policy areas: employment, public health, education, anti-discrimination and equal treatment, and occupational safety and health. The role of sustainable work in tackling the challenges is fully recognised and comprehensive measures have been developed to promote sustainable work and active ageing, applying a life-course perspective and a holistic approach in policy and programme development.','Policy areas','These countries have each developed an integrated policy framework to address the consequences of the ageing and shrinking of the workforce, covering all relevant policy areas: employment, public health, education, anti-discrimination and equal treatment, and occupational safety and health. The role of sustainable work in tackling the challenges is fully recognised and comprehensive measures have been developed to promote sustainable work and active ageing, applying a life-course perspective and a holistic approach in policy and programme development.','These countries have each developed an integrated policy framework to address the consequences of the ageing and shrinking of the workforce, covering all relevant policy areas: employment, public health, education, anti-discrimination and equal treatment, and occupational safety and health. The role of sustainable work in tackling the challenges is fully recognised and comprehensive measures have been developed to promote sustainable work and active ageing, applying a life-course perspective and a holistic approach in policy and programme development.',NULL,'0','0'),(12,4,'Active ageing, well-being at work, sustainable work, lifelong learning, sustainable employability, age management, work ability.','Concepts','Active ageing, well-being at work, sustainable work, lifelong learning, sustainable employability, age management, work ability.','Active ageing, well-being at work, sustainable work, lifelong learning, sustainable employability, age management, work ability.',NULL,'0','0'),(13,4,'The concepts of age management and work ability are well known and widely implemented in practice. There are formal coordinating structures across policy areas and good stakeholder cooperation. Social dialogue and collective agreements play an important role in policy development and implementation.','Implementation','The concepts of age management and work ability are well known and widely implemented in practice. There are formal coordinating structures across policy areas and good stakeholder cooperation. Social dialogue and collective agreements play an important role in policy development and implementation.','The concepts of age management and work ability are well known and widely implemented in practice. There are formal coordinating structures across policy areas and good stakeholder cooperation. Social dialogue and collective agreements play an important role in policy development and implementation.',NULL,'0','0'),(15,3,'Population and workforce ageing and the related challenges are a policy priority. The gap between official and effective retirement age and the low employment rates of older age groups raise concerns, in particular in France, Austria and Belgium, where increasing the labour participation of older people has been an important objective of socio-economic policies over the past decade.','Policy priorities','Population and workforce ageing and the related challenges are a policy priority. The gap between official and effective retirement age and the low employment rates of older age groups raise concerns, in particular in France, Austria and Belgium, where increasing the labour participation of older people has been an important objective of socio-economic policies over the past decade.','Population and workforce ageing and the related challenges are a policy priority. The gap between official and effective retirement age and the low employment rates of older age groups raise concerns, in particular in France, Austria and Belgium, where increasing the labour participation of older people has been an important objective of socio-economic policies over the past decade.',NULL,'0','0'),(17,3,'Initiatives take place in several policy areas, covering employment, public health, education, anti-discrimination, and occupational safety and health (OSH). The role of good working conditions and OSH in prolonging working life has been recognised, and these countries have developed comprehensive measures to promote the employability of older workers and address working conditions and safety and health at work in a holistic way, including promoting vocational rehabilitation and return-to-work measures.','Policy areas','Initiatives take place in several policy areas, covering employment, public health, education, anti-discrimination, and occupational safety and health (OSH). The role of good working conditions and OSH in prolonging working life has been recognised, and these countries have developed comprehensive measures to promote the employability of older workers and address working conditions and safety and health at work in a holistic way, including promoting vocational rehabilitation and return-to-work measures.','Initiatives take place in several policy areas, covering employment, public health, education, anti-discrimination, and occupational safety and health (OSH). The role of good working conditions and OSH in prolonging working life has been recognised, and these countries have developed comprehensive measures to promote the employability of older workers and address working conditions and safety and health at work in a holistic way, including promoting vocational rehabilitation and return-to-work measures.',NULL,'0','0'),(21,3,'Active ageing, work ability, age management, inclusive working life, employability, lifelong learning.','Concepts','Active ageing, work ability, age management, inclusive working life, employability, lifelong learning.','Active ageing, work ability, age management, inclusive working life, employability, lifelong learning.',NULL,'0','0'),(22,3,'Concepts such as age management and work ability are well known and implemented in practice. A broad range of stakeholders is involved. Social partners play an important role in policy development and implementation.','Implementation','Concepts such as age management and work ability are well known and implemented in practice. A broad range of stakeholders is involved. Social partners play an important role in policy development and implementation.','Concepts such as age management and work ability are well known and implemented in practice. A broad range of stakeholders is involved. Social partners play an important role in policy development and implementation.',NULL,'0','0'),(26,2,'Policies related to workforce ageing have mainly focused on increasing older workers’ labour market participation through pension reforms and employment measures, but they also include elements addressing working conditions and occupational safety and health, training and lifelong learning, or employability. Rehabilitation systems mostly focus on people with disabilities or, in certain cases, people who have experienced an occupational accident or illness, and their scope is in general limited to medical rehabilitation.','Policy areas','Policies related to workforce ageing have mainly focused on increasing older workers’ labour market participation through pension reforms and employment measures, but they also include elements addressing working conditions and occupational safety and health, training and lifelong learning, or employability. Rehabilitation systems mostly focus on people with disabilities or, in certain cases, people who have experienced an occupational accident or illness, and their scope is in general limited to medical rehabilitation.','Policies related to workforce ageing have mainly focused on increasing older workers’ labour market participation through pension reforms and employment measures, but they also include elements addressing working conditions and occupational safety and health, training and lifelong learning, or employability. Rehabilitation systems mostly focus on people with disabilities or, in certain cases, people who have experienced an occupational accident or illness, and their scope is in general limited to medical rehabilitation.',NULL,'0','0'),(29,2,'Active ageing (awareness was raised by the European Year for Active Ageing (2012)), work ability, age management.','Concepts','Active ageing (awareness was raised by the European Year for Active Ageing (2012)), work ability, age management.','Active ageing (awareness was raised by the European Year for Active Ageing (2012)), work ability, age management.',NULL,'0','0'),(30,2,'Some concepts appear at policy level, but have not yet been implemented in practice. In general, there is a lack of cross-policy initiatives.','Implementation','Some concepts appear at policy level, but have not yet been implemented in practice. In general, there is a lack of cross-policy initiatives.','Some concepts appear at policy level, but have not yet been implemented in practice. In general, there is a lack of cross-policy initiatives.',NULL,'0','0'),(31,1,'Active ageing (awareness was raised by the European Year for Active Ageing (EYAA), e2012).','Concepts','Active ageing (awareness was raised by the European Year for Active Ageing (EYAA), 2012).','Active ageing (awareness was raised by the European Year for Active Ageing (EYAA), 2012).',NULL,'0','0'),(32,1,'There are sporadic projects and initiatives, some of them triggered by EYAA.','Implementation','There are sporadic projects and initiatives, some of them triggered by EYAA.','There are sporadic projects and initiatives, some of them triggered by EYAA.',NULL,'0','0'),(33,1,'The group is diverse in terms of population ageing and economic situation. These countries were hit hard by the economic crisis and some are still suffering from the consequences, such as high unemployment and poverty. Iceland and Cyprus have a young population, and in Iceland the employment rate of older age groups is very high.','Specific characteristics','The group is diverse in terms of population ageing and economic situation. These countries were hit hard by the economic crisis and some are still suffering from the consequences, such as high unemployment and poverty. Iceland and Cyprus have a young population, and in Iceland the employment rate of older age groups is very high.','The group is diverse in terms of population ageing and economic situation. These countries were hit hard by the economic crisis and some are still suffering from the consequences, such as high unemployment and poverty. Iceland and Cyprus have a young population, and in Iceland the employment rate of older age groups is very high.',NULL,'0','0'),(34,2,'This group is large and very diverse in terms of demographic development and economic situation; it includes countries such as Ireland, which has one of the youngest populations in Europe, and Italy, which has one of the oldest. Some of these countries had a relatively young population until recently but will be facing rapid ageing in the decades to come. Most of them have suffered from the economic crisis which has caused high unemployment, in particular among younger age groups.','Specific characteristics','This group is large and very diverse in terms of demographic development and economic situation; it includes countries such as Ireland, which has one of the youngest populations in Europe, and Italy, which has one of the oldest. Some of these countries had a relatively young population until recently but will be facing rapid ageing in the decades to come. Most of them have suffered from the economic crisis which has caused high unemployment, in particular among younger age groups.','This group is large and very diverse in terms of demographic development and economic situation; it includes countries such as Ireland, which has one of the youngest populations in Europe, and Italy, which has one of the oldest. Some of these countries had a relatively young population until recently but will be facing rapid ageing in the decades to come. Most of them have suffered from the economic crisis which has caused high unemployment, in particular among younger age groups.',NULL,'1','0'),(35,4,'Population ageing started relatively early in these countries. As early as 1994, the median age of the populations in these countries, with the exception of the Netherlands, was above the EU average. The countries in this group were not as badly affected by the economic crisis as some, and unemployment rates are in general lower than the EU average.','Specific characteristics','Population ageing started relatively early in these countries. As early as 1994, the median age of the populations in these countries, with the exception of the Netherlands, was above the EU average. The countries in this group were not as badly affected by the economic crisis as some, and unemployment rates are in general lower than the EU average.','Population ageing started relatively early in these countries. As early as 1994, the median age of the populations in these countries, with the exception of the Netherlands, was above the EU average. The countries in this group were not as badly affected by the economic crisis as some, and unemployment rates are in general lower than the EU average.',NULL,'1','0');
