INSERT INTO `Glossary` VALUES (32,'Median age','The age that divides a population into two numerically equal groups; that is, half the people are younger than this age and half are older <a href=\"http://www.prb.org/Publications/Lesson-Plans/Glossary.aspx\" class=\"external\" target=\"_blank\">(Population Reference Bureau).</a>'),(33,'Medical rehabilitation','Medical rehabilitation aims to restore the functional or mental ability and quality of life of people with physical or mental impairments or disabilities (EU-OSHA).'),(34,'Mental health ','Mental health is a state of well-being in which an individual can realise their own abilities, can cope with the normal stresses of life, can work productively and is able to make a contribution to their community <a href=\"http://www.who.int/mental_health/evidence/MH_Promotion_Book.pdf\" class=\"external\" target=\"_blank\">(WHO).</a>'),(35,'Musculoskeletal disorders ','<br>Work-related musculoskeletal disorders (MSDs) are health problems affecting the muscles, tendons, ligaments, cartilage, vascular system, nerves or other soft tissues and joints of the musculoskeletal system.</br>\r\n<br>Work-related MSDs are associated with repetitive and strenuous work. These health problems range from discomfort and minor aches and pains to more serious medical conditions that can lead to permanent disability <a href=\"https://oshwiki.eu/wiki/Introduction_to_musculoskeletal_disorders\" class=\"external\" target=\"_blank\">(OSHwiki).</a>\r\n</br>'),(36,'Occupational hazard','An occupational hazard is a substance, situation, or act, or a combination of these, with a potential for harm in terms of human injury or ill health <a href=\"https://oshwiki.eu/wiki/Occupational_safety_and_health_risk_assessment_methodologies\" class=\"external\" target=\"_blank\">(OSHwiki).</a>'),(37,'Psychosocial risks ','Psychosocial risks are those aspects of work design and the organisation and management of work, and its social and environmental context, that may have the potential to cause psychological or physical harm. Issues such as work-related stress, workplace violence and harassment are linked to psychosocial risks <a href=\"https://oshwiki.eu/wiki/Psychosocial_risks_and_workers_health\" class=\"external\" target=\"_blank\">(OSHwiki).</a>'),(38,'Rehabilitation ','Rehabilitation is a process aimed at enabling people to reach and maintain their optimal physical, sensory, intellectual, psychological and social functional levels <a href=\"http://www.who.int/topics/rehabilitation/en/\" class=\"external\" target=\"_blank\">(OSHwiki).</a>'),(39,'Return to work','Return to work is a concept encompassing all procedures and initiatives aiming at facilitating the workplace reintegration of people who have experienced a reduction in work capacity or capability, whether due to invalidity, illness or ageing <a href=\"http://www.kmghp.com/assets/2-guidelines-return_to_work_and_reintegration.pdf\" class=\"external\" target=\"_blank\">(International Social Security Association).</a>'),(40,'Risk assessment ','Risk assessment is a step in the OSH risk management process that involves identifying the potential risks and hazards that workers may be exposed to and deciding on the protective and preventive measures that need to be implemented. It is a dynamic process that allows organisations to put in place a proactive policy for managing occupational risks <a href=\"https://oshwiki.eu/wiki/Occupational_safety_and_health_risk_assessment_methodologies\" class=\"external\" target=\"_blank\">(OSHwiki).</a>'),(41,'Sustainable work ','Sustainable work over the life course means that working and living conditions are such that they support people in engaging with and remaining in work throughout an extended working life. These conditions enable a good fit between work and the characteristics or circumstances of the individual throughout their changing life, and must be developed through policies and practices at work and outside work <a href=\"https://www.eurofound.europa.eu/fr/publications/report/2015/working-conditions/sustainable-work-over-the-life-course-concept-paper\" class=\"external\" target=\"_blank\">(Eurofound).</a>'),(42,'Vocational rehabilitation','Vocational (or occupational) rehabilitation aims to enable people with physical or mental impairments or disabilities to overcome barriers to accessing, maintaining or returning to employment or another useful occupation (EU-OSHA).'),(43,'Work ability ','Work ability can be described as the balance between the resources of the individual and work-related factors. Personal resources include the following elements: health and functional capacities, competences and skills, values, attitudes and motivation. Work-related factors include work content, work environment, work organisation and leadership. Work ability is also influenced by the environment outside of work <a href=\"http://www.ttl.fi/en/health/wai/multidimensional_work_ability_model/pages/default.aspx\" class=\"external\" target=\"_blank\">(Finnish Institute of Occupational Health).</a>'),(44,'Workplace health promotion','Workplace health promotion refers to the combined efforts of employers, employees and society to improve the health and well-being of people at work. This can be achieved through improving work organisation and the working environment, promoting active participation and encouraging personal development <a href=\"http://www.enwhp.org/workplace-health-promotion.html\" class=\"external\" target=\"_blank\">(European Network for Workplace Health Promotion).</a>'),(45,'Work-related diseases','All illnesses that can be caused, worsened or partly caused by working conditions. A case of work-related illness is not necessarily recognised by an authority. Occupational diseases have a specific or a strong relation to a particular occupation, generally with only one causal agent, while work-related diseases have a complex aetiology. A more precise distinction between occupational diseases and work-related diseases can be made by evaluating their attributable fractions. It is suggested that the attributable fractions of occupational diseases are more than 50 % those of work-related diseases are less than 50 % (OSHwiki).'),(1,'Age management','Age management refers to the various dimensions by which human resources are managed within organisations with an explicit focus on ageing and, also, more generally, to the overall management of an ageing workforce via public policy or collective bargaining <a href=\"http://citeseerx.ist.psu.edu/viewdoc/download?doi=10.1.1.513.3794&rep=rep1&type=pdf\r\n\" class=\"external\" target=\"_blank\">(Walker).</a>. Essential principles of age management include an emphasis on prevention, a focus on the whole working life and all age groups, and a holistic approach <a href=\"https://www.eurofound.europa.eu/sites/default/files/ef_files/pubdocs/2005/137/en/1/ef05137en.pdf\" class=\"external\" target=\"_blank\">(Eurofound).</a>'),(2,'Chronic diseases','Chronic diseases are diseases of long duration and generally slow progression. They have many causes but often share common risk factors (e.g. tobacco use, physical inactivity, unhealthy eating and excessive alcohol use). Chronic diseases usually begin slowly and develop gradually over time, can occur at any age, although they are more common in later life, can impact quality of life and limit daily activities, and require ongoing action on a long-term basis to manage the disease, with involvement from individuals, healthcare providers and the community. The four main types of non-communicable diseases are cardiovascular diseases (e.g. heart attacks), cancers, chronic respiratory diseases (e.g. asthma) and diabetes <a href=\"http://www.who.int/topics/noncommunicable_diseases/en/\" class=\"external\" target=\"_blank\">(WHO).</a>'),(3,'Disabilities','‘Disabilities’ is an umbrella term, covering impairments, activity limitations and participation restrictions. An impairment is a problem in body function or structure; an activity limitation is a difficulty encountered by an individual in executing a task or action; and a participation restriction is a problem experienced by an individual in involvement in life situations (WHO). '),(4,'Employability ','Employability can be defined as ‘the quality of being employable’ or the ‘combination of factors permitting access to work, to maintain it and to progress in one’s career’ (EU-OSHA).'),(5,'Flexible retirement','Flexible retirement means giving workers more choice in their retirement decisions. This may include providing opportunities to retire later or allowing workers to receive some of their pension benefits while continuing to work at reduced hours.'),(6,'Healthy Life Years','The Healthy Life Years (HLY) indicator (also called disability-free life expectancy) measures the number of remaining years that a person of a certain age is expected to live without disability. HLY is a solid indicator for monitoring health as a productivity/economic factor. The indicator introduces the concept of quality of life, distinguishing between years of life free of any activity limitation and years experienced with at least one activity limitation (European Commission).'),(7,'Lifelong learning ','Lifelong learning means all learning activities undertaken throughout life, aiming to improve skills, knowledge and competences from a personal, civic, social and/or employment-related perspective.  Lifelong learning encompasses the whole spectrum of formal, non-formal and informal learning <a href=\"http://eur-lex.europa.eu/LexUriServ/LexUriServ.do?uri=COM:2001:0678:FIN:EN:PDF\" class=\"external\" target=\"_blank\">(European Commission).</a>');
