INSERT INTO `PSP` VALUES (361,'A strategy for workplace health and safety in Great Britain to 2010 and beyond','GB','This strategy sets out a new direction for the health and safety system and the roles of Health and Safety Commission (HSC), the Health and Safety Executive (HSE) and Local Authorities (LAs) aiming, among others, to improve:</br>\n<ul><li>employment and productivity – by keeping those at work healthy and in work;</li>\n <li>health and rehabilitation – by contributing to the nation’s health and well-being and dealing with health inequalities.</li></ul>\nThe strategy also emphasised the importance of strategic partnerships and working together with social partners, insurers and health professionals.','This strategy sets out a new direction for the health and safety system and the roles of Health and Safety Commission (HSC), the Health and Safety Executive (HSE) and Local Authorities (LAs) aiming, among others, to improve:</br>\n<ul><li>employment and productivity – by keeping those at work healthy and in work;</li>\n <li>health and rehabilitation – by contributing to the nation’s health and well-being and dealing with health inequalities.</li></ul>\nThe strategy also emphasised the importance of strategic partnerships and working together with social partners, insurers and health professionals.',NULL,2004,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(362,'Health, Work and Well-being’ initiative','GB','Department for Work and Pensions (DWP), 2005 \nThis is a cross-government initiative coordinated by the Department for Work and Pensions (DWP). It aims to improve the general health and well-being of the working-age population, support more people with health conditions to stay in work or enter employment, and reduce the number of days lost to sickness absence. The government works with employers, trades unions and health care professionals to create healthier workplaces, improve occupational health services and rehabilitation support, and increase employment opportunities for people who are not in work because of ill health or disability. This is done through a range of measures and initiatives, including awareness-raising activities and provision of practical support to employers, in particular small businesses.','Department for Work and Pensions (DWP), 2005 \nThis is a cross-government initiative coordinated by the Department for Work and Pensions (DWP). It aims to improve the general health and well-being of the working-age population, support more people with health conditions to stay in work or enter employment, and reduce the number of days lost to sickness absence. The government works with employers, trades unions and health care professionals to create healthier workplaces, improve occupational health services and rehabilitation support, and increase employment opportunities for people who are not in work because of ill health or disability. This is done through a range of measures and initiatives, including awareness-raising activities and provision of practical support to employers, in particular small businesses.',NULL,2005,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(363,'Fuller Working Lives – a Framework for Action','GB','The framework sets out the business case for retaining and recruiting older workers at the individual, business and societal levels. It also draws together the important steps that the government is already taking and will be taking to promote fuller working lives. The framework focuses in particular on:</br>\n<ul><li>health conditions and disability;</li>\n <li>careers;</li>\n <li>back-to-work support;</li>\n<li>skills and workplace factors;</li>\n<li>financial security and incentives.</li></ul>','The framework sets out the business case for retaining and recruiting older workers at the individual, business and societal levels. It also draws together the important steps that the government is already taking and will be taking to promote fuller working lives. The framework focuses in particular on:</br>\n<ul><li>health conditions and disability;</li>\n <li>careers;</li>\n <li>back-to-work support;</li>\n<li>skills and workplace factors;</li>\n<li>financial security and incentives.</li></ul>','https://www.gov.uk/government/publications/fuller-working-lives-a-framework-for-action',2014,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(364,'Policy paper on fitness for work: the Government response to ‘Health at work – an independent review of sickness absence','GB','Department for Work and Pensions (DWP),  2013</br>\n<br>This paper outlines a strategy to support the health and well-being of the working age population and announces a range of measures, including:</br>\n<ul>\n <li>setting up a health and work assessment and advisory service (now called the ‘Fit for Work Service’); </li>\n <li>improving sickness absence management;</li>\n <li>supporting health care professionals;</li>\n<li>reforming the benefits system.</li></ul>\n\n‘Fit for Work Service’ is a support service, designed to help working people who face long-term sickness absence return to work more quickly. GPs and employers throughout England and Wales can refer employees who have been, or are likely to be, off sick from work for four weeks or more for a voluntary occupational health assessment. The occupational health professional will identify obstacles preventing the employee from returning to work. A Return to Work Plan will be agreed providing recommendations tailored to the employee’s needs, which can replace the need for a fit note.','Department for Work and Pensions (DWP),  2013</br>\n<br>This paper outlines a strategy to support the health and well-being of the working age population and announces a range of measures, including:</br>\n<ul>\n <li>setting up a health and work assessment and advisory service (now called the ‘Fit for Work Service’); </li>\n <li>improving sickness absence management;</li>\n <li>supporting health care professionals;</li>\n<li>reforming the benefits system.</li></ul>\n\n‘Fit for Work Service’ is a support service, designed to help working people who face long-term sickness absence return to work more quickly. GPs and employers throughout England and Wales can refer employees who have been, or are likely to be, off sick from work for four weeks or more for a voluntary occupational health assessment. The occupational health professional will identify obstacles preventing the employee from returning to work. A Return to Work Plan will be agreed providing recommendations tailored to the employee’s needs, which can replace the need for a fit note.',NULL,2013,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(365,'Guidance on the ‘Health and safety for older workers’ (HSE) ','GB','This document identifies some of the evidence about ageing and gives relatively succinct guidance on what employers should look for when employing older workers. In particular, it suggests that employers ‘think about the activities older workers do’ as part of the overall risk assessment and ‘consider whether any changes are needed’ (e.g. allowing older workers more time to absorb health and safety information or training, for example by introducing self-paced training; introducing opportunities for older workers to move to other types of work in order to lengthen working careers).','This document identifies some of the evidence about ageing and gives relatively succinct guidance on what employers should look for when employing older workers. In particular, it suggests that employers ‘think about the activities older workers do’ as part of the overall risk assessment and ‘consider whether any changes are needed’ (e.g. allowing older workers more time to absorb health and safety information or training, for example by introducing self-paced training; introducing opportunities for older workers to move to other types of work in order to lengthen working careers).','http://www.hse.gov.uk/vulnerable-workers/older-workers.htm',NULL,'1','0','0','OTHERS','0','Northumbrian Water Group Wellbeing Programme',NULL,'1','0','0'),(366,'‘Healthy and Productive Workers’ leaflet','GB','Age Action Alliance (government-affiliated organisation) The Alliance has a specific ‘Healthy workplaces’ group, which meets two or three times a year. Among other materials, the group has produced a ‘Healthy and Productive Workers’ leaflet, which gives 10 tips for action, and guidance on measuring success. It has also produced an online toolkit, ‘Managing the health & productivity of an ageing workforce: solutions to employer questions’. The toolkit contains numerous links to existing guidance under some principal themes such as ‘Good health and well-being’, ‘Health and safety’ and ‘Work adaptions’.','Age Action Alliance (government-affiliated organisation) The Alliance has a specific ‘Healthy workplaces’ group, which meets two or three times a year. Among other materials, the group has produced a ‘Healthy and Productive Workers’ leaflet, which gives 10 tips for action, and guidance on measuring success. It has also produced an online toolkit, ‘Managing the health & productivity of an ageing workforce: solutions to employer questions’. The toolkit contains numerous links to existing guidance under some principal themes such as ‘Good health and well-being’, ‘Health and safety’ and ‘Work adaptions’.','http://ageactionalliance.org/wordpress/wp-content/uploads/2013/04/AAA-Healthy-Workplaces-leaflet-final-2013-05-01.pdf',NULL,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(367,'Austrian Occupational Safety and Health Strategy 2007-2012 and follow-up strategy 2013-2020 ','AT','Involves all national and regional actors for health and safety at work and, essentially, those whose interests relate to this topic. \r\n<ul><li>Five subject areas have been defined (e.g. Prevention of occupational diseases, Training and information on OSH (including improving the work of prevention experts).</li>\r\n <li>A number of targets have been defined (including the reduction of occupational accidents and diseases) and, in order to achieve them, the measures should focus on, among others, demographic change as well as rehabilitation and reintegration of employees.</li>','Involves all national and regional actors for health and safety at work and, essentially, those whose interests relate to this topic. \r\n<ul><li>Five subject areas have been defined (e.g. Prevention of occupational diseases, Training and information on OSH (including improving the work of prevention experts).</li>\r\n <li>A number of targets have been defined (including the reduction of occupational accidents and diseases) and, in order to achieve them, the measures should focus on, among others, demographic change as well as rehabilitation and reintegration of employees.</li>','http://www.arbeitsinspektion.gv.at/AI/Arbeitsschutz/strategie/en_strategy_0010.htm',2007,'1','1','0','OSH','1',NULL,NULL,'1','1','1'),(368,'Fit for the Future — Maintaining Work Ability programme ','AT','To support the maintenance and promotion of the work ability of workers and employees in industries where demands on health are high.','To support the maintenance and promotion of the work ability of workers and employees in industries where demands on health are high.','http://www.sozialministerium.at/site/Soziales/Pensionen/Studien_und_Berichte/',2007,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(369,'Programme to ensure that gender is incorporated in the work of the entire Labour Inspectorate in a systematic and permanent way','AT','In 2007, the gender-mainstreaming scheme was expanded to cover all areas of diversity in relation to employee protection (including the protection of older workers).','In 2007, the gender-mainstreaming scheme was expanded to cover all areas of diversity in relation to employee protection (including the protection of older workers).','http://www.arbeitsinspektion.gv.at/AI/Arbeitsschutz/gender/gem_030.htm',2007,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(370,'Fit2work','AT','The programme is supported by the Federal Ministry of Labour, the Austrian Social Insurance for Occupational Risks (AUVA), the Austrian Pension Insurance Organisation (PVA), the sickness insurance funds, the Public Employment Service (AMS) and the Federal Social Office (Bundessozialamt BSB). Services are provided through a nationwide network of fit2work counselling centres. \r\n<ul>\r\n <li>Objectives: to prevent job loss owing to health reasons, to enhance and maintain workers’ fitness to work, to reintegrate workers after a long illness and to find alternative types of employment.</li>\r\n <li>It takes a holistic approach, as it looks at medical, vocational and social rehabilitation. It covers any person who is employed, self-employed or unemployed in Austria and pays insurance contributions. </li>\r\n <li>It also aims to help workers who have been on sick leave several times or for a longer period and/or have problems at work due to their illness (e.g. fear of losing the job or having lost the job for this reason).</li></ul>','The programme is supported by the Federal Ministry of Labour, the Austrian Social Insurance for Occupational Risks (AUVA), the Austrian Pension Insurance Organisation (PVA), the sickness insurance funds, the Public Employment Service (AMS) and the Federal Social Office (Bundessozialamt BSB). Services are provided through a nationwide network of fit2work counselling centres. \r\n<ul>\r\n <li>Objectives: to prevent job loss owing to health reasons, to enhance and maintain workers’ fitness to work, to reintegrate workers after a long illness and to find alternative types of employment.</li>\r\n <li>It takes a holistic approach, as it looks at medical, vocational and social rehabilitation. It covers any person who is employed, self-employed or unemployed in Austria and pays insurance contributions. </li>\r\n <li>It also aims to help workers who have been on sick leave several times or for a longer period and/or have problems at work due to their illness (e.g. fear of losing the job or having lost the job for this reason).</li></ul>',NULL,2012,'1','0','1','RTW','1',NULL,NULL,'1','0','0'),(371,'The Vocational Rehabilitation and Education Centre ','AT','Provides support to people with a health impairment to help them get back to professional life after an illness or an accident. It covers both workers who are unemployed and workers who are still in employment, but it seems to focus on the former. The centre offers individualised support to help people return to the labour market or return to their existing job, when relevant, in particular through training.','Provides support to people with a health impairment to help them get back to professional life after an illness or an accident. It covers both workers who are unemployed and workers who are still in employment, but it seems to focus on the former. The centre offers individualised support to help people return to the labour market or return to their existing job, when relevant, in particular through training.','http://www.bbrz.at/ueber-uns/was-wir-tun.html',1975,'0','0','1','RTW','0',NULL,NULL,'0','0','1'),(372,'The WAI Network Austria ','AT','Is a platform for dialogue to maintain and foster work ability. \r\n<ul>\r\n <li>It is for use by experts (consultants, non-governmental organisations, governments, social insurance institutions, social partners, occupational physicians, safety experts, etc.) and users (employers, human resources managers, employee representatives and employees).</li>\r\n <li>It provides an overview of the work ability and age structures in each department of a company and, as a whole, allows human resources policies to be tailored to age and work ability.</li></ul>\r\n\r\nEmployees can evaluate their own work ability and their chances for development.','Is a platform for dialogue to maintain and foster work ability. \r\n<ul>\r\n <li>It is for use by experts (consultants, non-governmental organisations, governments, social insurance institutions, social partners, occupational physicians, safety experts, etc.) and users (employers, human resources managers, employee representatives and employees).</li>\r\n <li>It provides an overview of the work ability and age structures in each department of a company and, as a whole, allows human resources policies to be tailored to age and work ability.</li></ul>\r\n\r\nEmployees can evaluate their own work ability and their chances for development.','http://www.wai-netzwerk.at/',2008,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(377,'National strategy for Well-being at Work ','BE','This strategy included five ‘programmes’, along with thematic projects. In the preamble of the strategy, older workers, workers with reduced working capacity and workers with disabilities were mentioned as being in need of particular attention.\r\nThe strategy aimed to: \r\n<ul>\r\n <li>strengthen the prevention of occupational illnesses - in particular musculoskeletal disorders, stress - and accidents at work;</li>\r\n <li>deal with new risks whereby older workers are considered a new risk group;</li>\r\n <li>strengthen well-being at work;</li>\r\n<li>improve the treatment of occupational illnesses and the reintegration of workers.</li></ul>','This strategy included five ‘programmes’, along with thematic projects. In the preamble of the strategy, older workers, workers with reduced working capacity and workers with disabilities were mentioned as being in need of particular attention.\r\nThe strategy aimed to: \r\n<ul>\r\n <li>strengthen the prevention of occupational illnesses - in particular musculoskeletal disorders, stress - and accidents at work;</li>\r\n <li>deal with new risks whereby older workers are considered a new risk group;</li>\r\n <li>strengthen well-being at work;</li>\r\n<li>improve the treatment of occupational illnesses and the reintegration of workers.</li></ul>','http://www.beswic.be/nl/systems',2008,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(378,'Generation Pact ','BE','Proposes a number of measures for companies to keep older workers at work. Some of these measures have a focus on OSH or working conditions:\n<ul>\n <li>Transfer to a less stressful work system for older workers who have been working night shifts for an extended period of time.</li>\n <li>Time credit for workers over 55. </li>\n <li>Transfer from arduous work to lighter duties for workers above 50.</li>\n<li>Pension bonus.</li></ul>','Proposes a number of measures for companies to keep older workers at work. Some of these measures have a focus on OSH or working conditions:\n<ul>\n <li>Transfer to a less stressful work system for older workers who have been working night shifts for an extended period of time.</li>\n <li>Time credit for workers over 55. </li>\n <li>Transfer from arduous work to lighter duties for workers above 50.</li>\n<li>Pension bonus.</li></ul>','http://ec.europa.eu/social/main.jsp?catId=738&langId=en&pubId=6783&furtherPubs=yes',2005,'1','1','0','OSH','0',NULL,NULL,'0','1','0'),(379,'Professional Experience Fund ','BE','Aims to increase the employment of workers aged 55 and over and the length of careers, and to raise retirement age. \n<ul> <li>The fund supports companies’ projects that are intended to improve the quality of work of their older workers (45+).</li>\n <li>The projects need to lead to or introduce concrete adaptations of the working conditions or work organisation for those aged 45 and over.</li></ul>','Aims to increase the employment of workers aged 55 and over and the length of careers, and to raise retirement age. \n<ul> <li>The fund supports companies’ projects that are intended to improve the quality of work of their older workers (45+).</li>\n <li>The projects need to lead to or introduce concrete adaptations of the working conditions or work organisation for those aged 45 and over.</li></ul>','http://www.emploi.belgique.be/fonds_de_lexp%C3%A9rience_professionnelle.aspx',2001,'1','1','0','OSH','0','LIFE COACH’ TRAINING FOR FAMILY ASSISTANTS',NULL,'0','0','0'),(380,'Social partners’ agreement (CCT) 104 on the implementation of an Action Plan for the Employment of older workers in the company ','BE','The agreement was declared generally binding by Royal \r\nDecree of 28 October 2012. It requires any company with more than 20 employees to provide an employment plan to maintain or increase the number of workers aged 45 and older. The employer may choose from a (non-exhaustive) list of areas for action, included in the collective labour agreement: \r\n<ul>\r\n <li>selection and recruitment of new employees; </li>\r\n <li>development of competencies and skills of the workforce; </li>\r\n <li>career development and career management within the company; </li>\r\n<li>work adaptations according to changing capabilities and competencies of workers through internal job rotation; </li>\r\n <li>adjustment of working time and working conditions; </li>\r\n <li>health promotion, prevention and elimination of physical and psychosocial barriers to remain at work; </li>\r\n<li>systems of recognition of acquired competencies. </li>\r\n \r\n</ul>\r\n\r\nThe employer may then choose a single field of action, combining action areas or opt for a non-listed area of action. The sectors have the possibility to add actions','The agreement was declared generally binding by Royal \r\nDecree of 28 October 2012. It requires any company with more than 20 employees to provide an employment plan to maintain or increase the number of workers aged 45 and older. The employer may choose from a (non-exhaustive) list of areas for action, included in the collective labour agreement: \r\n<ul>\r\n <li>selection and recruitment of new employees; </li>\r\n <li>development of competencies and skills of the workforce; </li>\r\n <li>career development and career management within the company; </li>\r\n<li>work adaptations according to changing capabilities and competencies of workers through internal job rotation; </li>\r\n <li>adjustment of working time and working conditions; </li>\r\n <li>health promotion, prevention and elimination of physical and psychosocial barriers to remain at work; </li>\r\n<li>systems of recognition of acquired competencies. </li>\r\n \r\n</ul>\r\n\r\nThe employer may then choose a single field of action, combining action areas or opt for a non-listed area of action. The sectors have the possibility to add actions',NULL,2012,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(381,'Early return to work and prevention of chronic low back pain ','BE','This is an evidence-based multidisciplinary programme conducted in more than 50 rehabilitation centres across the country.','This is an evidence-based multidisciplinary programme conducted in more than 50 rehabilitation centres across the country.','http://www.fmp-fbz.fgov.be/prev/RUGPREVENTIE/index.html',2005,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(382,'Return-to-work programme: the Sherbrooke model ','BE','This programme offers an individually tailored, workplace oriented, step-by-step trans-disciplinary return-to-work strategy.','This programme offers an individually tailored, workplace oriented, step-by-step trans-disciplinary return-to-work strategy.','http://orbi.ulg.ac.be/handle/2268/133610',2010,'0','0','1','RTW','0',NULL,NULL,'0','0','1'),(383,'Still young, already old at work','BE','This is an anti-discrimination campaign to change attitudes towards the employment of older workers (50+).','This is an anti-discrimination campaign to change attitudes towards the employment of older workers (50+).','http://www.emploi.belgique.be/defaultNews.aspx?id=37530 ',2012,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(384,'Consultation platforms ','BE','These are for all the players involved (insurance companies, occupational physicians, employers, employees, etc.) in supporting return to work; they are also for promoting better information (information campaign).','These are for all the players involved (insurance companies, occupational physicians, employers, employees, etc.) in supporting return to work; they are also for promoting better information (information campaign).','http://www.hrworld.be/hrworld/Terug-aan-het-werk-na-een-langdurige-afwezigheid-het-taboe-doorbroken.html?LangType=2067',NULL,'0','0','0','OTHERS','0','Pilot project in the youth welfare agency: reintegration of employees after sick leave',NULL,'1','1','0'),(385,'The Workplace health plan for 2016–2020 (troisième Plan santé au travail – PST 3)','FR','On 8 December 2015, the government and all representative social partners at national level adopted the third Workplace health plan. The plan has two key objectives:\r\n<ul>\r\n <li>Developing a risk prevention culture by:</li>\r\n<ul><li>continuing to work on a variety of ‘classic’ risks (e. g. falls and trips, chemical risks);</li>\r\n <li>taking into account organisational risks (especially burnout or professional exhaustion syndrome);</li>\r\n <li>anticipating emerging risks (e.g. carcinogens, endocrine disruptors, etc.)</li></ul>\r\n <li>Improving quality of working life through the mobilisation of all stakeholders in favour of prevention, so that working conditions are considered a strategic priority for companies.</li>\r\n<ul><li>promoting quality of working life </li>\r\n <li>keeping workers with health problems in employment</li>\r\n<li>reinforcing links between workplace and public health</li>\r\n</ul>\r\n<li>Reinforcing social dialogue: the plan also emphasizes the role of social dialogue in workplace health policies and encourages the conclusion of collective agreements at sector and corporate level.</li></ul>\r\nThe Plan lays the emphasis on work ability and the need to retain workers with reduced capacity – not limited to workers with recognised disability – on the labour market. It sets as a priority to strengthen individual support for workers and early identification of workers potentially at risk of exclusion from the labour market. One of the objectives is to improve coordination between different actors (physician / occupational physician / social security), and anticipate the return to work earlier than it currently is.</br>','On 8 December 2015, the government and all representative social partners at national level adopted the third Workplace health plan. The plan has two key objectives:\r\n<ul>\r\n <li>Developing a risk prevention culture by:</li>\r\n<ul><li>continuing to work on a variety of ‘classic’ risks (e. g. falls and trips, chemical risks);</li>\r\n <li>taking into account organisational risks (especially burnout or professional exhaustion syndrome);</li>\r\n <li>anticipating emerging risks (e.g. carcinogens, endocrine disruptors, etc.)</li></ul>\r\n <li>Improving quality of working life through the mobilisation of all stakeholders in favour of prevention, so that working conditions are considered a strategic priority for companies.</li>\r\n<ul><li>promoting quality of working life </li>\r\n <li>keeping workers with health problems in employment</li>\r\n<li>reinforcing links between workplace and public health</li>\r\n</ul>\r\n<li>Reinforcing social dialogue: the plan also emphasizes the role of social dialogue in workplace health policies and encourages the conclusion of collective agreements at sector and corporate level.</li></ul>\r\nThe Plan lays the emphasis on work ability and the need to retain workers with reduced capacity – not limited to workers with recognised disability – on the labour market. It sets as a priority to strengthen individual support for workers and early identification of workers potentially at risk of exclusion from the labour market. One of the objectives is to improve coordination between different actors (physician / occupational physician / social security), and anticipate the return to work earlier than it currently is.</br>',NULL,2015,'1','1','0','OSH','1',NULL,NULL,'1','1','0'),(386,'The National Plan for Health at Work for the period 2010-2014 (OSH Strategy)','FR','The main objective of this plan is the improvement of working conditions for all ages, and it focuses on the prevention of arduous working conditions and the promotion of the quality of employment as a condition for retaining older workers in the labour market. It included an objective related to the health and safety of older workers, acknowledging the need to implement actions concerning work organisation and working time, the adaptation of workplaces and professional re-orientation.','The main objective of this plan is the improvement of working conditions for all ages, and it focuses on the prevention of arduous working conditions and the promotion of the quality of employment as a condition for retaining older workers in the labour market. It included an objective related to the health and safety of older workers, acknowledging the need to implement actions concerning work organisation and working time, the adaptation of workplaces and professional re-orientation.',NULL,2010,'1','1','0','OSH','0','A comprehensive approach for the well-being of older workers in Solystic',NULL,'0','0','0'),(387,'2008 law on funding social welfare for 2009','FR','This law included an obligation for company agreements on the employment of older workers. Companies with 50 or more employees that are not covered by a sectoral or company agreement on this issue are required to conclude such an agreement at company level. All agreements must cover at least three of the following six dimensions:\r\n<ul>\r\n <li>Recruitment of older workers</li>\r\n <li>Anticipation of career development</li>\r\n <li>Improvement of working conditions and risk prevention</li>\r\n<li>Skill development and access to training</li>\r\n <li>Facilitating the work-to-retirement transition</li>\r\n <li>Knowledge and skill transfer and the development of tutorship programmes.</li></ul>','This law included an obligation for company agreements on the employment of older workers. Companies with 50 or more employees that are not covered by a sectoral or company agreement on this issue are required to conclude such an agreement at company level. All agreements must cover at least three of the following six dimensions:\r\n<ul>\r\n <li>Recruitment of older workers</li>\r\n <li>Anticipation of career development</li>\r\n <li>Improvement of working conditions and risk prevention</li>\r\n<li>Skill development and access to training</li>\r\n <li>Facilitating the work-to-retirement transition</li>\r\n <li>Knowledge and skill transfer and the development of tutorship programmes.</li></ul>',NULL,2008,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(355,'White Paper on Joint Responsibility for a Good and Decent Working Life – Working conditions, working environment and safety','NO','According to the White Paper, the government will address challenges and safeguard the Norwegian working life model through many policy guidelines.<br>\n<br>The White Paper promotes the following policy guidelines:<br>\n<ul>\n <li>Reinforced participation and collaboration; </li>\n <li>Active implementation of the Inclusive Workplace Agreement (IA Agreement);</li>\n <li>Making large and medium-large employers more responsible for creating a sound working life;</li>\n <li>Targeting efforts at different sectors;</li>\n <li>Reinforcing public supervisory agencies;</li>\n <li>Improving knowledge about working-life issues;</li>\n <li>Working on specific health and safety environment challenges, such as night work and chemicals;</li>\n <li>Continuing to address social dumping.</li>\n </ul>','According to the White Paper, the government will address challenges and safeguard the Norwegian working life model through many policy guidelines.<br>\n<br>The White Paper promotes the following policy guidelines:<br>\n<ul>\n <li>Reinforced participation and collaboration; </li>\n <li>Active implementation of the Inclusive Workplace Agreement (IA Agreement);</li>\n <li>Making large and medium-large employers more responsible for creating a sound working life;</li>\n <li>Targeting efforts at different sectors;</li>\n <li>Reinforcing public supervisory agencies;</li>\n <li>Improving knowledge about working-life issues;</li>\n <li>Working on specific health and safety environment challenges, such as night work and chemicals;</li>\n <li>Continuing to address social dumping.</li>\n </ul>','https://www.regjeringen.no/no/dokumentarkiv/stoltenberg-ii/ad/Tema-og-redaksjonelt-innhold/Redaksjonelle-artikler/2011/arbeidslivsmeldinga/id653465/',2011,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(356,'Inclusive Workplace Agreement (IA Agreement)','NO','After the two implementation periods 2001-2005 and 2006-2010, the Agreement was renegotiated in 2010 for the years 2010-2013. The latest revised agreement for the period 2014-2018 was concluded on 4 March 2014.</br> \r\n<br>The aim of the initiative was to reduce sick leave and to increase the employment of people with reduced functional ability and older workers. The Agreement encourages social partners to put safeguards in place to prevent early retirement, in particular age management policies (or senior policies) in companies.</br>\r\n<br>The objectives for 2014-18 are:</br>\r\n<ul><li>A 20% reduction in sick leave compared with the second quarter of 2001. This means that on a national level, sick leave must not exceed 5.6 %.\r\n</li>\r\n <li>Prevent withdrawal and increase employment of people with impaired functional ability.</li>\r\n <li>Active employment after the age of 50 to be extended by twelve months.</li></ul>\r\n\r\nEmployers’ obligation is to provide a good and inclusive working environment in cooperation and close dialogue with employee representatives, safety delegates and other employees.</br>\r\n\r\n<br>Link: <a href=\"https://www.nav.no/Forsiden/_attachment/263729?_ts=12d6fd0b950&download...\" class=\"external\" target=\"_blank\">https://www.nav.no/Forsiden/_attachment/263729?_ts=12d6fd0b950&download...</a><br/>','After the two implementation periods 2001-2005 and 2006-2010, the Agreement was renegotiated in 2010 for the years 2010-2013. The latest revised agreement for the period 2014-2018 was concluded on 4 March 2014.</br> \r\n<br>The aim of the initiative was to reduce sick leave and to increase the employment of people with reduced functional ability and older workers. The Agreement encourages social partners to put safeguards in place to prevent early retirement, in particular age management policies (or senior policies) in companies.</br>\r\n<br>The objectives for 2014-18 are:</br>\r\n<ul><li>A 20% reduction in sick leave compared with the second quarter of 2001. This means that on a national level, sick leave must not exceed 5.6 %.\r\n</li>\r\n <li>Prevent withdrawal and increase employment of people with impaired functional ability.</li>\r\n <li>Active employment after the age of 50 to be extended by twelve months.</li></ul>\r\n\r\nEmployers’ obligation is to provide a good and inclusive working environment in cooperation and close dialogue with employee representatives, safety delegates and other employees.</br>\r\n\r\n<br>Link: <a href=\"https://www.nav.no/Forsiden/_attachment/263729?_ts=12d6fd0b950&download...\" class=\"external\" target=\"_blank\">https://www.nav.no/Forsiden/_attachment/263729?_ts=12d6fd0b950&download...</a><br/>','https://www.regjeringen.no/no/tema/arbeidsliv/arbeidsmiljo-og-sikkerhet/inkluderende_arbeidsliv/id947/',2001,'1','1','0','OSH','1','Senior policy measures at St. Olav’s Hospital\nand\nOSLO Airport’s ‘Life Phase’ policy',NULL,'1','0','0'),(357,'Working Environment Act ','NO','Covers a number of legal rights for older workers over the age of 60: \n<ul>\n <li>prohibition of discrimination because of age in all aspects of employment, from job announcements to termination of employment contracts; </li>\n <li>requirement for the employer to consider age in their planning of work for their employees; </li>\n <li>right to reduced working time for employees over 62;</li>\n<li>right to an extra week paid holiday per year for employees over 60; </li>\n<li>right for paid leave for an employee who has close relatives needing caretaking at the end of their life.</li>\n</ul>','Covers a number of legal rights for older workers over the age of 60: \n<ul>\n <li>prohibition of discrimination because of age in all aspects of employment, from job announcements to termination of employment contracts; </li>\n <li>requirement for the employer to consider age in their planning of work for their employees; </li>\n <li>right to reduced working time for employees over 62;</li>\n<li>right to an extra week paid holiday per year for employees over 60; </li>\n<li>right for paid leave for an employee who has close relatives needing caretaking at the end of their life.</li>\n</ul>',NULL,NULL,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(358,'Vikersund spa','NO','An example of regional centres that focus on rehabilitation/return to work. This centre helps people of all ages who have struggled with illness or an accident to recover and return to work through a number of activities, based on physical and mental training, courses, seminars, etc.','An example of regional centres that focus on rehabilitation/return to work. This centre helps people of all ages who have struggled with illness or an accident to recover and return to work through a number of activities, based on physical and mental training, courses, seminars, etc.','http://www.vikersund-kurbad.no/rehabilitering-med-arbeid-som-maal',2011,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(359,'‘Ask the scientists’ ','NO','A Project launched by the CSP. The aim of the initiative was to make the knowledge and experiences of the Fafo Institute researchers available to whoever has a question. Four online meetings were organised for the employers by the Centre.','A Project launched by the CSP. The aim of the initiative was to make the knowledge and experiences of the Fafo Institute researchers available to whoever has a question. Four online meetings were organised for the employers by the Centre.','http://seniorpolitikk.no/fakta/spor-forskerne',2012,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(360,'Norwegian Institute of Adult Education (VOX)','NO','This is an institute under the Ministry of Education and Research, supporting measures on employability by increasing participation in education. Its main objective is to promote participation in community and working life by improving the competence levels of adults.<br/>\n<br>VOX manages government subsidies for the operational costs of study associations, distance-learning institutions and study centres, as well as providing financial support for the pedagogical development of lifelong learning.<br/>','This is an institute under the Ministry of Education and Research, supporting measures on employability by increasing participation in education. Its main objective is to promote participation in community and working life by improving the competence levels of adults.<br/>\n<br>VOX manages government subsidies for the operational costs of study associations, distance-learning institutions and study centres, as well as providing financial support for the pedagogical development of lifelong learning.<br/>',NULL,NULL,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(388,'Pension reform 2014 ','FR','For those working in arduous conditions, the pension system reform included a proposal for the creation of a ‘saving account compensating for the arduous working conditions’ (‘compte épargne pénibilité’). The concept of arduous work (‘pénibilité au travail’) has been incorporated into French labour law and the new requirements will take effect in 2016. The measures could affect around 20 % of all workers.','For those working in arduous conditions, the pension system reform included a proposal for the creation of a ‘saving account compensating for the arduous working conditions’ (‘compte épargne pénibilité’). The concept of arduous work (‘pénibilité au travail’) has been incorporated into French labour law and the new requirements will take effect in 2016. The measures could affect around 20 % of all workers.',NULL,2014,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(389,'Social Partners’ Agreement on Quality of Life at Work, 2013','FR','The aim of this agreement is to combine into a single bargaining programme various statutory negotiations that regulate the quality of working life. These will cover issues such as working time, gender equality, the removal of the gender wage gap, stress and harassment, and workers with disabilities. It promotes a systematic and holistic approach to quality of life at work, rather than focusing on specific risks or specific groups of workers.','The aim of this agreement is to combine into a single bargaining programme various statutory negotiations that regulate the quality of working life. These will cover issues such as working time, gender equality, the removal of the gender wage gap, stress and harassment, and workers with disabilities. It promotes a systematic and holistic approach to quality of life at work, rather than focusing on specific risks or specific groups of workers.','http://www.aquitaine.aract.fr/images/DocumentsQVT/ani_19_juin_2013_qualite_vie_travail.pdf',2013,'0','1','0','OSH','0','PSA Peugeot Citroen: mapping the workplace to better manage the workforce',NULL,'0','1','0'),(390,'National Action Plan for the Employment of Older Workers 2006-2010 ','FR','This action plan included measures to maintain the employability of older workers and promote age management in companies through an all-encompassing approach, which covered OSH and working conditions.','This action plan included measures to maintain the employability of older workers and promote age management in companies through an all-encompassing approach, which covered OSH and working conditions.','http://www.google.fr/url?sa=t&source=web&ct=res&cd=2&url=http%3A%2F%2Fwww.lexisnexis.fr%2Fpdf%2FDO%2Fseniors.pdf&ei=F-tASpKdAd3RjAfZ4uCfCQ&usg=AFQjCNGUOOpKZS3cJAMeG8vv6V9iz10oOQ&sig2=bGxcNM4Xmuqx7NvB9e4Ixw',2006,'1','1','0','OSH','0',NULL,NULL,'0','1','0'),(504,'Great Generation Association (Nagy Generáció)','HU','The aim of the association is to bring together the those aged 50 and over to improve the image of older people in Hungarian society and to increase appreciation of the ‘Great Generation’. The initiative includes a successful radio show and an internet portal. The goals of this project are to change the view of ageing in the country, to break down stereotypes and to encourage older people to live a creative and happy life. The Great Generation radio show analyses relevant problems, such as the unemployment rate of people over 50, senior volunteering, lifelong learning, etc. The broadcast is complemented by a not-for-profit website where users share their knowledge and discuss work, pensions and other topics.','The aim of the association is to bring together the those aged 50 and over to improve the image of older people in Hungarian society and to increase appreciation of the ‘Great Generation’. The initiative includes a successful radio show and an internet portal. The goals of this project are to change the view of ageing in the country, to break down stereotypes and to encourage older people to live a creative and happy life. The Great Generation radio show analyses relevant problems, such as the unemployment rate of people over 50, senior volunteering, lifelong learning, etc. The broadcast is complemented by a not-for-profit website where users share their knowledge and discuss work, pensions and other topics.','http://www.nagygeneracio.hu/',2011,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(505,'OSH Strategy Statement 2013-2015','IE','The Strategy statement set out the vision of the Health and Safety Authority (HSA) for the relevant three-year period. It explained the background to the strategy and set out the strategic goals for the period, as well as indicating in general terms how the goals were to be delivered. There were explicit links between the Irish strategy and the EU strategy. The Strategy was supported by the HSA programmes of work, which set out the detailed activities to be undertaken each year.</br>\n<br>The main issues affecting Ireland during the period covered by the strategy were mainly problems stemming from the economic crisis. The Strategy Statement 2013-2015 provided a summary of some of the challenges and objectives: \n<ul>\n <li>continuing to reduce workplace deaths and injuries and work-related disease and their economic impact;</li>\n <li>the economic situation and the need to both grow the economy and reduce costs;</li> \n<li>the changing natures of the workforce and workplaces;</li>\n <li>public sector reform;</li>\n<li>dealing with misconceptions about the role of OSH regulation.</li></ul>','The Strategy statement set out the vision of the Health and Safety Authority (HSA) for the relevant three-year period. It explained the background to the strategy and set out the strategic goals for the period, as well as indicating in general terms how the goals were to be delivered. There were explicit links between the Irish strategy and the EU strategy. The Strategy was supported by the HSA programmes of work, which set out the detailed activities to be undertaken each year.</br>\n<br>The main issues affecting Ireland during the period covered by the strategy were mainly problems stemming from the economic crisis. The Strategy Statement 2013-2015 provided a summary of some of the challenges and objectives: \n<ul>\n <li>continuing to reduce workplace deaths and injuries and work-related disease and their economic impact;</li>\n <li>the economic situation and the need to both grow the economy and reduce costs;</li> \n<li>the changing natures of the workforce and workplaces;</li>\n <li>public sector reform;</li>\n<li>dealing with misconceptions about the role of OSH regulation.</li></ul>',NULL,2013,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(506,'Workplace Health and Well-Being Strategy','IE','The Strategy was an exploration of issues around the health and well-being of the working-age population. The objective was ‘to create a workplace culture and environment that will promote health and well-being, prevent ill health and support the rehabilitation to the workplace of those who are out of work through ill health or disability’. The Strategy recognised the challenge of the ageing workforce. However, although the HSA continues to take forward some of the recommendations, the Strategy was not implemented as a result of the lack of a cross-departmental implementation group.','The Strategy was an exploration of issues around the health and well-being of the working-age population. The objective was ‘to create a workplace culture and environment that will promote health and well-being, prevent ill health and support the rehabilitation to the workplace of those who are out of work through ill health or disability’. The Strategy recognised the challenge of the ageing workforce. However, although the HSA continues to take forward some of the recommendations, the Strategy was not implemented as a result of the lack of a cross-departmental implementation group.','http://www.hsa.ie/eng/Publications_and_Forms/Publications/Occupational_Health/Workplace_Health_and_Well-Being_Strategy.pdf',2008,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(507,'National Positive Ageing Strategy','IE','The vision of the strategy is that ‘Ireland will be a society for all ages that celebrates and prepares properly for individual and population ageing’. The strategy sets out a number of national goals and cross-cutting objectives. One of the goals relates removing barriers and the aim is ‘to recognise and enable the active participation of people in formal and informal work and voluntary activities as they age, according to their individual needs, preferences and capacities’. The associated objective is ‘Develop a wide range of employment options (including options for gradual retirement) for people as they age and identify any barriers (legislative, attitudinal, custom and practice) to continued employment and training opportunities for people as they age’. One of the main cross-cutting objectives is combating ageism.','The vision of the strategy is that ‘Ireland will be a society for all ages that celebrates and prepares properly for individual and population ageing’. The strategy sets out a number of national goals and cross-cutting objectives. One of the goals relates removing barriers and the aim is ‘to recognise and enable the active participation of people in formal and informal work and voluntary activities as they age, according to their individual needs, preferences and capacities’. The associated objective is ‘Develop a wide range of employment options (including options for gradual retirement) for people as they age and identify any barriers (legislative, attitudinal, custom and practice) to continued employment and training opportunities for people as they age’. One of the main cross-cutting objectives is combating ageism.','http://health.gov.ie/healthy-ireland/national-positive-ageing-strategy/',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(508,'Renaissance Project','IE','The programme facilitated the early return to work of people with back pain. The project targeted new disability benefit and injury benefit claimants aged 20 to 50 in Dublin and Cork who were certified as suffering from low back pain. The claimants were targeted for early medical intervention to see if this would decrease the incidence of progression to chronic disability. It was found that of the 3 700 claimants in the study invited in for assessment, 67.4 % voluntarily came off benefits and returned to work.','The programme facilitated the early return to work of people with back pain. The project targeted new disability benefit and injury benefit claimants aged 20 to 50 in Dublin and Cork who were certified as suffering from low back pain. The claimants were targeted for early medical intervention to see if this would decrease the incidence of progression to chronic disability. It was found that of the 3 700 claimants in the study invited in for assessment, 67.4 % voluntarily came off benefits and returned to work.','http://www.irishhealth.com/article.html?id=6354',2003,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(509,'Ageing Well Network (AWN)','IE','The network is an independent group of leaders, heads of organisations and strategic thinkers. Its mission is two-fold:<ul>\n <li>to reframe the agenda on ageing by extending the focus beyond health, care and pension provision to also address the significant opportunities of a rapidly ageing global population;</li>\n<li>to act as a catalyst and support for better long-term planning and greater collaboration among agencies involved in policy development and service provision across the public, private and voluntary sectors.</li></ul>\nThe network produced The New Agenda on Ageing, subtitled ‘To Make Ireland the Best Country to Grow Old In’. The report provides a full picture of the many issues surrounding ageing, covering health, wealth, age-friendly communities, engagement, housing and strategy development and implementation.','The network is an independent group of leaders, heads of organisations and strategic thinkers. Its mission is two-fold:<ul>\n <li>to reframe the agenda on ageing by extending the focus beyond health, care and pension provision to also address the significant opportunities of a rapidly ageing global population;</li>\n<li>to act as a catalyst and support for better long-term planning and greater collaboration among agencies involved in policy development and service provision across the public, private and voluntary sectors.</li></ul>\nThe network produced The New Agenda on Ageing, subtitled ‘To Make Ireland the Best Country to Grow Old In’. The report provides a full picture of the many issues surrounding ageing, covering health, wealth, age-friendly communities, engagement, housing and strategy development and implementation.','http://www.atlanticphilanthropies.org/learning/report-new-agenda-ageingto-make-ireland-best-country-grow-old',2007,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(510,'Irish Longitudinal Study on Ageing (TILDA)','IE','TILDA is a large-scale, nationally representative, longitudinal study on ageing in Ireland, the aim of which is ‘to make Ireland the best place in the world to grow old’. The study is led by Trinity College Dublin in collaboration with a number of institutions in Ireland and longitudinal studies on ageing in Europe and the USA. TILDA collects information on all aspects of health, economic and social circumstances (from over 8 500 people aged 50 years and over, living in Ireland) in a series of data collection waves once every two years.','TILDA is a large-scale, nationally representative, longitudinal study on ageing in Ireland, the aim of which is ‘to make Ireland the best place in the world to grow old’. The study is led by Trinity College Dublin in collaboration with a number of institutions in Ireland and longitudinal studies on ageing in Europe and the USA. TILDA collects information on all aspects of health, economic and social circumstances (from over 8 500 people aged 50 years and over, living in Ireland) in a series of data collection waves once every two years.','http://www.tcd.ie/tilda/',NULL,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(511,'Age Action ','IE','<strong>Age Action</strong> is a charity that promotes positive ageing and better policies and services for older people, as well as campaigning on their behalf. In May 2013, it prepared a document entitled <em>Pre-budget submission 2014</em>, which provided a broad view of the issues and challenges affecting older people in general, including\n<ul><li>income and taxation; </li>\n <li>education, skills and employment, including the need to improve retirement age flexibility, to develop targeted activation programmes to get older people back to work and to provide additional support to assist people to stay in work; </li>\n <li>health.</li></ul>','<strong>Age Action</strong> is a charity that promotes positive ageing and better policies and services for older people, as well as campaigning on their behalf. In May 2013, it prepared a document entitled <em>Pre-budget submission 2014</em>, which provided a broad view of the issues and challenges affecting older people in general, including\n<ul><li>income and taxation; </li>\n <li>education, skills and employment, including the need to improve retirement age flexibility, to develop targeted activation programmes to get older people back to work and to provide additional support to assist people to stay in work; </li>\n <li>health.</li></ul>','https://www.ageaction.ie/',NULL,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(512,'National Strategy for Health and Safety at Work 2008-2012','MT','One of the aims of the strategy was taking appropriate action against existing and emerging risks. The section on this goal identified groups of workers who may themselves be vulnerable by virtue of some other factor, including the presence of a disability, being at the extremes of age and the gender of the worker; such workers require different or greater protection.','One of the aims of the strategy was taking appropriate action against existing and emerging risks. The section on this goal identified groups of workers who may themselves be vulnerable by virtue of some other factor, including the presence of a disability, being at the extremes of age and the gender of the worker; such workers require different or greater protection.','https://www.gov.mt/en/Government/Government%20of%20Malta/Ministries%20and%20Entities/Pages/Soc-Dialogue,-Cons-Affairs,-Civil-liberties-portfolio.aspx',2008,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(513,'Strategic Plan for Occupational Health and Safety 2014-20','MT','The aim of the Strategy is to improve levels of occupational safety and health in Malta. The plan recognises that preventing workers from suffering serious accidents or occupational diseases and promoting workers’ health throughout an extended working life contributes to addressing the long-term effects of demographic ageing.</br>\n<br>In line with the strategic plan, the Maltese Occupational Health and Safety Authority (OHSA) has prepared a project proposal entitled ‘Ensuring Sustainable Work for Healthier and Longer Working Lives’, which aims to promote healthy ageing at work, focusing on safety and health measures that could enable and motivate older workers to remain in the labour market for longer. This will be achieved through a specialised campaign raising awareness among relevant stakeholders and assisting companies, including small and medium-sized enterprises, to deal with the challenges related to an ageing workforce, and by developing and providing information and tools.</br>','The aim of the Strategy is to improve levels of occupational safety and health in Malta. The plan recognises that preventing workers from suffering serious accidents or occupational diseases and promoting workers’ health throughout an extended working life contributes to addressing the long-term effects of demographic ageing.</br>\n<br>In line with the strategic plan, the Maltese Occupational Health and Safety Authority (OHSA) has prepared a project proposal entitled ‘Ensuring Sustainable Work for Healthier and Longer Working Lives’, which aims to promote healthy ageing at work, focusing on safety and health measures that could enable and motivate older workers to remain in the labour market for longer. This will be achieved through a specialised campaign raising awareness among relevant stakeholders and assisting companies, including small and medium-sized enterprises, to deal with the challenges related to an ageing workforce, and by developing and providing information and tools.</br>',NULL,2015,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(514,'National Strategy on Active Ageing','MT','The Strategy advocates supporting work settings that ensure workers’ lifelong employability, equal access to training, age-appropriate training systems, flexible and individual work designs, age-friendly shift rotas and occupational support from well-informed management. According to this strategy, guidance services available to older workers tend to be provided in a fragmented and sporadic manner. The Strategy on Active Ageing also identifies a gap in the services available to people aged over the statutory retirement age who wish to return to work or take-up self-employment. Another gap is the lack of availability of planned reduction of working hours, rather than an abrupt transition from work to full retirement.</br>\n<br>The Strategy also refers to the need to provide older workers with opportunities to update and extend their skills and qualifications to enable and encourage them to continue working. It mentions that older workers face various barriers when participating in skills development, such as negative employer attitudes, discrimination, lack of information about options, financial issues and negative personal attitudes.</br>','The Strategy advocates supporting work settings that ensure workers’ lifelong employability, equal access to training, age-appropriate training systems, flexible and individual work designs, age-friendly shift rotas and occupational support from well-informed management. According to this strategy, guidance services available to older workers tend to be provided in a fragmented and sporadic manner. The Strategy on Active Ageing also identifies a gap in the services available to people aged over the statutory retirement age who wish to return to work or take-up self-employment. Another gap is the lack of availability of planned reduction of working hours, rather than an abrupt transition from work to full retirement.</br>\n<br>The Strategy also refers to the need to provide older workers with opportunities to update and extend their skills and qualifications to enable and encourage them to continue working. It mentions that older workers face various barriers when participating in skills development, such as negative employer attitudes, discrimination, lack of information about options, financial issues and negative personal attitudes.</br>','http://www.activeageing.gov.mt/en/Pages/NSPAA.aspx',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(515,'Ensuring Sustainable Work for Healthier and Longer Working Lives','MT','This initiative:\n<ul>\n <li>mentions the rehabilitation of older workers after a period of disability in relation to the overall objective of keeping older workers longer at work; </li>\n <li>includes an awareness campaign; </li>\n <li>project activities will include the implementation of measures to prevent sickness absence, measures to encourage rehabilitation after long-term permanent disability and measures to reduce unemployment due to health problems.</li></ul>','This initiative:\n<ul>\n <li>mentions the rehabilitation of older workers after a period of disability in relation to the overall objective of keeping older workers longer at work; </li>\n <li>includes an awareness campaign; </li>\n <li>project activities will include the implementation of measures to prevent sickness absence, measures to encourage rehabilitation after long-term permanent disability and measures to reduce unemployment due to health problems.</li></ul>','http://ohsa.org.mt/',2015,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(516,'Strategy on Health and Safety at Work in the Slovak Republic until 2020','SK','This is the main policy document in the field of OSH in Slovakia. The strategy recognises the need to take into consideration changes in the labour market arising from demographic developments and the ageing of the working population.','This is the main policy document in the field of OSH in Slovakia. The strategy recognises the need to take into consideration changes in the labour market arising from demographic developments and the ageing of the working population.','http://www.employment.gov.sk/files/slovensky/praca-zamestnanost/bezpecnost-ochrana-zdravia-pri-praci/osh-protection-strategy-slovak-republic-until-2020.pdf',2013,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(517,'Action plan for the implementation of the OSH strategy from 2013 to 2015, with an outlook until 2020','SK','This is a detailed breakdown of the steps required for the implementation of the OSH strategy and includes a work plan for 2013-2015.\nThe ageing of the workforce is addressed only in the section that focuses on research into new risks and support for activities for the protection of older employees: ‘Enforcing among other things research on an ageing workforce’.','This is a detailed breakdown of the steps required for the implementation of the OSH strategy and includes a work plan for 2013-2015.\nThe ageing of the workforce is addressed only in the section that focuses on research into new risks and support for activities for the protection of older employees: ‘Enforcing among other things research on an ageing workforce’.','http://www.nip.sk/?id_af=35&ins=ba',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(518,'National Programme for Active Ageing 2014','SK','This programme is intended to support the active ageing of people aged 50 and over and to protect older people. One of the priorities of the national programme is to support employment and increase the employability of older people. It includes specific objectives related to the working conditions of older workers:\n<ul>\n <li>To increase the safety of employees over the age of 50 in their working environment and ensure that their health is protected through thorough inspections conducted once every two years, starting in 2014. Targeted inspections focus on the working population aged 50 and over. The aim is to monitor the OSH of this population with the objective of improving their working conditions, taking into account their health, stress levels, etc.</li>\n <li>To prevent discrimination against older workers by effective measures undertaken by the authorities, including organising training for inspectors so that they can effectively identify when discrimination at work is taking place.</li></ul>','This programme is intended to support the active ageing of people aged 50 and over and to protect older people. One of the priorities of the national programme is to support employment and increase the employability of older people. It includes specific objectives related to the working conditions of older workers:\n<ul>\n <li>To increase the safety of employees over the age of 50 in their working environment and ensure that their health is protected through thorough inspections conducted once every two years, starting in 2014. Targeted inspections focus on the working population aged 50 and over. The aim is to monitor the OSH of this population with the objective of improving their working conditions, taking into account their health, stress levels, etc.</li>\n <li>To prevent discrimination against older workers by effective measures undertaken by the authorities, including organising training for inspectors so that they can effectively identify when discrimination at work is taking place.</li></ul>','http://www.employment.gov.sk/files/slovensky/ministerstvo/rada-vlady-sr-prava-seniorov/npas-2014-2020.pdf',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(519,'National Work Programme for the European Year of Active Ageing and Solidarity between Generations','SK','The programme describes the current situation in selected areas of life as well as the priorities of the Slovak Government in the areas of active ageing and solidarity between generations.','The programme describes the current situation in selected areas of life as well as the priorities of the Slovak Government in the areas of active ageing and solidarity between generations.','http://www.europarl.ie/resource/static/files/Events/eprs_ida-2015-536344_en-ep-report.pdf',2011,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(520,'New bill modifying Luxembourg’s Labour Code and introducing measures on age management ','LU','The objective of the law is:\n<ul>\n <li>to improve the economic condition of the elderly;</li>\n <li>to raise the effective retirement age; </li>\n <li>to reduce long-term unemployment among the elderly;</li>\n<li>to prevent occupational health issues for the elderly by limiting risks;</li>\n<li>to foster professional training for the elderly.</li>\n</ul>\n \nThe main instrument is the age management plan <em>(plan de gestion des âges)</em> that is mandatory in any undertaking with 150 employees or more. The plan must cover at least three of the following points:\n<ul>\n <li>recruitment of older workers within the enterprise;</li>\n <li>anticipation of the progression of professional careers;</li>\n <li>improvement of working conditions and risk prevention;</li>\n<li>implementation of preventive health measures;</li>\n <li>planning for the ending of a career and the transition between work and retirement;</li>\n <li>transmission of knowledge and competencies and development of tutorship.</li></ul>','The objective of the law is:\n<ul>\n <li>to improve the economic condition of the elderly;</li>\n <li>to raise the effective retirement age; </li>\n <li>to reduce long-term unemployment among the elderly;</li>\n<li>to prevent occupational health issues for the elderly by limiting risks;</li>\n<li>to foster professional training for the elderly.</li>\n</ul>\n \nThe main instrument is the age management plan <em>(plan de gestion des âges)</em> that is mandatory in any undertaking with 150 employees or more. The plan must cover at least three of the following points:\n<ul>\n <li>recruitment of older workers within the enterprise;</li>\n <li>anticipation of the progression of professional careers;</li>\n <li>improvement of working conditions and risk prevention;</li>\n<li>implementation of preventive health measures;</li>\n <li>planning for the ending of a career and the transition between work and retirement;</li>\n <li>transmission of knowledge and competencies and development of tutorship.</li></ul>',NULL,2014,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(521,'Action Plan to Improve Age Management in the Public Service Sector','LU','The plan includes measures such as a system for analysing and monitoring age structures; an awareness and training programme in the area of health management, with an emphasis on older workers; an education programme that takes the age dimension into account; and an awareness campaign for executives responsible for the management of staff in ministerial departments, administration and services.','The plan includes measures such as a system for analysing and monitoring age structures; an awareness and training programme in the area of health management, with an emphasis on older workers; an education programme that takes the age dimension into account; and an awareness campaign for executives responsible for the management of staff in ministerial departments, administration and services.',NULL,2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(522,'Action Plan for the Employment of Young Workers','LU','The plan proposes the creation of contracts between generations by linking the recruitment of young workers to the retention of older workers in employment.','The plan proposes the creation of contracts between generations by linking the recruitment of young workers to the retention of older workers in employment.',NULL,2013,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(523,'Training leave <em>(congé formation)</em>','LU','The scheme offers the possibility to all workers in the private sector to take leave, of a maximum of 80 days, for training purposes in the course of their career. The beneficiary receives a compensatory allowance, paid by the employer, equal to the average daily wage. The system is financed by the state, which reimburses the compensatory allowance and the employer’s share of social security contributions. The state contribution is up to 20 % of the wage costs of the beneficiary or 35 % if the beneficiary is over 45 years of age. Lifelong learning programmes can be beneficial to employees exposed to arduous or repetitive working conditions, as they can prepare them for a second career in the last years of their professional life, enabling them to turn to less demanding jobs.','The scheme offers the possibility to all workers in the private sector to take leave, of a maximum of 80 days, for training purposes in the course of their career. The beneficiary receives a compensatory allowance, paid by the employer, equal to the average daily wage. The system is financed by the state, which reimburses the compensatory allowance and the employer’s share of social security contributions. The state contribution is up to 20 % of the wage costs of the beneficiary or 35 % if the beneficiary is over 45 years of age. Lifelong learning programmes can be beneficial to employees exposed to arduous or repetitive working conditions, as they can prepare them for a second career in the last years of their professional life, enabling them to turn to less demanding jobs.',NULL,2008,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(524,'Centre for the Prevention of Back Problems ‘Prevendos’','LU','Prevendos provides training for three categories of workers: a one-day prevention course for workers without back problems; a prevention course for workers with back problems to help them avoid dangerous postures or movements; and a rehabilitation training course for workers with chronic and serious back problems to help reintegrate these workers into the work environment. Training courses are reimbursed by the Accident Insurance Association (AAA) or the CNS and the Ministry of Health. The STM follows up with all trained workers by mail one year after the training.','Prevendos provides training for three categories of workers: a one-day prevention course for workers without back problems; a prevention course for workers with back problems to help them avoid dangerous postures or movements; and a rehabilitation training course for workers with chronic and serious back problems to help reintegrate these workers into the work environment. Training courses are reimbursed by the Accident Insurance Association (AAA) or the CNS and the Ministry of Health. The STM follows up with all trained workers by mail one year after the training.',NULL,2000,'1','0','1','RTW','0',NULL,NULL,'0','0','1'),(525,'Troubles de l’appareil locomoteur','CH','This was an inspection campaign aimed at increasing compliance with laws intended to prevent musculoskeletal disorders (MSDs), which are the most common cause of disability leading to early retirement in Switzerland. In 2014, the focus of the inspection campaign was changed to psychosocial risks, as these are a widespread problem in many sectors. The initiative also involved the publication of a version of the Work Ability Index (WAI), which was originally developed by the Finnish Institute for Occupational Health (FIOH). This is an occupational medicine measuring tool that aims to identify at an early stage risks to workers that are likely to result in them taking early retirement.','This was an inspection campaign aimed at increasing compliance with laws intended to prevent musculoskeletal disorders (MSDs), which are the most common cause of disability leading to early retirement in Switzerland. In 2014, the focus of the inspection campaign was changed to psychosocial risks, as these are a widespread problem in many sectors. The initiative also involved the publication of a version of the Work Ability Index (WAI), which was originally developed by the Finnish Institute for Occupational Health (FIOH). This is an occupational medicine measuring tool that aims to identify at an early stage risks to workers that are likely to result in them taking early retirement.','http://www.seco.admin.ch/aktuell/00277/01164/01980/index.html?lang=fr&msg-id=28929',2009,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(526,'Qualified Workers for Switzerland','CH','This initiative addresses the potential shortage in qualified workers as a result of demographic changes. One of the areas for action is to develop a strategy to create good employment conditions until retirement and also after retirement age has been reached.</br>\n<br>The following general actions were adopted in May 2013 as part of that strategy:\n<ul>\n <li>Research and studies on the working conditions of older workers (discrimination, long-term unemployment risk, determinants of early retirement, incentive effects of social insurance, etc.).</li>\n <li>Identifying incentives for employment after retirement. </li>\n <li>Increasing the work ability of older workers and their motivation to stay employed: the Confederation and the cantons will be encouraged to set an example and create working conditions that are adapted to age in order to enable employees to continue working after legal retirement age. </li>\n<li>Raising awareness among organisations about enhancing the employment of older workers.</li>\n</ul>','This initiative addresses the potential shortage in qualified workers as a result of demographic changes. One of the areas for action is to develop a strategy to create good employment conditions until retirement and also after retirement age has been reached.</br>\n<br>The following general actions were adopted in May 2013 as part of that strategy:\n<ul>\n <li>Research and studies on the working conditions of older workers (discrimination, long-term unemployment risk, determinants of early retirement, incentive effects of social insurance, etc.).</li>\n <li>Identifying incentives for employment after retirement. </li>\n <li>Increasing the work ability of older workers and their motivation to stay employed: the Confederation and the cantons will be encouraged to set an example and create working conditions that are adapted to age in order to enable employees to continue working after legal retirement age. </li>\n<li>Raising awareness among organisations about enhancing the employment of older workers.</li>\n</ul>','https://www.wbf.admin.ch/fr/themes/formation-recherche-innovation/davantage-de-personnel-qualifie/',2011,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(527,'Policy initiatives to increase the employability of \nolder workers\n','CH','<ul><li>Increasing federal and cantonal benefits for older long-term unemployed people: job training compensation paid to employers who recruit unemployed people was increased from covering a period of 6 months to covering a period of 12 months for recruits over 50 years old.</li>\n <li>Raising the awareness of regional employment offices of the issues facing older workers.</li>\n <li>The ‘validation of skills acquired from experience’ (VAE) scheme has been standardised nationally. </li>\n<li>Strengthening the enforcement of the laws regarding the prevention of MSDs.</li></ul>','<ul><li>Increasing federal and cantonal benefits for older long-term unemployed people: job training compensation paid to employers who recruit unemployed people was increased from covering a period of 6 months to covering a period of 12 months for recruits over 50 years old.</li>\n <li>Raising the awareness of regional employment offices of the issues facing older workers.</li>\n <li>The ‘validation of skills acquired from experience’ (VAE) scheme has been standardised nationally. </li>\n<li>Strengthening the enforcement of the laws regarding the prevention of MSDs.</li></ul>',NULL,NULL,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(528,'Strategy for the Employment of Older People','CH','Recommendations in the strategy include:\n<ul>\n <li>a focus on lifelong learning and vocational training; </li>\n <li>introducing workstation adaptation and health promotion in companies;</li>\n <li>allowing for career changes and opportunities for promotion; </li>\n <li>seeking ways to change attitudes towards older workers.</li>\n</ul>\n\nAs part of this strategy, the Swiss Employers Association produced a booklet entitled ‘Altersstrategie’. It explains in broad terms the implications of getting older for workers and provides guidelines for companies.','Recommendations in the strategy include:\n<ul>\n <li>a focus on lifelong learning and vocational training; </li>\n <li>introducing workstation adaptation and health promotion in companies;</li>\n <li>allowing for career changes and opportunities for promotion; </li>\n <li>seeking ways to change attitudes towards older workers.</li>\n</ul>\n\nAs part of this strategy, the Swiss Employers Association produced a booklet entitled ‘Altersstrategie’. It explains in broad terms the implications of getting older for workers and provides guidelines for companies.','http://dievolkswirtschaft.ch/de/2014/11/die-arbeitswelt-im-demografischen-wandel-die-ressource-der-mitarbeitenden-50plus/',2006,'0','1','0','OSH','1',NULL,NULL,'1','1','0'),(529,'Professional Reintegration Initiative (<em>Initiative Berufliche Reintegration</em>) ','CH','The initiative aims to reintegrate workers who have had an accident and are unable to return to their previous workplace and who are not entitled to occupational redeployment through the invalidity insurance scheme.','The initiative aims to reintegrate workers who have had an accident and are unable to return to their previous workplace and who are not entitled to occupational redeployment through the invalidity insurance scheme.','http://www.suva.ch/startseite-suva/unfall-suva/berufliche-reintegration-suva.htm',2009,'0','0','1','RTW','0',NULL,NULL,'0','1','0'),(530,'Que peut faire la politique de la formation en faveur \ndes travailleurs et travailleuses d’un certain âge?\n','CH','The trade union association Travail.Suisse launched a campaign to <strong>promote vocational training</strong> for older workers.','The trade union association Travail.Suisse launched a campaign to <strong>promote vocational training</strong> for older workers.','http://www.travailsuisse.ch/themes/formation/formation_professionnelle?page=3',2013,'0','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(531,'50+ santé','CH','The intercantonal programme <strong>50+ santé</strong> aimed to promote a number of measures and activities to improve the working conditions of workers aged 50 and over. <strong>Fitforwork-Swiss</strong> aimed to encourage better management of people affected by MSDs, in order to maintain or improve their work capacity. Among other activities, the programme published a report entitled <em>Return to work</em>.','The intercantonal programme <strong>50+ santé</strong> aimed to promote a number of measures and activities to improve the working conditions of workers aged 50 and over. <strong>Fitforwork-Swiss</strong> aimed to encourage better management of people affected by MSDs, in order to maintain or improve their work capacity. Among other activities, the programme published a report entitled <em>Return to work</em>.','http://www.50plussante.ch/',NULL,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(532,'National Strategy for the Prevention of Accidents at Work and of Occupational Diseases','IT','The strategy includes plans for actions to improve safety and health at work through enhanced inspection services and information and assistance for workers and enterprises. Both musculoskeletal disorders and cancers are considered priorities for supervisory action to ensure a reduction in occupational diseases. However, the strategy does not mention older workers.','The strategy includes plans for actions to improve safety and health at work through enhanced inspection services and information and assistance for workers and enterprises. Both musculoskeletal disorders and cancers are considered priorities for supervisory action to ensure a reduction in occupational diseases. However, the strategy does not mention older workers.','http://www.lavoro.gov.it/SicurezzaLavoro/Documents/Documento_29_maggio_2013_Strategianazionale.pdf',2013,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(533,'National Programme Promoting Active, Vital and Dignified Ageing in a Solidarity-Based Society','IT','The programme aims to promote a new, more positive idea of old age, as well as of volunteering and a range of other activities that encourage active ageing. It encourages lifelong learning, the transmission of knowledge from older to younger generations, education programmes on active and healthy lifestyles, and solidarity between generations.</br>\n<br>It envisages the screening and monitoring of regional and local plans for active ageing and the regular review of the implementation of such plans, which will take into account the comments of stakeholders and trade unions.</br>\n<br>The initiatives include monitoring of regional and local initiatives for active ageing implemented since 2007. Examples of such initiatives include incentives to encourage older workers to remain in employment, training opportunities, and promotion of the health and well-being of older workers.</br>','The programme aims to promote a new, more positive idea of old age, as well as of volunteering and a range of other activities that encourage active ageing. It encourages lifelong learning, the transmission of knowledge from older to younger generations, education programmes on active and healthy lifestyles, and solidarity between generations.</br>\n<br>It envisages the screening and monitoring of regional and local plans for active ageing and the regular review of the implementation of such plans, which will take into account the comments of stakeholders and trade unions.</br>\n<br>The initiatives include monitoring of regional and local initiatives for active ageing implemented since 2007. Examples of such initiatives include incentives to encourage older workers to remain in employment, training opportunities, and promotion of the health and well-being of older workers.</br>','http://www.invecchiamentoattivo.politicheperlafamiglia.it/wp-content/uploads/2012/02/Anno-invecchiamento-2012-Programma-nazionale-lavoro.pdf',2012,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(534,'Reform of the Labour Market Regulation (Law 92/2012)','IT','The reform introduced:\n<ul><li>A tax incentive for companies employing workers aged over 50 who have been unemployed for more than 12 months. Employers benefit from a 50 % tax reduction both for fixed-term contracts (the reduction lasts 12 months) and open-ended contracts (the reduction lasts 18 months).</li>\nli>	The restructuring of employment agencies’ activities in order to provide support for workers aged over 50. Agencies provide a specific placement service (matching demand and supply and offering consultancy and training) designed for people who are struggling to find work.</li></ul>','The reform introduced:\n<ul><li>A tax incentive for companies employing workers aged over 50 who have been unemployed for more than 12 months. Employers benefit from a 50 % tax reduction both for fixed-term contracts (the reduction lasts 12 months) and open-ended contracts (the reduction lasts 18 months).</li>\nli>	The restructuring of employment agencies’ activities in order to provide support for workers aged over 50. Agencies provide a specific placement service (matching demand and supply and offering consultancy and training) designed for people who are struggling to find work.</li></ul>',NULL,2012,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(535,'Generation Handover','IT','This project involved the introduction of a new employment scheme that guarantees placements for young people and, at the same time, the retention of mature workers within the same company. The scheme encourages employers to take on young people as trainees and/or on an open-ended contract, while offering a conversion of their contracts from full-time to part-time to older workers in the same company. Older workers are encouraged to voluntarily accept the change in contract because they will still be guaranteed (between a minimum of 12 months and a maximum of 36 months) full payment of social security contributions.','This project involved the introduction of a new employment scheme that guarantees placements for young people and, at the same time, the retention of mature workers within the same company. The scheme encourages employers to take on young people as trainees and/or on an open-ended contract, while offering a conversion of their contracts from full-time to part-time to older workers in the same company. Older workers are encouraged to voluntarily accept the change in contract because they will still be guaranteed (between a minimum of 12 months and a maximum of 36 months) full payment of social security contributions.','http://www.italialavoro.it/wps/portal/w2w',2012,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(536,'Framework Agreement concerning Support to Workers Who Have Suffered Injuries or Occupational Diseases','IT','This agreement between INAIL (the National Institute for Insurance against Accidents at Work), the regions and the autonomous provinces sets a general framework under which local and national authorities, together with INAIL, are to adopt and implement cooperation agreements aimed at achieving full synergy and coordination of services for the prevention of accidents at work and the rehabilitation and social reintegration of workers who have suffered injuries or experienced illness. On this basis, agreements and conventions have already been signed between INAIL and some regions; these agreements, in addition to addressing the abovementioned issues, provide for the possibility of starting scientific research and training programmes on prosthetic technological developments, social reintegration pathways, programmes promoting physical activity for people with disabilities, etc.','This agreement between INAIL (the National Institute for Insurance against Accidents at Work), the regions and the autonomous provinces sets a general framework under which local and national authorities, together with INAIL, are to adopt and implement cooperation agreements aimed at achieving full synergy and coordination of services for the prevention of accidents at work and the rehabilitation and social reintegration of workers who have suffered injuries or experienced illness. On this basis, agreements and conventions have already been signed between INAIL and some regions; these agreements, in addition to addressing the abovementioned issues, provide for the possibility of starting scientific research and training programmes on prosthetic technological developments, social reintegration pathways, programmes promoting physical activity for people with disabilities, etc.',NULL,2012,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(537,'Taking Charge (Presa in Carico)','IT','The initiative involves the preparation, implementation and monitoring of a rehabilitation programme, led by multidisciplinary teams who work together to create ad hoc rehabilitation programmes for injured workers, covering prosthetics assistance, rehabilitation, and reintegration into social relationships. These teams operate in the national and regional INAIL offices and usually include a medical director, a social worker and an administrative officer, together with other consultants called on on a case-by-case basis. The multidisciplinary teams offer the injured worker an integrated service of a medical, rehabilitative, administrative and social nature, which takes into account the specific needs of the individual. The Regulation for the Granting of Technical Instruments and Supporting Actions for the Physical and Social Rehabilitation of Workers represents the main basis for the implementation of activities under the Taking Charge initiative. The initiative provides for the involvement of the worker’s family in the rehabilitation process.','The initiative involves the preparation, implementation and monitoring of a rehabilitation programme, led by multidisciplinary teams who work together to create ad hoc rehabilitation programmes for injured workers, covering prosthetics assistance, rehabilitation, and reintegration into social relationships. These teams operate in the national and regional INAIL offices and usually include a medical director, a social worker and an administrative officer, together with other consultants called on on a case-by-case basis. The multidisciplinary teams offer the injured worker an integrated service of a medical, rehabilitative, administrative and social nature, which takes into account the specific needs of the individual. The Regulation for the Granting of Technical Instruments and Supporting Actions for the Physical and Social Rehabilitation of Workers represents the main basis for the implementation of activities under the Taking Charge initiative. The initiative provides for the involvement of the worker’s family in the rehabilitation process.',NULL,NULL,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(538,'Spanish Strategy for Occupational Safety and Health 2015-2020','ES','The strategy emphasises the importance of risk prevention, including with regard to risks that result from societal factors, such as the ageing of the working population. One of the objectives is to encourage a continuous improvement of working conditions for all workers equally, focusing in particular on the prevention of occupational diseases and work-related ill health. For the implementation of these objectives, three action plans will be developed.','The strategy emphasises the importance of risk prevention, including with regard to risks that result from societal factors, such as the ageing of the working population. One of the objectives is to encourage a continuous improvement of working conditions for all workers equally, focusing in particular on the prevention of occupational diseases and work-related ill health. For the implementation of these objectives, three action plans will be developed.','http://www.uso.es/wp-content/uploads/2015/04/Estrategia_Espanola_de_Seguridad_y_Salud_en_el_Trabajo_2015-2020.pdf',2015,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(539,'General Strategy for the Employment of Older Workers, or Strategy 55+','ES','This strategy established the general framework of policies dedicated to promoting employment for older workers, considered to be those who are 55 or over. One aspect of the strategy relates to working conditions and OSH. Its four main objectives are:\n<ul>\n <li>improving access to employment for older workers and reducing the unemployment rate in this group;</li>\n <li>retaining older workers longer in the active population;</li>\n <li>improving working conditions, focusing especially on OSH;</li>\n<li>promoting adequate return to work after unemployment.</li>\n</ul>\n\nThe strategy establishes general guidelines for future actions and measures.','This strategy established the general framework of policies dedicated to promoting employment for older workers, considered to be those who are 55 or over. One aspect of the strategy relates to working conditions and OSH. Its four main objectives are:\n<ul>\n <li>improving access to employment for older workers and reducing the unemployment rate in this group;</li>\n <li>retaining older workers longer in the active population;</li>\n <li>improving working conditions, focusing especially on OSH;</li>\n<li>promoting adequate return to work after unemployment.</li>\n</ul>\n\nThe strategy establishes general guidelines for future actions and measures.','http://www.empleo.gob.es/uafse/es/anyo_eu/Estrategia55Ymas.pdf',2012,'1','1','0','OSH','1','Measures to retain experienced workers at ISS Facility Services',NULL,'1','1','0'),(540,'National Health System (SNS) or the mutual insurance company ','ES','In case of accident or illness, the <strong>National Health System (SNS)</strong> or the <strong>mutual insurance company</strong> are responsible for recognising and assessing any potential temporary incapacity to work. When the accident or illness is work-related, this is done by the physicians of the mutual insurance company (or the INSS); when it is not work-related, it is done by the SNS (general practitioner). In 2004, a new department at the INSS was created in order to better monitor and ultimately reduce absence rates. It developed a new monitoring tool providing the complete and up-to-date histories of sickness absence of individuals and offering the possibility of monitoring specific cases when sickness absence is longer than expected. In addition, absence control is now put in place when the duration of sick leave is longer than six months.','In case of accident or illness, the <strong>National Health System (SNS)</strong> or the <strong>mutual insurance company</strong> are responsible for recognising and assessing any potential temporary incapacity to work. When the accident or illness is work-related, this is done by the physicians of the mutual insurance company (or the INSS); when it is not work-related, it is done by the SNS (general practitioner). In 2004, a new department at the INSS was created in order to better monitor and ultimately reduce absence rates. It developed a new monitoring tool providing the complete and up-to-date histories of sickness absence of individuals and offering the possibility of monitoring specific cases when sickness absence is longer than expected. In addition, absence control is now put in place when the duration of sick leave is longer than six months.',NULL,NULL,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(541,'Study on early intervention for musculoskeletal disorders (MSDs)','ES','A study on early intervention for musculoskeletal disorders (MSDs) in Spain, completed for the organisation Fit to Work Europe in 2010, showed that, although employers are required to make ‘reasonable accommodation’ to support employees with long-term illness or injury, most line managers find job redesign difficult, irritating and disruptive. There appears to be little external support to help them do this and, apart from limited pilot studies carried out in 2005 and 2009, there seems to have been little focus on promoting early return to work through medical and other interventions.','A study on early intervention for musculoskeletal disorders (MSDs) in Spain, completed for the organisation Fit to Work Europe in 2010, showed that, although employers are required to make ‘reasonable accommodation’ to support employees with long-term illness or injury, most line managers find job redesign difficult, irritating and disruptive. There appears to be little external support to help them do this and, apart from limited pilot studies carried out in 2005 and 2009, there seems to have been little focus on promoting early return to work through medical and other interventions.',NULL,NULL,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(542,'Age management in the metal industry','ES','FEMEVAL created a network of age management offices to provide services to its member companies and developed a guide to age management.','FEMEVAL created a network of age management offices to provide services to its member companies and developed a guide to age management.','http://www.femeval.es/proyectos/ProyectosAnteriores/Sinnovaciontecnologia/Documents/Cuadernillo%20Gestion%20Edad%20ES.PDF',21012,'0','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(543,'Early intervention for MSDs','ES','These pilot intervention studies aimed to evaluate whether an early cognitive behavioural treatment, complementing a rheumatological care programme, for patients with recent-onset temporary work disability caused by MSDs was effective. The additional treatment in the second study produced an additional reduction of 20% in temporary work disability episodes.','These pilot intervention studies aimed to evaluate whether an early cognitive behavioural treatment, complementing a rheumatological care programme, for patients with recent-onset temporary work disability caused by MSDs was effective. The additional treatment in the second study produced an additional reduction of 20% in temporary work disability episodes.','http://fr.scribd.com/doc/179540756/Prof-Paul-Emery-and-Dr-Juan-Jover-Fit-for-Work-Europe-Summit-2013-pdf',2005,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(544,'Guide to Age Management in Organisations in Euskadi','ES','This tool includes examples of good practices for age management taken from different companies around the world, explains the characteristics and importance of older workers, and provides recommendations for policies and workplace adaptations. The guide’s aim is to raise awareness about the special needs of older workers in Basque organisations and to promote initiatives and strategies focusing on this group.','This tool includes examples of good practices for age management taken from different companies around the world, explains the characteristics and importance of older workers, and provides recommendations for policies and workplace adaptations. The guide’s aim is to raise awareness about the special needs of older workers in Basque organisations and to promote initiatives and strategies focusing on this group.',NULL,2013,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(545,'Older Workers: Strategies to Promote Work Ability and Motivation to Continue Working (CapLab Study)','ES','The study analysed the factors influencing the work ability and well-being of workers aged 50 or over. It included two pilot projects on improving the working conditions of workers over 50 years old in a school and in a hospital.</br>\n<br>The intervention model proposed in the CapLab Study covers four main areas:</br>\n<ul>\n <li>training </li>\n <li>match between the person and the job </li>\n <li>recognition </li>\n<li>intergenerational relations</li></ul>','The study analysed the factors influencing the work ability and well-being of workers aged 50 or over. It included two pilot projects on improving the working conditions of workers over 50 years old in a school and in a hospital.</br>\n<br>The intervention model proposed in the CapLab Study covers four main areas:</br>\n<ul>\n <li>training </li>\n <li>match between the person and the job </li>\n <li>recognition </li>\n<li>intergenerational relations</li></ul>',NULL,2008,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(546,'National Strategy for Health and Safety at Work','BG','The strategy aims to reduce on-the-job accidents and provide a working environment that is supportive of good health and well-being at work, to allow workers to remain in work until old age and gain personal satisfaction from the work they do. The strategy considers the challenges faced as a result of the ageing of the population and acknowledges that specific measures for improving safety and health at work for both young people and those aged 55-64 years are very important for extending working lives.','The strategy aims to reduce on-the-job accidents and provide a working environment that is supportive of good health and well-being at work, to allow workers to remain in work until old age and gain personal satisfaction from the work they do. The strategy considers the challenges faced as a result of the ageing of the population and acknowledges that specific measures for improving safety and health at work for both young people and those aged 55-64 years are very important for extending working lives.','https://osha.europa.eu/en/organisations/bulgarian-strategy-on-safety-and-health-at-work-shw-2008-2012',2008,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(547,'National Programme on Safety and Health at Work','BG','The aim of the programme is to prevent work-related illnesses, occupational diseases and accidents at work. The underlying concept is to prioritise ‘prevention before rehabilitation and rehabilitation before early exit from labour market’. The programme recognises the challenges associated with an ageing workforce and it promotes a holistic approach to the prevention of occupational risks.','The aim of the programme is to prevent work-related illnesses, occupational diseases and accidents at work. The underlying concept is to prioritise ‘prevention before rehabilitation and rehabilitation before early exit from labour market’. The programme recognises the challenges associated with an ageing workforce and it promotes a holistic approach to the prevention of occupational risks.','http://www.mlsp.government.bg/bg/docs/NP-%D0%91%D0%97%D0%A0-2013-final.doc',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(548,'National Concept for Promotion of Active Ageing','BG','The framework identifies specific areas of action for promoting and prolonging active working lives in good health, including age management policies, adaptation of the working environment to the needs of older employees, overcoming negative attitudes to hiring older workers, etc.','The framework identifies specific areas of action for promoting and prolonging active working lives in good health, including age management policies, adaptation of the working environment to the needs of older employees, overcoming negative attitudes to hiring older workers, etc.','http://www.strategy.bg/PublicConsultations/View.aspx?lang=bg-BG&Id=575',2012,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(549,'Operational Programme Human Resource Development (OP HRD), ','BG','The programme was co-financed by the European Social Fund and the national budget.','The programme was co-financed by the European Social Fund and the national budget.','ophrd.government.bg/view_file.php/3226',2007,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(550,'Innovative measures in the field of occupational rehabilitation, guidance, training and employment for people with disabilities','BG','The project was carried out under the Operational Programme Human Resource Development (see above), which related to workers of all ages. It aimed to improve the labour market situation, promote social inclusion and facilitate the return to work of disabled people through rehabilitation, training and workplace adaptations.','The project was carried out under the Operational Programme Human Resource Development (see above), which related to workers of all ages. It aimed to improve the labour market situation, promote social inclusion and facilitate the return to work of disabled people through rehabilitation, training and workplace adaptations.','http://nfri.bg/documents/Sbornik-s-dobri-praktiki-BG-01-14.pdf',2012,'1','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(551,'Social Innovation in Enterprises','BG','This scheme targets older employees, looking at the broad context of working conditions. It aims to increase the productivity and adaptability of employees aged 55 and over. It also aims to facilitate the implementation of innovative strategies for human resource development in enterprises, to stimulate on-the-job training and to encourage the introduction of various flexible forms of employment (flexible working time, job rotation, etc.). It includes measures to ensure sustainable employment for persons over 55 years, while using older workers’ expertise by involving them in workplace training and capacity-building of young employees in enterprises. The scheme also supports the improvement of OSH and the building of social welfare facilities (canteens, facilities for childcare, rest rooms) in companies.','This scheme targets older employees, looking at the broad context of working conditions. It aims to increase the productivity and adaptability of employees aged 55 and over. It also aims to facilitate the implementation of innovative strategies for human resource development in enterprises, to stimulate on-the-job training and to encourage the introduction of various flexible forms of employment (flexible working time, job rotation, etc.). It includes measures to ensure sustainable employment for persons over 55 years, while using older workers’ expertise by involving them in workplace training and capacity-building of young employees in enterprises. The scheme also supports the improvement of OSH and the building of social welfare facilities (canteens, facilities for childcare, rest rooms) in companies.',NULL,2011,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(552,'National Strategy for Health and Safety at Work 2015-2020','PT','One of the strategic objectives of this strategy is to promote the quality of working life and the competitiveness of companies, with a particular focus on the promotion of:<ul>\n <li>a culture of prevention; </li>\n <li>consultation and active participation of workers in the process of improving work organisation; </li>\n <li>the adoption of measures to improve well-being at work, adapting work to the individual and ensuring its compatibility with family life; </li>\n<li>workers’ physical and mental health; </li>\n<li>health monitoring.</li></ul>','One of the strategic objectives of this strategy is to promote the quality of working life and the competitiveness of companies, with a particular focus on the promotion of:<ul>\n <li>a culture of prevention; </li>\n <li>consultation and active participation of workers in the process of improving work organisation; </li>\n <li>the adoption of measures to improve well-being at work, adapting work to the individual and ensuring its compatibility with family life; </li>\n<li>workers’ physical and mental health; </li>\n<li>health monitoring.</li></ul>',NULL,2015,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(553,'National Plan of Occupational Health 2013-2017','PT','The plan considers older workers as one of the most vulnerable groups of workers, stating that particular attention must be paid to these groups. Risk factors and health problems (in particular mental health problems and musculoskeletal diseases) that are related to ageing in the work context are considered a priority area for research.','The plan considers older workers as one of the most vulnerable groups of workers, stating that particular attention must be paid to these groups. Risk factors and health problems (in particular mental health problems and musculoskeletal diseases) that are related to ageing in the work context are considered a priority area for research.','http://www.dgs.pt/saude-ocupacional/programa-nacional/pnsoc-2013-2017.aspx',2007,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(554,'National Strategy for Active Ageing','PT','The Strategy defined three priorities: to stimulate the participation of older workers in the labour market, to value and promote the skills of older workers, and to prevent and tackle the unemployment of older workers. It has not yet been converted into a comprehensive policy programme.','The Strategy defined three priorities: to stimulate the participation of older workers in the labour market, to value and promote the skills of older workers, and to prevent and tackle the unemployment of older workers. It has not yet been converted into a comprehensive policy programme.','http://www.socialgest.pt/_dlds/ENEA_Estrategia_Nacional_Envelhecimento_Activo.pdf',2007,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(555,'National Health Plan 2012-2016','PT','The Plan recognises the need for acomprehensive health plan. One of its goals is to promote ‘supportive environments for health throughout the life cycle’, which involves the maintenance of health through risk prevention, treatment and rehabilitation. It recommends the integration of efforts between different fields (e.g. public health and employment). The tools promoted in the Plan include health promotion in workplaces and the life-cycle approach, including early diagnosis and intervention.','The Plan recognises the need for acomprehensive health plan. One of its goals is to promote ‘supportive environments for health throughout the life cycle’, which involves the maintenance of health through risk prevention, treatment and rehabilitation. It recommends the integration of efforts between different fields (e.g. public health and employment). The tools promoted in the Plan include health promotion in workplaces and the life-cycle approach, including early diagnosis and intervention.',NULL,2012,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(556,'Programme for Employment and Support for the Qualification of Persons with Disabilities and Incapacities','PT','This programme integrates four different types of initiatives to support persons with disabilities and incapacities —<em>including those related to work accidents and occupational diseases</em>  — facing problems in accessing employment, remaining in employment (including reintegration) and progressing in employment.</br>\n<br>Most of the support focuses on fostering professional skills and qualification, but it also includes:</br>\n<ul>\n <li>mediation between workers and employers to facilitate the adaptation of workplace, the creation of accessibilities (through financing) and the reorganisation of work;</li>\n <li>guidance for the worker after he or she has started his or her job or has returned to work, to facilitate his or her integration in the working environment and to encourage the development of social and personal skills;</li>\n <li>financial support for adapting the workplace and eliminating architectural barriers.</li></ul>','This programme integrates four different types of initiatives to support persons with disabilities and incapacities —<em>including those related to work accidents and occupational diseases</em>  — facing problems in accessing employment, remaining in employment (including reintegration) and progressing in employment.</br>\n<br>Most of the support focuses on fostering professional skills and qualification, but it also includes:</br>\n<ul>\n <li>mediation between workers and employers to facilitate the adaptation of workplace, the creation of accessibilities (through financing) and the reorganisation of work;</li>\n <li>guidance for the worker after he or she has started his or her job or has returned to work, to facilitate his or her integration in the working environment and to encourage the development of social and personal skills;</li>\n <li>financial support for adapting the workplace and eliminating architectural barriers.</li></ul>','https://www.iefp.pt/documents/10181/190733/Ficha+S%C3%ADntese+Programa+de+Apoio+ao+Emprego+e+%C3%A0%20Qualifica%C3%A7%C3%A3o+das+Pessoas+com+Defici%C3%AAncia+e+Incapacidade/2be1ec8c-ea87-41df-8c13-7b05136d3287',2009,'1','0','1','RTW','1',NULL,NULL,'1','0','0'),(391,'The Law on the Generation Contract (‘Contrat de génération’) 2013 ','FR','This law introduced new obligations for large companies  to negotiate with social partners on company agreements implementing the Generation Contract.','This law introduced new obligations for large companies  to negotiate with social partners on company agreements implementing the Generation Contract.',NULL,2013,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(392,'The Fund for the Improvement of Working Conditions ','FR','Managed by ANACT, finances companies employing fewer than 250 workers or sectoral organisations, to help them set up projects addressing musculoskeletal disorders, psychosocial risks, the evaluation of occupational risks and the employment of older workers, with a focus on strenuous working conditions.','Managed by ANACT, finances companies employing fewer than 250 workers or sectoral organisations, to help them set up projects addressing musculoskeletal disorders, psychosocial risks, the evaluation of occupational risks and the employment of older workers, with a focus on strenuous working conditions.','http://www.anact.fr/file/4667/download?token=ndhXCT9R',NULL,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(393,'Fonds paritaire de sécurisation des parcours professionnels’','FR','Created by the national cross-industry agreement of January 2009 on vocational guidance and lifelong learning, contributes to the funding of vocational training and re-training of workers and unemployed workers. Part of this funding shall be used to prevent strenuous working conditions and support workers that are exposed to arduous working conditions, in order to increase its impact on the employment of older workers.','Created by the national cross-industry agreement of January 2009 on vocational guidance and lifelong learning, contributes to the funding of vocational training and re-training of workers and unemployed workers. Part of this funding shall be used to prevent strenuous working conditions and support workers that are exposed to arduous working conditions, in order to increase its impact on the employment of older workers.',NULL,2009,'0','1','0','OSH','0',NULL,NULL,'0','1','0'),(394,'Labour Code ','FR','The Labour Code is the main legislation regulating all aspects relevant to the rehabilitation/return to work of workers:\n<ul> <li>It covers procedures for reinstatement visits and the roles of the employer, the occupational physician and the employee in the return-to-work. </li>\n <li>It regulates reclassification procedures </li>\n <li>It sets out the duty of employers to ensure that employees maintain their ability to work by adapting the work environment and work stations.</li></ul>','The Labour Code is the main legislation regulating all aspects relevant to the rehabilitation/return to work of workers:\n<ul> <li>It covers procedures for reinstatement visits and the roles of the employer, the occupational physician and the employee in the return-to-work. </li>\n <li>It regulates reclassification procedures </li>\n <li>It sets out the duty of employers to ensure that employees maintain their ability to work by adapting the work environment and work stations.</li></ul>',NULL,2009,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(395,'3rd annual report of the Societal Cancer Observatory ','FR','The report presents the results of the Observatory’s research on return to work after a cancer. The research describes cancer patients’ pathway and the obstacles that prevent them from staying at or returning to work. The report underlines the communication problems inside companies, as the occupational physician is rarely approached by employees, and the limited use of the pre-reinstatement visit that could be an important step to recreate the link with the work environment and to define the necessary changes before the employee returns to work.</br>','The report presents the results of the Observatory’s research on return to work after a cancer. The research describes cancer patients’ pathway and the obstacles that prevent them from staying at or returning to work. The report underlines the communication problems inside companies, as the occupational physician is rarely approached by employees, and the limited use of the pre-reinstatement visit that could be an important step to recreate the link with the work environment and to define the necessary changes before the employee returns to work.</br>',NULL,2014,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(396,'Guidance on “Return to work after cancer”','FR','The guidance targets cancer patients who want to return to work, occupational health specialists, HR managers and any other relevant actor in the return to work process.</br>','The guidance targets cancer patients who want to return to work, occupational health specialists, HR managers and any other relevant actor in the return to work process.</br>','http://www.fondation-arc.org/Les-brochures/le-retour-au-travail-apres-un-cancer.html',2014,'0','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(397,'A Socially Sustainable Finland for 2020','FI','This strategy focuses on the following: health and well-being should be included in all decision-making, working careers should be lengthened by increased workplace well-being, different aspects of life should be better balanced and social security funding should be made more sustainable. This strategy is linked to the National Working Life Development Strategy to 2020.','This strategy focuses on the following: health and well-being should be included in all decision-making, working careers should be lengthened by increased workplace well-being, different aspects of life should be better balanced and social security funding should be made more sustainable. This strategy is linked to the National Working Life Development Strategy to 2020.','http://www.stm.fi/c/document_library/get_file?folderId=39503&name=DLFE-14357.pdf',2010,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(398,'Policies for the work environment and well-being at work until 2020','FI','This policy specifies the Strategy for Socially Sustainable Finland 2020 as regards occupational safety and health, in particular the work environment and well-being at work. It sets the key objectives and defines the actions to reach these objectives. The target is defined as prolonging working lives by 3 years by 2020.</br>\n<br>Measures include improving leadership as an important factor for well-being at work, promoting work ability, monitoring sickness absence and supporting return to work. The policy also emphasises prevention and focuses on remaining work ability rather than incapacity.</br>','This policy specifies the Strategy for Socially Sustainable Finland 2020 as regards occupational safety and health, in particular the work environment and well-being at work. It sets the key objectives and defines the actions to reach these objectives. The target is defined as prolonging working lives by 3 years by 2020.</br>\n<br>Measures include improving leadership as an important factor for well-being at work, promoting work ability, monitoring sickness absence and supporting return to work. The policy also emphasises prevention and focuses on remaining work ability rather than incapacity.</br>',NULL,2011,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(399,'National Working Life Development Strategy to 2020','FI','This strategy was developed in a tripartite collaboration led by the Ministry of Employment and the Economy; its aim is to create well-functioning, profitable workplaces that generate new employment. Some of the focus areas include health and well-being at work and continuous competence development.','This strategy was developed in a tripartite collaboration led by the Ministry of Employment and the Economy; its aim is to create well-functioning, profitable workplaces that generate new employment. Some of the focus areas include health and well-being at work and continuous competence development.',NULL,2012,'1','1','0','OSH','0',NULL,NULL,'0','1','0'),(400,'Forum for Well-being at Work','FI','This is a network of stakeholders working together to support projects and programmes for promoting cooperation and sharing of good practices between companies, increasing the availability and visibility of networks and services for well-being at work, awarding successful well-being at work practices and disseminating information on well-being at work. The Minister of Social Affairs and Health directs the Forum for Well-being at Work.</br>\r\n\r\n<br>In 2011 and 2012, the labour market confederations adopted a Policy Framework Agreement that aimed to extend working careers and led to several initiatives, including:\r\n<ul><li>Collective agreement between the Federation of Finnish Technology Industries, the Metalworkers’ Union, the Federation of Professional and Managerial Staff YTN, the Trade Union Pro and Union of Professional Engineers in Finland. Based on this agreement, the Federation of Finnish Technology Industries (Teknologiateollisuus) has developed a programme called ‘Good Work – Longer Career’ (‘Hyvä työ – pidempi työura’) (2010-2015). In 2011, during the pilot phase of the project, 19 technology companies participated. Between 2012 and 2013, the programme aimed to include a further 100 companies. The programme, which is part of the broader Working Life 2020 Programme, aimed to create tools to improve age management at workplaces, such as <strong>Towards Longer Careers – a Guide to Preparing an Age Programme for Workplaces.</strong></li></ul>','This is a network of stakeholders working together to support projects and programmes for promoting cooperation and sharing of good practices between companies, increasing the availability and visibility of networks and services for well-being at work, awarding successful well-being at work practices and disseminating information on well-being at work. The Minister of Social Affairs and Health directs the Forum for Well-being at Work.</br>\r\n\r\n<br>In 2011 and 2012, the labour market confederations adopted a Policy Framework Agreement that aimed to extend working careers and led to several initiatives, including:\r\n<ul><li>Collective agreement between the Federation of Finnish Technology Industries, the Metalworkers’ Union, the Federation of Professional and Managerial Staff YTN, the Trade Union Pro and Union of Professional Engineers in Finland. Based on this agreement, the Federation of Finnish Technology Industries (Teknologiateollisuus) has developed a programme called ‘Good Work – Longer Career’ (‘Hyvä työ – pidempi työura’) (2010-2015). In 2011, during the pilot phase of the project, 19 technology companies participated. Between 2012 and 2013, the programme aimed to include a further 100 companies. The programme, which is part of the broader Working Life 2020 Programme, aimed to create tools to improve age management at workplaces, such as <strong>Towards Longer Careers – a Guide to Preparing an Age Programme for Workplaces.</strong></li></ul>','http://www.ttl.fi/partner/thf/Sivut/default.aspx',NULL,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(401,'‘Development Programme for Rehabilitation 2015’ by Social Insurance Institution of Finland  (KELA –  Kansaneläkelaitos)','FI','This programme has four main targets for improving rehabilitation services by 2015: \n<ul>\n <ol>\n <li>to ensure that individual rehabilitation processes are functional and produce results,</li>\n <li>to strengthen KELA’s role as the national provider and developer of rehabilitation services,</li>\n <li>to improve the flexibility, efficiency and customer focus of the procurement process for rehabilitation services,</li>\n<li>to develop a reporting system to inform the development of rehabilitation services and to monitor the effectiveness of the provided rehabilitation services.</li>\n</ol>\n\n</ul>\nThe Development Programme goes further to describe specific actions that are planned in order to achieve the set targets.','This programme has four main targets for improving rehabilitation services by 2015: \n<ul>\n <ol>\n <li>to ensure that individual rehabilitation processes are functional and produce results,</li>\n <li>to strengthen KELA’s role as the national provider and developer of rehabilitation services,</li>\n <li>to improve the flexibility, efficiency and customer focus of the procurement process for rehabilitation services,</li>\n<li>to develop a reporting system to inform the development of rehabilitation services and to monitor the effectiveness of the provided rehabilitation services.</li>\n</ol>\n\n</ul>\nThe Development Programme goes further to describe specific actions that are planned in order to achieve the set targets.',NULL,2015,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(402,'Action plan to promote the employment of persons who have partial incapacity/disability ','FI','The working group looked into the factors that prevent partially incapacitated persons from gaining or maintaining employment, disseminated information relating to best practices and prepared a communication programme that would make it easier for people with disabilities to gain employment.','The working group looked into the factors that prevent partially incapacitated persons from gaining or maintaining employment, disseminated information relating to best practices and prepared a communication programme that would make it easier for people with disabilities to gain employment.',NULL,2012,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(403,'Good Work Ability ','FI','A model for promoting work ability’ Varma Mutual Pension Insurance Company, 2011. This is a guide for companies to promote work ability. The model involves identifying problems related to work ability at an early stage and, among other things, supporting the return to work of employees who have been on prolonged sick leave.','A model for promoting work ability’ Varma Mutual Pension Insurance Company, 2011. This is a guide for companies to promote work ability. The model involves identifying problems related to work ability at an early stage and, among other things, supporting the return to work of employees who have been on prolonged sick leave.','https://www.varma.fi/fi/PdfDocuments/Anonymous/Julkaisut/tyohyvinvointi/HyvaTyokykyMalli.PDF',2011,'0','0','0','Others','0',NULL,NULL,'1','0','1'),(404,'Joint German Occupational Safety and Health Strategy (Gemeinsame Deutsche Arbeitsschutzstrategie, GDA)','DE','The objective of this strategy is to preserve, improve and promote the safety and health of workers of all ages – supplemented by measures of workplace health promotion – and to develop user-friendly, transparent and harmonised sets of rules and regulations. The strategy was agreed by the Federal Government, the Federal States and the Public Accident Insurance Institutions in 2007 during the 84th Labour and Social Affairs Ministers’ Conference of the Federal States (ASMK). The GDA requires that the three parties agree on joint objectives in the area of OSH, priority fields of action, cornerstones for work programmes and uniform principles for the implementation of activities.</br>\n \n<br>For the years 2013-2018, the GDA focused its activities on three specified objectives:\n<ol>\n <li>improvement in the organisation of company occupational safety and health,</li>\n <li> reduction in work-related health hazards and musculoskeletal disorders,</li>\n <li>protection and strengthening of health in the case of work-related mental load.</li>\n</ol>\nMost of the activities focus on demographic change and an ageing workforce.</br>','The objective of this strategy is to preserve, improve and promote the safety and health of workers of all ages – supplemented by measures of workplace health promotion – and to develop user-friendly, transparent and harmonised sets of rules and regulations. The strategy was agreed by the Federal Government, the Federal States and the Public Accident Insurance Institutions in 2007 during the 84th Labour and Social Affairs Ministers’ Conference of the Federal States (ASMK). The GDA requires that the three parties agree on joint objectives in the area of OSH, priority fields of action, cornerstones for work programmes and uniform principles for the implementation of activities.</br>\n \n<br>For the years 2013-2018, the GDA focused its activities on three specified objectives:\n<ol>\n <li>improvement in the organisation of company occupational safety and health,</li>\n <li> reduction in work-related health hazards and musculoskeletal disorders,</li>\n <li>protection and strengthening of health in the case of work-related mental load.</li>\n</ol>\nMost of the activities focus on demographic change and an ageing workforce.</br>','http://www.gda-portal.de/de/Arbeitsprogramme2013-2018/Arbeitsprogramme2013-2018.html',2007,'1','1','0','OSH','1','Audi voluntary medical check-ups',NULL,'1','0','0'),(405,'Initiative New Quality of Work (INQA)','DE','The aim of this initiative is to improve the quality of work in ways that benefit companies and employees. Founded in 2002 by the Federal Ministry of Labour and Social Affairs (BMAS) and leading social partners, today the initiative represents a non-partisan alliance, which includes federal and state-level government, business associations, trade unions, the Federal Employment Agency, companies, social insuranceproviders and foundations. The networks of partners include the following organisations:\n<ul> <li>Demography Network (Das Demographie Netzwerk, ddn)</li>\n <li>Demography Experts (Demografie-Experten)</li>\n<li> Network for Competences in SMEs (Netzwerk KMU-Kompetenz)</li>\n<li> Campaign for SMEs — Good for Germany (Offensive Mittelstand — Gut für Deutschland)</li>\n<li>Work Ability Index Network (Work Ability Index (WAI)-Netzwerk).</li> </ul>','The aim of this initiative is to improve the quality of work in ways that benefit companies and employees. Founded in 2002 by the Federal Ministry of Labour and Social Affairs (BMAS) and leading social partners, today the initiative represents a non-partisan alliance, which includes federal and state-level government, business associations, trade unions, the Federal Employment Agency, companies, social insuranceproviders and foundations. The networks of partners include the following organisations:\n<ul> <li>Demography Network (Das Demographie Netzwerk, ddn)</li>\n <li>Demography Experts (Demografie-Experten)</li>\n<li> Network for Competences in SMEs (Netzwerk KMU-Kompetenz)</li>\n<li> Campaign for SMEs — Good for Germany (Offensive Mittelstand — Gut für Deutschland)</li>\n<li>Work Ability Index Network (Work Ability Index (WAI)-Netzwerk).</li> </ul>','http://www.inqa.de/DE/Startseite/start.html',2002,'1','1','0','OSH','1',NULL,NULL,'1','1','1'),(406,'Demography strategy','DE','Demography strategy of the Federal Government, ‘Every Age Counts’ (2012), focuses on sustainable growth and prosperity. It covers several policy areas relevant for demographic change, including employment, working conditions and vocational education. Among others, it sets measures for:\n<ul> <li> keeping workers motivated, skilled and healthy;</li>\n<li>maintaining and encouraging good health at work, avoiding or minimising risks;</li>\n<li> enhancing skills and increasing training;</li>\n<li> promoting a culture of longer working lives.</li> </ul>','Demography strategy of the Federal Government, ‘Every Age Counts’ (2012), focuses on sustainable growth and prosperity. It covers several policy areas relevant for demographic change, including employment, working conditions and vocational education. Among others, it sets measures for:\n<ul> <li> keeping workers motivated, skilled and healthy;</li>\n<li>maintaining and encouraging good health at work, avoiding or minimising risks;</li>\n<li> enhancing skills and increasing training;</li>\n<li> promoting a culture of longer working lives.</li> </ul>','https://www.bmi.bund.de/SharedDocs/Downloads/DE/Broschueren/2012/demografiestrategie.pdf?__blob=publicationFile',2012,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(407,'Further training of low-skilled workers and older employees in employment (2012-2015)','DE','This was a lifelong learning programme of the Federal Employment Agency to further train low-skilled workers and older employees.','This was a lifelong learning programme of the Federal Employment Agency to further train low-skilled workers and older employees.','https://www.arbeitsagentur.de/web/content/DE/dienststellen/rdn/badoldesloe/Agentur/Unternehmen/Geldleistungen/Detail/index.htm?dfContentId=L6019022DSTBAI508980',2006,'1','1','0','OSH','0','“INTEGRATIONSPROJEKT REHAFUTURREAL®” – REHABILITATION BY THE WESTPHALIAN PENSION INSURANCE SCHEME',NULL,'0','1','0'),(408,'Working life and demography','DE','Collective Agreement <b>‘Working life and demography’</b> in the chemistry, energy and mining sectors (2015); this agreement focuses on compiling an analysis of demographic aspects for each company, developing health- and age-appropriate work designs and organisation, lifelong learning, and providing instruments to facilitate the transition between phases of training, working and retirement.','Collective Agreement <b>‘Working life and demography’</b> in the chemistry, energy and mining sectors (2015); this agreement focuses on compiling an analysis of demographic aspects for each company, developing health- and age-appropriate work designs and organisation, lifelong learning, and providing instruments to facilitate the transition between phases of training, working and retirement.','http://durchschaubare.de/pdf/TarifvertragLebensarbeitszeitundDemografie.pdf',2008,'0','1','0','OSH','0',NULL,NULL,'0','1','0'),(409,'Initiative for Health and Work','DE','This is a combined activity of health and accident insurance focusing, among other things, on changes in the world of work (established in 2002).','This is a combined activity of health and accident insurance focusing, among other things, on changes in the world of work (established in 2002).','http://www.iga-info.de/',2002,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(410,'Predemo (2012-2015)','DE','This project promotes the innovative capacity of small and micro enterprises through preventive, demographic-oriented work design (2012-2015).','This project promotes the innovative capacity of small and micro enterprises through preventive, demographic-oriented work design (2012-2015).','https://www.vdsi.de/files/1534/10353/1/wcoi4f7c66ed3bf36.pdf\n',2015,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(411,'Rehabilitation is regulated in the Social Security Code (SGB)','DE','Since 2004, the SGB (Section 84(2) of Book IX of the social Code (SGB IX)) has required employers to provide workplace integration management (Betriebliches Eingliederungsmanagement, BEM) for all employees who become unfit for work for more than 6 consecutive weeks or on a recurrent basis in a given year, whether the reason is work related or not. This means that employers must assess how an employee\'s inability to work can best be overcome and must identify the type of assistance or support needed to prevent recurrence so that the position can be retained and employability maintained. Section 84(2) of SGB IX intentionally does not prescribe in detail how this is to be done. An appropriate solution must be found at each workplace to meet individual needs.','Since 2004, the SGB (Section 84(2) of Book IX of the social Code (SGB IX)) has required employers to provide workplace integration management (Betriebliches Eingliederungsmanagement, BEM) for all employees who become unfit for work for more than 6 consecutive weeks or on a recurrent basis in a given year, whether the reason is work related or not. This means that employers must assess how an employee\'s inability to work can best be overcome and must identify the type of assistance or support needed to prevent recurrence so that the position can be retained and employability maintained. Section 84(2) of SGB IX intentionally does not prescribe in detail how this is to be done. An appropriate solution must be found at each workplace to meet individual needs.',NULL,2004,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(412,'RehBau – Rehabilitation in the building sector (accident insurance for the construction sector)','DE','Since 2000, rehabilitation has included job-related training. Upon approval by company physicians, employees take part in inpatient rehabilitation for 3 weeks. This rehabilitation includes job-related training (e.g. lifting and carrying weights) and the ergonomic organisation of the workplace.','Since 2000, rehabilitation has included job-related training. Upon approval by company physicians, employees take part in inpatient rehabilitation for 3 weeks. This rehabilitation includes job-related training (e.g. lifting and carrying weights) and the ergonomic organisation of the workplace.','http://www.bgbau.de/ergonomie-bau/programme/reha-bau',2000,'0','0','1','RTW','0',NULL,NULL,'0','0','1'),(413,'A Work Environment Strategy for Modern Working Life 2016-2020','SE','The strategy for modern working life was drawn up in consultation with social partners. The aim of the government’s work environment policy is for more people to work longer and not be excluded from working life prematurely as a result of physical, social or organisational aspects of the work environment. Work environment management must take into account people’s differing circumstances and contribute to the development of both individuals and operations. The strategy sets out concrete measures within prioritised areas, including:</br>\n<ul><li>a sustainable working life; and</li>\n <li>the psychosocial work environment.</li></ul>\n\nWorking conditions must also allow those with health problems or disabilities to participate in working life. A good work environment may also contribute to more people whose work capacity is impaired because of disability or ill health being able to remain in work or begin working again. Continued efforts must be made to improve the work environment in mentally and physically taxing jobs. Factors that have an impact on early exit from the labour market are often established early in working life. Preventive efforts need to be strengthened so that workers are able to get support when health problems related to work first emerge.</br>\n<br>The strategy emphasises the role of social dialogue for achieving its goals.</br>','The strategy for modern working life was drawn up in consultation with social partners. The aim of the government’s work environment policy is for more people to work longer and not be excluded from working life prematurely as a result of physical, social or organisational aspects of the work environment. Work environment management must take into account people’s differing circumstances and contribute to the development of both individuals and operations. The strategy sets out concrete measures within prioritised areas, including:</br>\n<ul><li>a sustainable working life; and</li>\n <li>the psychosocial work environment.</li></ul>\n\nWorking conditions must also allow those with health problems or disabilities to participate in working life. A good work environment may also contribute to more people whose work capacity is impaired because of disability or ill health being able to remain in work or begin working again. Continued efforts must be made to improve the work environment in mentally and physically taxing jobs. Factors that have an impact on early exit from the labour market are often established early in working life. Preventive efforts need to be strengthened so that workers are able to get support when health problems related to work first emerge.</br>\n<br>The strategy emphasises the role of social dialogue for achieving its goals.</br>','http://www.government.se/contentassets/95678f8dfcea4ece916e5b7950f2260f/a-work-environment-strategy-for-modern-working-life-20162020',2016,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(414,'Organisational and social work environment provisions','SE','The new provisions on the organisational and social work environment, which came into effect in March 2016, regulate knowledge requirements, goals, workloads, working hours and victimisation. The purpose of the provisions is to promote a good work environment and prevent risks of ill health due to organisational and social conditions in the work environment and they complement the provisions on systematic work environment management. The provisions provide a definition of unhealthy workload: ‘When the demands in the work more than temporarily exceed the resources. This imbalance becomes unhealthy if it is prolonged and the opportunities for rest and recovery are insufficient.’','The new provisions on the organisational and social work environment, which came into effect in March 2016, regulate knowledge requirements, goals, workloads, working hours and victimisation. The purpose of the provisions is to promote a good work environment and prevent risks of ill health due to organisational and social conditions in the work environment and they complement the provisions on systematic work environment management. The provisions provide a definition of unhealthy workload: ‘When the demands in the work more than temporarily exceed the resources. This imbalance becomes unhealthy if it is prolonged and the opportunities for rest and recovery are insufficient.’','https://www.av.se/globalassets/filer/publikationer/foreskrifter/engelska/organisational-and-social-work-environment-afs2015-4.pdf',2016,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(415,'Provisions of the Swedish Work Environment Authority on \nSystematic Work Environment Management','SE','In accordance with these regulations, employers are responsible for applying a systematic work environment management (systematiskt arbetsmiljöarbete (SAM)) in the workplace. SAM is a system, in force since 2001, that is designed to ensure that work environment management is an integral part of everyday work. SAM also includes a risk assessment, which requires employers to take account of and investigate psychological and social conditions, as well as issues of a physical nature, with the aim of preventing accidents, illnesses and injuries. SAM is assessed by inspectors from the Work Environment Authority.','In accordance with these regulations, employers are responsible for applying a systematic work environment management (systematiskt arbetsmiljöarbete (SAM)) in the workplace. SAM is a system, in force since 2001, that is designed to ensure that work environment management is an integral part of everyday work. SAM also includes a risk assessment, which requires employers to take account of and investigate psychological and social conditions, as well as issues of a physical nature, with the aim of preventing accidents, illnesses and injuries. SAM is assessed by inspectors from the Work Environment Authority.','https://www.av.se/globalassets/filer/publikationer/foreskrifter/engelska/systematic-work-environment-management-provisions-afs2001-1.pdf',2001,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(416,'National Action Plan for Health and Safety at Work 2010-2015','SE','The action plan focused on risks and possibilities within the work environment, on preventing social exclusion and on raising awareness and knowledge of work environment issues. The aim was to improve the work environment by reducing risks and ensuring that conditions were such that the work environment was able to contribute to health and well-being of workers.</br>\n<br>One of the aims of the action plan was to support the government’s objective of preventing exclusion. Improving working conditions should help bring into work or retain in work those at risk of being excluded from the labour market, including older workers. This should be achieved through adaptation of work to the capacities of the individual.</br>','The action plan focused on risks and possibilities within the work environment, on preventing social exclusion and on raising awareness and knowledge of work environment issues. The aim was to improve the work environment by reducing risks and ensuring that conditions were such that the work environment was able to contribute to health and well-being of workers.</br>\n<br>One of the aims of the action plan was to support the government’s objective of preventing exclusion. Improving working conditions should help bring into work or retain in work those at risk of being excluded from the labour market, including older workers. This should be achieved through adaptation of work to the capacities of the individual.</br>','http://www.regeringen.se/rattsdokument/skrivelse/2010/09/skr.-200910248/',2009,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(417,'Women’s Work Environment 2011-2014','SE','In 2011, the government tasked the Work Environment Authority with focusing its attention on women in the work environment in order to improve women’s health in the workplace and reduce sickness absence, which had been shown to be higher for women than for men. The Work Environment Authority was to take measures with the aim of preventing women from leaving working life prematurely due to work environment-related problems.</br>\n<br>During 2011-2014, the Work Environment Authority gathered and published information, created tools to better assess risks of musculoskeletal disorders, carried out targeted inspections and trained inspectors on the issue, among other actions.</br>','In 2011, the government tasked the Work Environment Authority with focusing its attention on women in the work environment in order to improve women’s health in the workplace and reduce sickness absence, which had been shown to be higher for women than for men. The Work Environment Authority was to take measures with the aim of preventing women from leaving working life prematurely due to work environment-related problems.</br>\n<br>During 2011-2014, the Work Environment Authority gathered and published information, created tools to better assess risks of musculoskeletal disorders, carried out targeted inspections and trained inspectors on the issue, among other actions.</br>',NULL,2011,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(418,'Commission to analyse pension-related age limits and the barriers to and possibilities for a longer working life','SE','In April 2011, the government instructed a commission to analyse the current pension-related age limits as well as the obstacles to and the opportunities for a longer working life. The investigation was introduced in light of a higher life expectancy, which no longer corresponds to working life.</br>\n<br>The overall objectives of the assignment were to analyse whether or not pension-related age limits could be raised and to develop concrete proposals on measures that could enable people to work longer. The assignment included analysing and identifying barriers in relation to, for example, access to adult education, the physical work environment, psychosocial environments, work organisation, working time and opportunities for part-time working, as well as attitudes among both employers and employees that discourage people from working longer. Different methods were used, such as surveys and statistical analysis, and a broad array of experts assisted the commission’s work. The report concluded that several obstacles to older people’s opportunities for a longer working life existed, and that working conditions had to be improved and adapted to older workers’ situations. Governments, employers, social partners and other actors should work together to counter negative attitudes towards older workers.</br>','In April 2011, the government instructed a commission to analyse the current pension-related age limits as well as the obstacles to and the opportunities for a longer working life. The investigation was introduced in light of a higher life expectancy, which no longer corresponds to working life.</br>\n<br>The overall objectives of the assignment were to analyse whether or not pension-related age limits could be raised and to develop concrete proposals on measures that could enable people to work longer. The assignment included analysing and identifying barriers in relation to, for example, access to adult education, the physical work environment, psychosocial environments, work organisation, working time and opportunities for part-time working, as well as attitudes among both employers and employees that discourage people from working longer. Different methods were used, such as surveys and statistical analysis, and a broad array of experts assisted the commission’s work. The report concluded that several obstacles to older people’s opportunities for a longer working life existed, and that working conditions had to be improved and adapted to older workers’ situations. Governments, employers, social partners and other actors should work together to counter negative attitudes towards older workers.</br>',NULL,2011,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(419,'Eleven-point programme for better health in working life, ','SE','This programme focused on measures for a better work environment and clearer employer responsibilities, as well as measures for early return to work after illness. The programme was carried out in close cooperation with social partners.','This programme focused on measures for a better work environment and clearer employer responsibilities, as well as measures for early return to work after illness. The programme was carried out in close cooperation with social partners.',NULL,2001,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(420,'Act on Financial Coordination of Rehabilitation Measures','SE','Since the early 1990s, the Swedish Government has investigated coordination among different authorities in the field of vocational rehabilitation. A series of experiments involving collaboration between institutions in the field of vocational rehabilitation was carried out in the ’90s. The positive outcomes of the collaboration between the different actors resulted in new legislation, the Act on Financial Coordination of Rehabilitation Measures.</br>\n<ul><li>The legislation allows local associations to be formed for financial collaboration.</li>\n <li>Resources for rehabilitation can be pooled in a single budget and allocated for different rehabilitation services.</li></ul>','Since the early 1990s, the Swedish Government has investigated coordination among different authorities in the field of vocational rehabilitation. A series of experiments involving collaboration between institutions in the field of vocational rehabilitation was carried out in the ’90s. The positive outcomes of the collaboration between the different actors resulted in new legislation, the Act on Financial Coordination of Rehabilitation Measures.</br>\n<ul><li>The legislation allows local associations to be formed for financial collaboration.</li>\n <li>Resources for rehabilitation can be pooled in a single budget and allocated for different rehabilitation services.</li></ul>',NULL,2003,'1','0','1','RTW','1',NULL,NULL,'1','0','0'),(421,'Rehabilitation chain','SE','A reform of the occupational sickness insurance system has been carried out in recent years. The biggest change in the sickness insurance rules was the introduction of a rehabilitation chain with fixed time limits specifying when work capacity is to be assessed in accordance with various criteria. The rehabilitation chain establishes precise time limits for assessing work capacity. Sick leave compensation can be received for a maximum period of 2.5 years. People who have been on sick leave for 2.5 years and those who have been receiving temporary sickness compensation are offered active support from the Public Employment Service (PES) to help them back to work. The rehabilitation chain is supported by a rehabilitation guarantee and enhanced occupational health services (introduced in 2008). New methods and instruments for work capacity assessments were developed in 2010.','A reform of the occupational sickness insurance system has been carried out in recent years. The biggest change in the sickness insurance rules was the introduction of a rehabilitation chain with fixed time limits specifying when work capacity is to be assessed in accordance with various criteria. The rehabilitation chain establishes precise time limits for assessing work capacity. Sick leave compensation can be received for a maximum period of 2.5 years. People who have been on sick leave for 2.5 years and those who have been receiving temporary sickness compensation are offered active support from the Public Employment Service (PES) to help them back to work. The rehabilitation chain is supported by a rehabilitation guarantee and enhanced occupational health services (introduced in 2008). New methods and instruments for work capacity assessments were developed in 2010.',NULL,2008,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(422,'Working longer: What do we know about older people in the workplace? ','SE','The report pointed out that more attention should be paid to age-related changes in vision, and to lighting and work with visual display units. The research also highlighted issues such as noise, risk of slipping, physical loads, stress and irregular hours as constraints for older people. The level of awareness of these risks and current measures in the work environment are not in line with technological developments. This is likely to create more uncertainty and result in reduced productivity, and it and prevents people from continuing to work in old age.','The report pointed out that more attention should be paid to age-related changes in vision, and to lighting and work with visual display units. The research also highlighted issues such as noise, risk of slipping, physical loads, stress and irregular hours as constraints for older people. The level of awareness of these risks and current measures in the work environment are not in line with technological developments. This is likely to create more uncertainty and result in reduced productivity, and it and prevents people from continuing to work in old age.','http://www.av.se/dokument/aktuellt/kunskapsoversikt/RAP2012_10.pdf',2012,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(423,'Sustainable Work Organisation','SE','Three dialogue conferences were organised by the SWEA to share and disseminate knowledge about gender diversity in the workplace and the organisation of work in companies to promote sustainable working conditions for all until retirement.','Three dialogue conferences were organised by the SWEA to share and disseminate knowledge about gender diversity in the workplace and the organisation of work in companies to promote sustainable working conditions for all until retirement.','https://www.av.se/en/work-environment-work-and-inspections/work-with-the-work-environment/gender-equality-in-the-work-environment/assignment-to-improve-womens-work-environment/',2014,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(424,'National programme ‘Prevention 2014-2016: Everything is Health’ (EiH)','NL','The programme is a collaboration between six ministries, municipalities, companies and social partners. It has adopted a ‘Whole of Society’ (WoS) approach by engaging societal and business organisations as well as public authorities to achieve of the EiH goals by conducting specific focused activities.</br>\r\n<br>The Programme put a specific emphasis on reducing health inequalities. One of the aims is to stimulate sustainable employability by promoting active health management and knowledge sharing in organisations.\r\nThe action plan ‘Healthy Enterprise’ was launched in 2012 and is a joint initiative between the Ministry of Social \r\nAffairs and Employment and the Ministry of Health, Welfare and Sport. The action plan aims to support \r\nSME’s in creating good working conditions and a healthy workplace.','The programme is a collaboration between six ministries, municipalities, companies and social partners. It has adopted a ‘Whole of Society’ (WoS) approach by engaging societal and business organisations as well as public authorities to achieve of the EiH goals by conducting specific focused activities.</br>\r\n<br>The Programme put a specific emphasis on reducing health inequalities. One of the aims is to stimulate sustainable employability by promoting active health management and knowledge sharing in organisations.\r\nThe action plan ‘Healthy Enterprise’ was launched in 2012 and is a joint initiative between the Ministry of Social \r\nAffairs and Employment and the Ministry of Health, Welfare and Sport. The action plan aims to support \r\nSME’s in creating good working conditions and a healthy workplace.','http://www.arboportaal.nl/externe-bronnen/inhoud/overige-nuttige-links/het-nationaal-programma-preventie-2014---2016',2014,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(425,'Policy memorandum on sustainable employability and the labour market participation of older workers','NL','The memorandum announced the intention of the Dutch cabinet to invest in the productivity, employability and mobility of workers. Three key areas for policy development were identified:\n<ul><li>education and training; </li>\n <li>age-aware human resource management strategies in companies; and</li>\n <li>the development of instruments for preventive interventions.</li></ul>','The memorandum announced the intention of the Dutch cabinet to invest in the productivity, employability and mobility of workers. Three key areas for policy development were identified:\n<ul><li>education and training; </li>\n <li>age-aware human resource management strategies in companies; and</li>\n <li>the development of instruments for preventive interventions.</li></ul>',NULL,2009,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(426,'Initiative on Sustainable Employability (Duurzame Inzetbaarheid)','NL','The goal of this project was to raise awareness and to encourage and support organisations that want to implement measures to keep employees working longer and in a better working environment. Together with 100 organisations, a manifesto was developed, which was the start of a national campaign aimed at employers and workers. Since 2012, a number of activities have been launched under the framework of the Sustainable Employability initiative. The programme was extended in 2014.','The goal of this project was to raise awareness and to encourage and support organisations that want to implement measures to keep employees working longer and in a better working environment. Together with 100 organisations, a manifesto was developed, which was the start of a national campaign aimed at employers and workers. Since 2012, a number of activities have been launched under the framework of the Sustainable Employability initiative. The programme was extended in 2014.','http://www.duurzameinzetbaarheid.nl',2012,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(427,'Strategy plan for 2013-2014, Labour Inspectorate. ','NL','Sustainable employability of (older) workers is one of the strategic goals of this plan. One of the objectives is to reduce sick leave and disability by improving working conditions and addressing health risks, in particular in the construction sector, where employees have heavy physical workloads. It focuses on timely prevention, early intervention and identifying risks at an early stage.','Sustainable employability of (older) workers is one of the strategic goals of this plan. One of the objectives is to reduce sick leave and disability by improving working conditions and addressing health risks, in particular in the construction sector, where employees have heavy physical workloads. It focuses on timely prevention, early intervention and identifying risks at an early stage.','http://www.inspectieszw.nl/',2012,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(428,'Gatekeeper Improvement Act (Wet Verbetering Poortwachter – WVP)','NL','According to the Act, the employer and employee are both responsible for ensuring that the employee returns to work as soon as possible. The Act calls for quick action from employers to reduce absenteeism and occupational disability and to supervise the reintegration of employees. Since 2004, employers are obliged to pay (at least) 70% of an employee’s salary, for a maximum duration of two years, if he/she needs to take time off due to sickness. There are no public funds available to cover these costs, but employers can (partially) insure themselves against them. This creates incentives for employers to use occupational health and safety services and to assure that employees who are on sick leave return to work as soon as possible.','According to the Act, the employer and employee are both responsible for ensuring that the employee returns to work as soon as possible. The Act calls for quick action from employers to reduce absenteeism and occupational disability and to supervise the reintegration of employees. Since 2004, employers are obliged to pay (at least) 70% of an employee’s salary, for a maximum duration of two years, if he/she needs to take time off due to sickness. There are no public funds available to cover these costs, but employers can (partially) insure themselves against them. This creates incentives for employers to use occupational health and safety services and to assure that employees who are on sick leave return to work as soon as possible.',NULL,2002,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(429,'‘EveryDayBetter’ (ElkeDagBeter.nu)',NULL,'Service-desk focusing on healthy working conditions, sick-leave and re-integration policies in SMEs. Information is provided on topics such as how to prevent and deal with long-term sick leave in SMEs, or how to adapt work for individuals with disabilities e.g. by providing flexible working arrangements.','Service-desk focusing on healthy working conditions, sick-leave and re-integration policies in SMEs. Information is provided on topics such as how to prevent and deal with long-term sick leave in SMEs, or how to adapt work for individuals with disabilities e.g. by providing flexible working arrangements.','http://elkedagbeter.nu',2012,'1','0','1','RTW','0',NULL,NULL,'0','1','0'),(430,'Health management at work: prevention of sick leave and reintegration of employees with health problems ','NL','Collection of good practice examples, including working time arrangements, job redesign, and support from co-workers and supervisors.','Collection of good practice examples, including working time arrangements, job redesign, and support from co-workers and supervisors.','http://www.arboportaal.nl/documenten/publicatie/2008/05/05/goede-praktijken-gezondheidsmanagement',2007,'0','0','1','RTW','0','CERTIFICATION OF ‘EXPERTS-BY-EXPERIENCE’: RETURN-TO-WORK COACHING SERVICES FOR PEOPLE WITH A CHRONIC DISEASE BY PEOPLE WITH A CHRONIC DISEASE',NULL,'0','1','0'),(431,'System of Healthy and Safe Working, Social and Economic Council ','NL','The guidance refers to older workers and occupational diseases, as older workers are at greater risk of developing such a disease. It recognises that timely detection of occupational diseases helps to plan early interventions and to develop and implement prevention measures. Prevention policy is described as a broad set of measures addressing working conditions, absenteeism, and re-integration, including also age-aware personnel policies (age management). The role of cooperation between occupational health physicians and general healthcare workers is stressed for improving prevention. The insufficient number of occupational physicians is mentioned as a bottleneck for implementing re-integration and coaching services for workers returning to work after sick leave.','The guidance refers to older workers and occupational diseases, as older workers are at greater risk of developing such a disease. It recognises that timely detection of occupational diseases helps to plan early interventions and to develop and implement prevention measures. Prevention policy is described as a broad set of measures addressing working conditions, absenteeism, and re-integration, including also age-aware personnel policies (age management). The role of cooperation between occupational health physicians and general healthcare workers is stressed for improving prevention. The insufficient number of occupational physicians is mentioned as a bottleneck for implementing re-integration and coaching services for workers returning to work after sick leave.','http://www.ser.nl/nl/publicaties/adviezen/2010-2019/2012/stelsel-gezond-en-veilig-werken.aspx',2012,'0','0','0','OTHERS','0','‘Win-Win’: A health improvement project at a painting company',NULL,'1','1','1'),(432,'Body@Work','NL','A comprehensive programme for older construction workers, aiming to increase job satisfaction and prevent early exit from labour market because of health problems.','A comprehensive programme for older construction workers, aiming to increase job satisfaction and prevent early exit from labour market because of health problems.','http://www.arbo-online.nl/artikelen/je-gezondheid-op-de-steigers.28382.lynkx?thema=Preventiemedewerker',2010,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(433,'Strategy for the Improvement of the Working Environment up to 2020','DK','The strategy focuses efforts on the psychosocial working environment, musculoskeletal disorders and accident prevention. The strategy identifies 19 initiatives targeting, among other things, the psychosocial working environment and health promotion. The initiative on health promotion, involves the Danish Working Environment Authority offering to include health promotion as part of the guidance for and dialogue with enterprises during inspections.</br> \r\n<br>The strategy is supported by the <strong>OSH strategy of the Danish Working Environment Authority,</strong> the objectives of which are to reduce exposures to lifting and poor working positions in the following industries: construction, metal and machinery, residential care and home care.','The strategy focuses efforts on the psychosocial working environment, musculoskeletal disorders and accident prevention. The strategy identifies 19 initiatives targeting, among other things, the psychosocial working environment and health promotion. The initiative on health promotion, involves the Danish Working Environment Authority offering to include health promotion as part of the guidance for and dialogue with enterprises during inspections.</br> \r\n<br>The strategy is supported by the <strong>OSH strategy of the Danish Working Environment Authority,</strong> the objectives of which are to reduce exposures to lifting and poor working positions in the following industries: construction, metal and machinery, residential care and home care.','http://arbejdstilsynet.dk/~/media/at/at/12-engelsk/rapporter/2020%20engelskpdf.ashx',2011,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(434,'Senior Starter Kit','DK','The Fund for Better Working Environment and Labour Retention, established in 2007 by the Welfare Agreement, has been developing ‘prevention self-help kits’ for enterprises since 2011, as well as providing financial support. The kits provide step-by-step instructions on improving safety and health at work.</br>\n<br>The fund’s objective was adjusted in August 2013 to align with the government’s political initiative ‘A good and long working life for everybody’. A specific ‘senior starter kit’ was launched to help older workers stay on the job as long as possible in the most suitable way, through:\n<ul><li>improving safety and health at work; </li>\n <li>updating qualifications and skills; and</li>\n <li>taking into account special needs and providing access to flexible working arrangements. </li></ul>\n\nEnterprises can receive subsidies if they follow the instructions in the starter kit.','The Fund for Better Working Environment and Labour Retention, established in 2007 by the Welfare Agreement, has been developing ‘prevention self-help kits’ for enterprises since 2011, as well as providing financial support. The kits provide step-by-step instructions on improving safety and health at work.</br>\n<br>The fund’s objective was adjusted in August 2013 to align with the government’s political initiative ‘A good and long working life for everybody’. A specific ‘senior starter kit’ was launched to help older workers stay on the job as long as possible in the most suitable way, through:\n<ul><li>improving safety and health at work; </li>\n <li>updating qualifications and skills; and</li>\n <li>taking into account special needs and providing access to flexible working arrangements. </li></ul>\n\nEnterprises can receive subsidies if they follow the instructions in the starter kit.','http://forebyggelsesfonden.dk/seniorpakker.html',2013,'1','1','0','OSH','0','NEVER TOO OLD FOR THE KINDERGARTEN: REDUCING THE STRAIN TO RETAIN OLDER WORKERS ',NULL,'0','1','0'),(435,'Action plan to reduce sickness absence, followed by a tripartite agreement','DK','To reduce sickness absence and improve labour market participation, the Danish Government launched an action plan, followed by a tripartite agreement between the government, the Danish Confederation of Trade Unions and the Confederation of Danish Employers. The agreement encompassed 39 initiatives including a national RTW programme.</br> \n<br>The action plan encompassed various initiatives to strengthen follow-up and dialogue measures during sickness absence, to conduct analyses and investigations in relation to sick employees and to support labour market affiliation during sickness absence.</br>\nThe main elements of the agreement are: \n<ol>\n <li>The employer must, after four weeks of sickness absence, hold a discussion with the employee about how and when the employee may return to work. </li>\n <li>The job centre will evaluate the possibility of gradual return after eight weeks of illness. </li>\n <li>The job centre will be able to provide active services to the person on sick leave. </li></ol>','To reduce sickness absence and improve labour market participation, the Danish Government launched an action plan, followed by a tripartite agreement between the government, the Danish Confederation of Trade Unions and the Confederation of Danish Employers. The agreement encompassed 39 initiatives including a national RTW programme.</br> \n<br>The action plan encompassed various initiatives to strengthen follow-up and dialogue measures during sickness absence, to conduct analyses and investigations in relation to sick employees and to support labour market affiliation during sickness absence.</br>\nThe main elements of the agreement are: \n<ol>\n <li>The employer must, after four weeks of sickness absence, hold a discussion with the employee about how and when the employee may return to work. </li>\n <li>The job centre will evaluate the possibility of gradual return after eight weeks of illness. </li>\n <li>The job centre will be able to provide active services to the person on sick leave. </li></ol>',NULL,2008,'1','0','1','RTW','1',NULL,NULL,'1','0','0'),(436,'The Danish National Return to Work Programme','DK','The programme was an initiative that grew out of the tripartite agreement on sick leave (which started in 2008) that followed the government’s action plan on sickness absence.</br>  \n<br>The Danish National Research Centre for the Working Environment developed the programme taking into account the action plan, existing sickness management legislation and previous experiences from national and international intervention studies. The multidisciplinary programme was aimed at addressing the complexities of returning to work after a long period of sickness.</br> \n<br>The programme consisted of three core elements that aimed to change the organisation of sickness absence management  and the procedures involved in it. These elements are:</br>\n<ul><li>establishment of multidisciplinary teams;</li>\n <li>introduction of standardised work ability assessments and sickness absence management procedures;</li>\n <li>a comprehensive return-to-work training course for all multidisciplinary team members.</li></ul> \n \nThe programme also aimed to enhance collaboration among healthcare and social insurance systems, employers and unions, to increase the chances of success.</br>','The programme was an initiative that grew out of the tripartite agreement on sick leave (which started in 2008) that followed the government’s action plan on sickness absence.</br>  \n<br>The Danish National Research Centre for the Working Environment developed the programme taking into account the action plan, existing sickness management legislation and previous experiences from national and international intervention studies. The multidisciplinary programme was aimed at addressing the complexities of returning to work after a long period of sickness.</br> \n<br>The programme consisted of three core elements that aimed to change the organisation of sickness absence management  and the procedures involved in it. These elements are:</br>\n<ul><li>establishment of multidisciplinary teams;</li>\n <li>introduction of standardised work ability assessments and sickness absence management procedures;</li>\n <li>a comprehensive return-to-work training course for all multidisciplinary team members.</li></ul> \n \nThe programme also aimed to enhance collaboration among healthcare and social insurance systems, employers and unions, to increase the chances of success.</br>',NULL,2010,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(437,'Strategy for occupational safety and health','DK','According to the Strategy, workplaces should focus on health promotion, and management, together with employees, should develop workplace health promotion measures. As early as 2005, the <strong>Aarhus trade union</strong> had developed a booklet encouraging union representatives to participate actively in the development of policies on older workers in their workplaces.','According to the Strategy, workplaces should focus on health promotion, and management, together with employees, should develop workplace health promotion measures. As early as 2005, the <strong>Aarhus trade union</strong> had developed a booklet encouraging union representatives to participate actively in the development of policies on older workers in their workplaces.','http://www.lo.dk/Politik/Arbejdsmiljo/LOs%20arbejdsmiljoestrategi/~/media/LO/Politikomrader/Arbejdsmiljo/LO_arbejdsmiljoestrategi/LO%20arbejdsmiljostrategi%2009%20web.ashx',2009,'0','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(438,'Industry guidelines developed by social partners','DK','The Guidelines express social partners’ common understanding of good working environment practices and standards in a specific industry. For example, the Working Environment Council for Services has a guideline about diversity called ‘The inclusive labour market – How do we create room for all?’ It refers to older workers and deals with topics such as policies on older workers, early retirement and partial pensions.','The Guidelines express social partners’ common understanding of good working environment practices and standards in a specific industry. For example, the Working Environment Council for Services has a guideline about diversity called ‘The inclusive labour market – How do we create room for all?’ It refers to older workers and deals with topics such as policies on older workers, early retirement and partial pensions.',NULL,NULL,'0','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(439,'Collective Labour Agreements (CLAs)','DK','Most CLAs outline a framework for specific schemes for older workers, including individual ‘development dialogues’ and flexible arrangements for older workers. Special arrangements regarding an older worker’s job design can be agreed during the development dialogue at company level; these can cover work tasks, flexible hours, reduced working time, changing to another job within the company and teleworking.</br> \n<br>There is a collective agreement for retail and office workers, prioritising rehabilitation and retention and focusing on older workers, integration and inclusion of people with disabilities.</br>','Most CLAs outline a framework for specific schemes for older workers, including individual ‘development dialogues’ and flexible arrangements for older workers. Special arrangements regarding an older worker’s job design can be agreed during the development dialogue at company level; these can cover work tasks, flexible hours, reduced working time, changing to another job within the company and teleworking.</br> \n<br>There is a collective agreement for retail and office workers, prioritising rehabilitation and retention and focusing on older workers, integration and inclusion of people with disabilities.</br>',NULL,NULL,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(440,'Seniorpraksis website ','DK','The website provides information and advice on senior policies at company level for both employers and employees and currently managed by the National Labour Market Authority (STAR).','The website provides information and advice on senior policies at company level for both employers and employees and currently managed by the National Labour Market Authority (STAR).',NULL,2004,'1','0','0','OTHERS','0','Job satisfaction for employees of all ages: Senior Policy at Roskilde cemetery ',NULL,'1','0','0'),(441,'National Programme on Health Protection and Safety at Work 2009-2013','HR','The Programme aims to:\n<ul><li>reduce the number of occupational injuries;</li>\n <li>reduce the number of occupational and work related illnesses,</li>\n <li>promote efforts to prevent damage to the health of workers; </li>\n<li>reduce economic losses caused by occupational injuries and sickness resulting in sick leave, invalidity pension and early retirement.</li></ul>','The Programme aims to:\n<ul><li>reduce the number of occupational injuries;</li>\n <li>reduce the number of occupational and work related illnesses,</li>\n <li>promote efforts to prevent damage to the health of workers; </li>\n<li>reduce economic losses caused by occupational injuries and sickness resulting in sick leave, invalidity pension and early retirement.</li></ul>','http://socijalno-partnerstvo.hr/wp-content/uploads/2013/04/NACIONALNI_PROGRAM_171.pdf',2008,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(442,'Experience is important','HR','This framework package of measures was created to reduce and/or prevent unemployment among particular groups of workers, i.e. groups often considered ‘more sensitive’, including those aged 50 and over (whether employed or unemployed) and long-term unemployed people with disabilities. Within this framework, several initiatives have been launched. including measures such as an employment subsidy for people over 50 (‘Pola-Pola’, or ‘Half-Half’) and a self-employment subsidy for people over 50 years old (‘Tvoja inicijativa — tvoje radno mjesto’, or ‘Your initiative — your workplace’).','This framework package of measures was created to reduce and/or prevent unemployment among particular groups of workers, i.e. groups often considered ‘more sensitive’, including those aged 50 and over (whether employed or unemployed) and long-term unemployed people with disabilities. Within this framework, several initiatives have been launched. including measures such as an employment subsidy for people over 50 (‘Pola-Pola’, or ‘Half-Half’) and a self-employment subsidy for people over 50 years old (‘Tvoja inicijativa — tvoje radno mjesto’, or ‘Your initiative — your workplace’).','https://oshwiki.eu/wiki/OSH_system_at_National_Level_-_Croatia',2012,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(443,'Strategy of Cyprus on Safety and Health at Work for the period 2013-2020','CY','The Strategy is a continuation of the Strategy of Cyprus on Safety and Health at Work 2007-2012 and sets the direction and priorities for the continuous and constant improvement of safety and health levels at work, further strengthening the OSH system and fully implementing the relevant EU directives.</br> \n<br>The Strategy sets out the introduction and implementation of a suitable health surveillance system. The health surveillance institutions will work on the implementation of an action plan. The focus will be on the recording, monitoring and prevention of occupational diseases, in particular musculoskeletal disorders, work-related stress and diseases caused by the use of hazardous chemicals.</br> \n<br>The Strategy also stresses the importance of mainstreaming safety and health at work issues into other policy areas (e.g. education, employment, agriculture, etc.).</br>','The Strategy is a continuation of the Strategy of Cyprus on Safety and Health at Work 2007-2012 and sets the direction and priorities for the continuous and constant improvement of safety and health levels at work, further strengthening the OSH system and fully implementing the relevant EU directives.</br> \n<br>The Strategy sets out the introduction and implementation of a suitable health surveillance system. The health surveillance institutions will work on the implementation of an action plan. The focus will be on the recording, monitoring and prevention of occupational diseases, in particular musculoskeletal disorders, work-related stress and diseases caused by the use of hazardous chemicals.</br> \n<br>The Strategy also stresses the importance of mainstreaming safety and health at work issues into other policy areas (e.g. education, employment, agriculture, etc.).</br>','http://www.mlsi.gov.cy/mlsi/dli/dliup.nsf/All/AD57E6E75B8CAACAC2257E0C00414C48?OpenDocument&highlight=??????????',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(444,'Special Prevention Action Plan','CY','The Action Plan focuses on training and updating skills, and includes the following measures, among others:\n<ul><li>In-company/on-the-job training programmes: The measure aims to help employers to retain their workers by providing training. </li>\n <li>Training programmes to upgrade unemployed people’s skills. </li>\n <li>Accelerated initial training programmes for newcomers and unemployed people in occupations that are in high demand. </li></ul>','The Action Plan focuses on training and updating skills, and includes the following measures, among others:\n<ul><li>In-company/on-the-job training programmes: The measure aims to help employers to retain their workers by providing training. </li>\n <li>Training programmes to upgrade unemployed people’s skills. </li>\n <li>Accelerated initial training programmes for newcomers and unemployed people in occupations that are in high demand. </li></ul>',NULL,2009,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(447,'10-Year Action Plan for Older People 2005-2015','CY','The action plan mainly targets people of third age. The plan has nine pillars: (1) a social protection system to ensure an adequate standard of living; (2) productive use of pensioners’ time; (3) an affordable and supportive living environment; (4) access to knowledge, education and lifelong learning; (5) health; (6) solidarity between the generations; (7) accessibility and mobility; (8) combating neglect, violence and abuse to the people of the third age; and (9) protection for senior citizens in the event of an emergency or disaster.','The action plan mainly targets people of third age. The plan has nine pillars: (1) a social protection system to ensure an adequate standard of living; (2) productive use of pensioners’ time; (3) an affordable and supportive living environment; (4) access to knowledge, education and lifelong learning; (5) health; (6) solidarity between the generations; (7) accessibility and mobility; (8) combating neglect, violence and abuse to the people of the third age; and (9) protection for senior citizens in the event of an emergency or disaster.','http://www.mlsi.gov.cy/mlsi/mlsi.nsf/index_en/index_en?OpenDocument',2005,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(448,'Grey Hair — Experienced Hands ','CY','A guide to good practices on the employment of older workers, which cites several examples of how to ensure good-quality and efficient employment on an equal footing for older workers.','A guide to good practices on the employment of older workers, which cites several examples of how to ensure good-quality and efficient employment on an equal footing for older workers.',NULL,2008,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(449,'National Programme to Support to Active Ageing 2013-2017','CZ','A strategic document relating to the issues raised by an ageing workforce, the programme is based on a holistic approach to ageing and refers to ageing as a lifelong process concerning all generations and emphasises the heterogeneity of the older population in terms of health and life experience. It defines increasing the participation of older people in the labour market as one of the main priorities and stresses the need to develop age management and flexible working conditions to support the employment of older workers. It also highlights health promotion in every phase of life as a prerequisite to positive ageing. ','A strategic document relating to the issues raised by an ageing workforce, the programme is based on a holistic approach to ageing and refers to ageing as a lifelong process concerning all generations and emphasises the heterogeneity of the older population in terms of health and life experience. It defines increasing the participation of older people in the labour market as one of the main priorities and stresses the need to develop age management and flexible working conditions to support the employment of older workers. It also highlights health promotion in every phase of life as a prerequisite to positive ageing. ','http://www.mpsv.cz/cs/12968',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(450,'Programme for the improvement of the health status of the population in the Czech Republic — ‘Health for All in the 21st Century’ (Health 21)','CZ','The programme formulated two specific targets relating to the ageing population and health promotion in workplaces.\n<ul><li>The target related to healthy ageing set the objective of an increase of at least 20 % in life expectancy and in disability-free life expectancy at the age of 65.</li>\n <li>The target related to living and working environments included the specific objective of ensuring that at least 10 % of large and medium-sized companies committed themselves to healthy enterprise principles. This target was not limited to reducing risk factors but also encouraged employee and employer participation in creating a safer and healthier working environment and reducing stress at work.</li></ul>\n \nOne of the objectives for the implementation of Health 21 was intersectoral cooperation on different policy areas to promote health and prevent illness.','The programme formulated two specific targets relating to the ageing population and health promotion in workplaces.\n<ul><li>The target related to healthy ageing set the objective of an increase of at least 20 % in life expectancy and in disability-free life expectancy at the age of 65.</li>\n <li>The target related to living and working environments included the specific objective of ensuring that at least 10 % of large and medium-sized companies committed themselves to healthy enterprise principles. This target was not limited to reducing risk factors but also encouraged employee and employer participation in creating a safer and healthier working environment and reducing stress at work.</li></ul>\n \nOne of the objectives for the implementation of Health 21 was intersectoral cooperation on different policy areas to promote health and prevent illness.',NULL,2002,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(451,'National Action Plan for Health and Safety at Work 2013-2014','CZ','The action plan does not make reference to the ageing workforce. However, developing a new, systematic approach to the return to work of people who have suffered work-related injury, disability or long-term illness is one of its priorities.','The action plan does not make reference to the ageing workforce. However, developing a new, systematic approach to the return to work of people who have suffered work-related injury, disability or long-term illness is one of its priorities.',NULL,2013,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(452,'Awards for companies implementing good practices in age management and OSH','CZ','The aims of the awards are to support good practices and motivate companies to further improve their working conditions. The awards include:\n<ul><li>Award ‘Company Sensitive to all Generations’</li>\n <li>Award ‘Senior-Friendly Company’.</li></ul>\n \nThey are given to companies that carry out projects supporting intergenerational cooperation among employees (e.g. mentoring), re-employment of senior employees and age-management practices.','The aims of the awards are to support good practices and motivate companies to further improve their working conditions. The awards include:\n<ul><li>Award ‘Company Sensitive to all Generations’</li>\n <li>Award ‘Senior-Friendly Company’.</li></ul>\n \nThey are given to companies that carry out projects supporting intergenerational cooperation among employees (e.g. mentoring), re-employment of senior employees and age-management practices.','http://www.topodpovednafirma.cz/firma-vstricna-seniorum-2013.html',2012,'1','0','0','OTHERS','0','GE Money Bank ‘HealthAhead’ programme (‘GE Pro zdraví’)',NULL,'1','0','0'),(453,'Jobs of social importance','CZ','Based on an agreement between the Labour Office and employers, this initiative aims to encourage employers to hire long-term unemployed older workers. In such cases, the Labour Office may offer a financial incentive for the creation of such jobs.','Based on an agreement between the Labour Office and employers, this initiative aims to encourage employers to hire long-term unemployed older workers. In such cases, the Labour Office may offer a financial incentive for the creation of such jobs.','http://portal.mpsv.cz/sz/zamest/dotace/apz',2012,'1','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(454,'Age management to work with 50+ workers — methodological guide','CZ','Supported by the European Social Fund and produced by the Czech trade unions, this age management guide for employers aims to promote age management practices in companies. It provides an overview of the situation of older workers in the Czech Republic, discusses the risk factors that have to be taken into account with respect to age and issues related to work ability/working conditions, and gives examples of best practices.','Supported by the European Social Fund and produced by the Czech trade unions, this age management guide for employers aims to promote age management practices in companies. It provides an overview of the situation of older workers in the Czech Republic, discusses the risk factors that have to be taken into account with respect to age and issues related to work ability/working conditions, and gives examples of best practices.','http://www.aivd.cz/sites/default/files/metodicka_prirucka_-_web.pdf',2012,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(455,'Occupational Health and Safety Strategy 2010-2013','EE','The Strategy underlined that, in view of the demographic situation of the country, it was crucial to promote work ability. The strategy stated that, in order to safeguard the health of workers under the changing conditions of the labour market, especially considering the high employment rate of women above pensionable age, it was important to pay attention to new types of flexibility in the workplace (e.g. working from home, flexible working time, use of service contracts, etc.).</br>\n<br>Since 2012, the targets of the OSH strategy have been incorporated into the National Health Development Plan 2009-2020. The aim of the Plan is to increase average healthy life years by 2020, by reducing health risks in the living, learning and working environments.</br>','The Strategy underlined that, in view of the demographic situation of the country, it was crucial to promote work ability. The strategy stated that, in order to safeguard the health of workers under the changing conditions of the labour market, especially considering the high employment rate of women above pensionable age, it was important to pay attention to new types of flexibility in the workplace (e.g. working from home, flexible working time, use of service contracts, etc.).</br>\n<br>Since 2012, the targets of the OSH strategy have been incorporated into the National Health Development Plan 2009-2020. The aim of the Plan is to increase average healthy life years by 2020, by reducing health risks in the living, learning and working environments.</br>','http://osha.europa.eu/en/organisations/Estonia%20OSH%20Strategy%20English%20Summary.pdf',2010,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(456,'The Active Ageing Development Plan 2013-2020','EE','This policy document highlights the general principles that should guide policy decisions in areas that are affected by population ageing, and aims to mainstream awareness of ageing into all policy areas. A chapter is dedicated to the working conditions of older workers, analysing the current situation of older workers from a socio-economic and legal perspective.</br>\n<br>The Plan has four objectives:</br>\n<ul>\n <li>increasing the involvement of older people in society;</li>\n <li>increasing the participation of older people in vocational training;</li>\n <li>increasing the participation of older workers in the labour market and their satisfaction with their professional life; and</li>\n<li>increasing healthy life years.</li></ul>','This policy document highlights the general principles that should guide policy decisions in areas that are affected by population ageing, and aims to mainstream awareness of ageing into all policy areas. A chapter is dedicated to the working conditions of older workers, analysing the current situation of older workers from a socio-economic and legal perspective.</br>\n<br>The Plan has four objectives:</br>\n<ul>\n <li>increasing the involvement of older people in society;</li>\n <li>increasing the participation of older people in vocational training;</li>\n <li>increasing the participation of older workers in the labour market and their satisfaction with their professional life; and</li>\n<li>increasing healthy life years.</li></ul>','http://www.sm.ee/sites/default/files/content-editors/eesmargid_ja_tegevused/Sotsiaalhoolekanne/Eakatele/aktiivsena_vananemise_arengukava_2013-2020.pdf',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(457,'Work Ability Reform (Töövõimetusreform), ','EE','This reform will significantly change the current system of rehabilitation services and compensation for work-related injury and ill health, moving from a system that assesses workers’ disabilities to determine social benefit eligibility to a system that focuses on workers’ abilities. The reform will involve considerable amendments to the applicable legislation and a redesign of the organisation of rehabilitation services into one system encompassing both the labour market and social benefits aspects. Work-related rehabilitation services are expected to become part of labour market services more generally; they will concentrate on providing workers with the rehabilitation treatment necessary to enable them to find work and on adjusting the working conditions of people with a reduced capacity to work. ','This reform will significantly change the current system of rehabilitation services and compensation for work-related injury and ill health, moving from a system that assesses workers’ disabilities to determine social benefit eligibility to a system that focuses on workers’ abilities. The reform will involve considerable amendments to the applicable legislation and a redesign of the organisation of rehabilitation services into one system encompassing both the labour market and social benefits aspects. Work-related rehabilitation services are expected to become part of labour market services more generally; they will concentrate on providing workers with the rehabilitation treatment necessary to enable them to find work and on adjusting the working conditions of people with a reduced capacity to work. ',NULL,2015,'1','0','1','RTW','1',NULL,NULL,'1','0','0'),(458,'Website, Labour Inspectorate','EE','The Labour Inspectorate has recently developed a new website, www.tooelu.ee, which brings together information on different activities related to, inter alia, working conditions, work contracts, occupational health and psychological counselling.','The Labour Inspectorate has recently developed a new website, www.tooelu.ee, which brings together information on different activities related to, inter alia, working conditions, work contracts, occupational health and psychological counselling.','http://www.ti.ee/',2014,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(459,'National Strategy for Safety and Health at Work 2010-2013','GR','The basic aims of the Strategy are to:\n<ul><li>promote a prevention and safety culture;</li>\n <li>minimise and efficiently address risks (especially new and emerging risks);</li>\n <li>reduce occupational accidents and diseases; and </li>\n<li>enhance workplace health promotion in small and medium-sized enterprises. \n</li></ul>\n\nIt is noted that research outcomes on changes in the labour market (i.e. new forms of employment, older workers etc.) should be used.','The basic aims of the Strategy are to:\n<ul><li>promote a prevention and safety culture;</li>\n <li>minimise and efficiently address risks (especially new and emerging risks);</li>\n <li>reduce occupational accidents and diseases; and </li>\n<li>enhance workplace health promotion in small and medium-sized enterprises. \n</li></ul>\n\nIt is noted that research outcomes on changes in the labour market (i.e. new forms of employment, older workers etc.) should be used.','http://www.ypakp.gr/uploads/docs/4516.pdf',2010,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(460,'Early retirement under the Heavy and Health-Hazardous Occupations framework','GR','Specific occupations are included in the list of heavy and health-hazardous occupations which is adopted by all social insurance organisations, following a Decision of the Minister of Labour and Social Insurance (Ministerial Decision of 2 December 2011). The latest list identifies 61 areas of employment as heavy and health hazardous and the groups of workers concerned. In addition, another 38 specific jobs are included in the list regardless of the area of employment. A worker employed in an area or occupation included in the list is entitled to their full pension five years before they reach the general retirement age.','Specific occupations are included in the list of heavy and health-hazardous occupations which is adopted by all social insurance organisations, following a Decision of the Minister of Labour and Social Insurance (Ministerial Decision of 2 December 2011). The latest list identifies 61 areas of employment as heavy and health hazardous and the groups of workers concerned. In addition, another 38 specific jobs are included in the list regardless of the area of employment. A worker employed in an area or occupation included in the list is entitled to their full pension five years before they reach the general retirement age.',NULL,2011,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(462,'National General Collective Agreement of 1988 (modified by that of 1991-92) on the establishment of the Hellenic Institute for Occupational Health and Safety (ELINYAE).','GR','ELINYAE is a bipartite, non-profit organisation, consisting of four centres:\n<ul><li>the Occupational Safety Centre deals with safety issues and ergonomic aspects; </li>\n <li>the Occupational Health and Hygiene Centre includes the Department of Occupational Medicine, a laboratory of industrial hygiene and a laboratory of biochemistry and analytical toxicology;</li>\n <li>the Documentation and Information Centre; and</li>\n<li>the Vocational Training Centre.</li></ul>','ELINYAE is a bipartite, non-profit organisation, consisting of four centres:\n<ul><li>the Occupational Safety Centre deals with safety issues and ergonomic aspects; </li>\n <li>the Occupational Health and Hygiene Centre includes the Department of Occupational Medicine, a laboratory of industrial hygiene and a laboratory of biochemistry and analytical toxicology;</li>\n <li>the Documentation and Information Centre; and</li>\n<li>the Vocational Training Centre.</li></ul>',NULL,1988,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(463,'Roadmap to Active Ageing in Greece 2012-2020','GR','The roadmap was developed under the operational programme Human Resources Development, co-financed by the EU Structural Funds and national resources, within the National Strategic Reference Framework 2007-2013. It is an easy-to-use navigation tool for age management practices targeting human resource departments in the relevant sectoral bodies and the business world in general.','The roadmap was developed under the operational programme Human Resources Development, co-financed by the EU Structural Funds and national resources, within the National Strategic Reference Framework 2007-2013. It is an easy-to-use navigation tool for age management practices targeting human resource departments in the relevant sectoral bodies and the business world in general.',NULL,2012,'0','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(464,'Occupational Safety and Health Strategy 2005-2007','IS','The Strategy included nine objectives, applying to all sectors, all working environments and all employees, without any particular sector or group of employees being prioritised.','The Strategy included nine objectives, applying to all sectors, all working environments and all employees, without any particular sector or group of employees being prioritised.','http://www.vinnueftirlit.is/um-vinnueftirlitid/stefna',2005,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(496,'	‘EveryDayBetter’','NL','Service-desk focusing on healthy working conditions, sick-leave and re-integration policies in SMEs. Information is provided on topics such as how to prevent and deal with long-term sick leave in SMEs, or how to adapt work for individuals with disabilities e.g. by providing flexible working arrangements.','Service-desk focusing on healthy working conditions, sick-leave and re-integration policies in SMEs. Information is provided on topics such as how to prevent and deal with long-term sick leave in SMEs, or how to adapt work for individuals with disabilities e.g. by providing flexible working arrangements.','http://elkedagbeter.nu',2012,'1','0','1','RTW','0',NULL,NULL,'0','1','0'),(465,'Programme of the Administration of Occupational Health and Safety, (AOSH)','IS','This programme listed seven priorities with numerous sub-goals. These included research focusing on groups struggling to access the labour market or otherwise disadvantaged, due to illness, age or other factors.','This programme listed seven priorities with numerous sub-goals. These included research focusing on groups struggling to access the labour market or otherwise disadvantaged, due to illness, age or other factors.','http://www.vinnueftirlit.is',2009,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(466,'Collective Agreements on the establishment of the Vocational Rehabilitation Fund','IS','This was an initiative to fulfil the need for vocational rehabilitation for workers who have suffered long-term illness or an accident, aiming to enhance people’s ability to return to work.','This was an initiative to fulfil the need for vocational rehabilitation for workers who have suffered long-term illness or an accident, aiming to enhance people’s ability to return to work.',NULL,2008,'1','0','1','RTW','1',NULL,NULL,'1','0','0'),(467,'50+ project','IS','The government launched this project to examine the status of older workers and trends in Iceland, in order to address the changing age structure in the coming years.','The government launched this project to examine the status of older workers and trends in Iceland, in order to address the changing age structure in the coming years.','https://www.velferdarraduneyti.is/malaflokkar/eldra-efni/50-plus/',2005,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(470,'Social Return','IS','The main goal of this integrated project was to offer disabled individuals complete rehabilitation and social inclusion in their own local community, increasing the quality of life of participants and their families. There are many follow-up projects based on this pilot project.','The main goal of this integrated project was to offer disabled individuals complete rehabilitation and social inclusion in their own local community, increasing the quality of life of participants and their families. There are many follow-up projects based on this pilot project.','http://www.stn.is/static/files/SR_ToI_e-Booklet.pdf',2005,'1','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(471,'Occupational Safety and Health Strategy for 2009-2012','LT','The Strategy mainly focused on:\n<ul><li>improving company occupational safety and health services, which should contribute to health maintenance and enhancement; </li>\n <li>the development of occupational safety and health research.</li></ul>\n\nThe Strategy did not contain direct reference to the health and safety of older workers. The objective of enhancing the effectiveness of preventive health care for employees, is probably the most relevant to sustainable work.','The Strategy mainly focused on:\n<ul><li>improving company occupational safety and health services, which should contribute to health maintenance and enhancement; </li>\n <li>the development of occupational safety and health research.</li></ul>\n\nThe Strategy did not contain direct reference to the health and safety of older workers. The objective of enhancing the effectiveness of preventive health care for employees, is probably the most relevant to sustainable work.',NULL,2009,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(472,'Programme on employment growth 2014-2020','LT','The aim of the programme is to extend working life by creating favourable conditions for working beyond retirement age and to increase the participation of disabled people in the labour market.','The aim of the programme is to extend working life by creating favourable conditions for working beyond retirement age and to increase the participation of disabled people in the labour market.','http://www.lrv.lt/Posed_medz/2014/140226/23.pdf',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(473,'Development Strategy for Vocational Rehabilitation Services 2007-2012','LT','The strategy was approved by the Minister of Social Security and Labour in June 2007. The main objective of the strategy was to improve the legal, economic and organisational framework for vocational rehabilitation and to increase its quality and variety, to ensure the better integration of people with disabilities into the open labour market.','The strategy was approved by the Minister of Social Security and Labour in June 2007. The main objective of the strategy was to improve the legal, economic and organisational framework for vocational rehabilitation and to increase its quality and variety, to ensure the better integration of people with disabilities into the open labour market.',NULL,2007,'1','0','1','RTW','1',NULL,NULL,'1','0','0'),(474,'‘Senior Bank’ system','LT','This initiative aims to enable older workers and retired people to find an appropriate occupation and to provide employers with information concerning jobseekers of retirement age. The system was adopted to reduce mass unemployment among older workers and keep them in the labour market longer. Between 2007 and 2012, the project involved over 1 600 people, of whom over 25% became employed, according to Labour Exchange statistics.','This initiative aims to enable older workers and retired people to find an appropriate occupation and to provide employers with information concerning jobseekers of retirement age. The system was adopted to reduce mass unemployment among older workers and keep them in the labour market longer. Between 2007 and 2012, the project involved over 1 600 people, of whom over 25% became employed, according to Labour Exchange statistics.','http://www.ldb.lt/Informacija/Patarimai/PatarimaiIeskantiemsDarbo/Puslapiai/senjoru_bankas.aspx',2006,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(475,'Reintegration of Older People into the Labour Market','LT','This project aims to promote the employment of older workers by including protective provisions in collective agreements, organising training for pre-retirement age people and creating new techniques for adult learning','This project aims to promote the employment of older workers by including protective provisions in collective agreements, organising training for pre-retirement age people and creating new techniques for adult learning',NULL,2010,'0','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(476,'Professional Patient History and Physical Health Problems in Connection with Work','LT','This project draws attention to patients’ health status in relation to their working conditions. The aim is to prevent the development of disability, to ensure timely recognition of disease and to maintain the patients’ ability to work.','This project draws attention to patients’ health status in relation to their working conditions. The aim is to prevent the development of disability, to ensure timely recognition of disease and to maintain the patients’ ability to work.',NULL,2010,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(477,'Methodical recommendations on how to adapt the working conditions, work and rest schedule for older people','LT','This practical guide, developed by researchers at the Health Sciences University, is based on research in areas such as ensuring working capacity throughout working life; adaptation of the workplace to individuals; older people and young people in the labour market; and rehabilitation and return to work.','This practical guide, developed by researchers at the Health Sciences University, is based on research in areas such as ensuring working capacity throughout working life; adaptation of the workplace to individuals; older people and young people in the labour market; and rehabilitation and return to work.','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Lithuania',2014,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(478,'National Strategy for Employment for 2013-2020 (and the related Action Plan)','RO','The general objective of the strategy is to reach 70% employment rate for the 20-64 age range by 2020. One of the four specific objectives of the Strategy is “to increase the participation in the labour market of older people.” This objective is translated in the action plan in four concrete measures: \n<ul><li>employment schemes for older people (including subsidies/reduction of contributions paid by employers on a determined period);</li>\n <li>development of initiatives for the transfer of knowledge and expertise from older workers to young workers (mentorship, coaching programmes);</li>\n <li>ensuring older people have access to flexible forms of work organisation; </li>\n<li>encouraging the extension of an active life, including through fiscal actions.</li></ul>','The general objective of the strategy is to reach 70% employment rate for the 20-64 age range by 2020. One of the four specific objectives of the Strategy is “to increase the participation in the labour market of older people.” This objective is translated in the action plan in four concrete measures: \n<ul><li>employment schemes for older people (including subsidies/reduction of contributions paid by employers on a determined period);</li>\n <li>development of initiatives for the transfer of knowledge and expertise from older workers to young workers (mentorship, coaching programmes);</li>\n <li>ensuring older people have access to flexible forms of work organisation; </li>\n<li>encouraging the extension of an active life, including through fiscal actions.</li></ul>','https://oshwiki.eu/wiki/OSH_systems_at_national_level_-_Romania',2013,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(479,'Monitoring of Workers’ Health','RO','According to the Decision, a medical check should be performed by the occupational physician when a worker comes back to work after an interruption of a minimum of 90 days, on medical grounds, and after an interruption of six months, on any other grounds. The check must be performed within seven days upon the return to work. The objectives of the medical check are to:\n<ul><li>confirm the worker’s ability to carry out their previous occupation or the new occupation if they have been reassigned;</li>\n <li>establish actions for the adaptation of the workplace and any operations which are specific to the occupation, if necessary; </li>\n <li>reassign the worker to a new work station/occupation, which may ensure the maintenance of the worker’s health and work capacity.</li></ul>','According to the Decision, a medical check should be performed by the occupational physician when a worker comes back to work after an interruption of a minimum of 90 days, on medical grounds, and after an interruption of six months, on any other grounds. The check must be performed within seven days upon the return to work. The objectives of the medical check are to:\n<ul><li>confirm the worker’s ability to carry out their previous occupation or the new occupation if they have been reassigned;</li>\n <li>establish actions for the adaptation of the workplace and any operations which are specific to the occupation, if necessary; </li>\n <li>reassign the worker to a new work station/occupation, which may ensure the maintenance of the worker’s health and work capacity.</li></ul>',NULL,2007,'1','0','1','RTW','1',NULL,NULL,'1','0','0'),(480,'Improving Employability in Romania','RO','The programme had a component related to the employability of older workforce.  It focused on updating and developing skills and involved organising training on various topics such as project management, computer skills, etc. The objectives were to:\n<ul><li>improve older workers’ access to continuous training; and</li>\n <li>make access to skilled jobs easier for older workers.</li></ul>','The programme had a component related to the employability of older workforce.  It focused on updating and developing skills and involved organising training on various topics such as project management, computer skills, etc. The objectives were to:\n<ul><li>improve older workers’ access to continuous training; and</li>\n <li>make access to skilled jobs easier for older workers.</li></ul>','https://oshwiki.eu/wiki/OSH_systems_at_national_level_-_Romania',2002,'0','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(481,'Media campaigns','RO','The aim of the campaigns was to change attitudes towards older workers.</br> \n<br>The General Assembly of Romanian Industrialists is a confederation grouping together associations of employers and professional associations representing industry, computer technology, construction and several other sectors, and aims to improve working conditions in Romania from the perspective of employers; the issue of an ageing workforce is also on the organisation’s agenda.</br>','The aim of the campaigns was to change attitudes towards older workers.</br> \n<br>The General Assembly of Romanian Industrialists is a confederation grouping together associations of employers and professional associations representing industry, computer technology, construction and several other sectors, and aims to improve working conditions in Romania from the perspective of employers; the issue of an ageing workforce is also on the organisation’s agenda.</br>','https://oshwiki.eu/wiki/OSH_systems_at_national_level_-_Romania',2003,'0','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(482,'Strategy for the Development of the Labour Protection Field 2008-2013 and Programmes for the Development of the Labour Protection Field 2008-2020 and 2011-2013','LV','The programmes provided a detailed plan for the implementation of the strategy. One of the objectives of the programmes was to promote longer working lives by promoting a prevention culture. The programmes incorporated early intervention and the development of a prevention culture, including through workplace health promotion, but did not directly refer to age management or address rehabilitation. In the programme for 2011-2013, a new emphasis was placed on work ability as an overarching objective in the context of extending working life.','The programmes provided a detailed plan for the implementation of the strategy. One of the objectives of the programmes was to promote longer working lives by promoting a prevention culture. The programmes incorporated early intervention and the development of a prevention culture, including through workplace health promotion, but did not directly refer to age management or address rehabilitation. In the programme for 2011-2013, a new emphasis was placed on work ability as an overarching objective in the context of extending working life.','http://www.lm.gov.lv/upload/legislation/leg_health_1.pdf',2008,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(483,'Public Health Strategy for 2011-2017','LV','The strategy promotes the enhancement of healthy working conditions throughout a person’s working life by developing prevention culture.','The strategy promotes the enhancement of healthy working conditions throughout a person’s working life by developing prevention culture.','http://www.vm.gov.lv/lv/aktualitates/sabiedribas_veselibas_pamatnostadnes_20112017/',2011,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(484,'Developing a Comprehensive Active Ageing Strategy for Longer and Better Working Lives','LV','The project aims to develop an evidence-based and comprehensive active ageing strategy in Latvia to facilitate longer and better working lives. Specific objectives of the project include:\n<ul><li>identifying the main obstacles preventing those aged 50 or over from staying in the labour market, and the main incentives and disincentives for them to do so;</li>\n <li>assessing the existing measures and identifying the challenges around healthy ageing and the policy measures needed to support better health outcomes for those aged 50 or over;</li>\n <li>evaluating the measures needed to improve the effectiveness of provision of lifelong learning activities; and</li>\n<li>preparing evidence-based recommendations for developing a comprehensive active ageing strategy.</li></ul>','The project aims to develop an evidence-based and comprehensive active ageing strategy in Latvia to facilitate longer and better working lives. Specific objectives of the project include:\n<ul><li>identifying the main obstacles preventing those aged 50 or over from staying in the labour market, and the main incentives and disincentives for them to do so;</li>\n <li>assessing the existing measures and identifying the challenges around healthy ageing and the policy measures needed to support better health outcomes for those aged 50 or over;</li>\n <li>evaluating the measures needed to improve the effectiveness of provision of lifelong learning activities; and</li>\n<li>preparing evidence-based recommendations for developing a comprehensive active ageing strategy.</li></ul>','http://www.lm.gov.lv/text/2739',2014,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(485,'Fit for Work Latvia ','LV','Fit for Work Latvia launched an initiative in 2012 with the aim of providing recommendations for a national musculoskeletal disorder (MSD) management plan, collecting data on MSD in Latvia and designing a model for early diagnosis and treatment of arthritis.','Fit for Work Latvia launched an initiative in 2012 with the aim of providing recommendations for a national musculoskeletal disorder (MSD) management plan, collecting data on MSD in Latvia and designing a model for early diagnosis and treatment of arthritis.','http://www.fitforworkeurope.eu/latvia_eng2203.pdf',2012,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(486,'Programme for the Improvement of Work Safety and Working Conditions','PL','The programme is currently in its third \nphase of implementation (2014-2016) and has, inter alia, the following broad aims:\n<ul>\n <li>to develop the necessary solutions to protect people who work in hazardous conditions and prevent the exclusion of these people from the labour market; and</li></br>\n <li>to promote a prevention and safety culture among employers and workers, through the development of a modern system of education and information.</li></ul>\nThe programme does refer to older workers and the ageing workforce, MSDs, workplace health promotion and work ability. However, these references appear in the general background and justification sections of the programme and do not form part of the concrete activities and interventions. There is also a reference to keeping older people in the labour market: one of the objectives mentioned is to increase and improve activities undertaken within enterprises in order to keep those aged 50 or over in employment.</br>\n<br>In the programme, the word ‘hygiene’ is used instead of ‘health’, which does not correspond to the broader understanding of health (as defined by WHO) as physical, mental and social well-being, which forms the basis for a more holistic approach to OSH.</br>\n<br>The coordination of the Programme has been entrusted to the Central Institute for Labour Protection — National Research Institute (CIOP-PIB).</br>','The programme is currently in its third \nphase of implementation (2014-2016) and has, inter alia, the following broad aims:\n<ul>\n <li>to develop the necessary solutions to protect people who work in hazardous conditions and prevent the exclusion of these people from the labour market; and</li></br>\n <li>to promote a prevention and safety culture among employers and workers, through the development of a modern system of education and information.</li></ul>\nThe programme does refer to older workers and the ageing workforce, MSDs, workplace health promotion and work ability. However, these references appear in the general background and justification sections of the programme and do not form part of the concrete activities and interventions. There is also a reference to keeping older people in the labour market: one of the objectives mentioned is to increase and improve activities undertaken within enterprises in order to keep those aged 50 or over in employment.</br>\n<br>In the programme, the word ‘hygiene’ is used instead of ‘health’, which does not correspond to the broader understanding of health (as defined by WHO) as physical, mental and social well-being, which forms the basis for a more holistic approach to OSH.</br>\n<br>The coordination of the Programme has been entrusted to the Central Institute for Labour Protection — National Research Institute (CIOP-PIB).</br>','https://www.ciop.pl/CIOPPortalWAR/appmanager/ciop/pl?_nfpb=true&_pageLabel=P26800385591408696399667',2007,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(487,'Assumptions for long-term senior policy in Poland (2014-2020)','PL','This policy document focused on senior citizens after retirement, and identified four challenges for the improvement of their quality of life, resulting in a ‘senior policy strategy’ around which interventions have been developed. One of the challenges relates to workers: reconciliation of the family and professional lives of workers aged 50 or over (e.g. development of work–life balance measures that would allow workers to take care of their grandchildren or other dependents).','This policy document focused on senior citizens after retirement, and identified four challenges for the improvement of their quality of life, resulting in a ‘senior policy strategy’ around which interventions have been developed. One of the challenges relates to workers: reconciliation of the family and professional lives of workers aged 50 or over (e.g. development of work–life balance measures that would allow workers to take care of their grandchildren or other dependents).',NULL,2014,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(488,'50+ Solidarity Across Generations','PL','This programme was run by the Ministry of Labour and Social Affairs and aimed to increase the economic activity of people aged 50 or over through a variety of measures and incentives at national and local levels. One of the objectives of the programme was to motivate entrepreneurs to employ people aged 50 or over. At the same time, it aimed to foster the improvement of the qualifications, skills and effectiveness of older workers. The programme applied a holistic approach, as it also included measures targeting younger age groups, such as promoting knowledge transfer.</br>\n<br>According to the government, the programme has produced good results, such as an increase in the average effective retirement age (from 57 in 2008 to 59 in 2011) and an increase in the employment rate of people aged between 55 and 64 (from 31.6 % in 2008 to 34 % in 2011).</br>','This programme was run by the Ministry of Labour and Social Affairs and aimed to increase the economic activity of people aged 50 or over through a variety of measures and incentives at national and local levels. One of the objectives of the programme was to motivate entrepreneurs to employ people aged 50 or over. At the same time, it aimed to foster the improvement of the qualifications, skills and effectiveness of older workers. The programme applied a holistic approach, as it also included measures targeting younger age groups, such as promoting knowledge transfer.</br>\n<br>According to the government, the programme has produced good results, such as an increase in the average effective retirement age (from 57 in 2008 to 59 in 2011) and an increase in the employment rate of people aged between 55 and 64 (from 31.6 % in 2008 to 34 % in 2011).</br>','http://analizy.mpips.gov.pl/index.php/raporty-i-publikacje-topmenu-58/41-pliki-programu-50.html',2008,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(489,'Act on occupational and social rehabilitation and employment of disabled persons','PL','The act targets disabled people. It defines the main goals of occupational and social rehabilitation in Poland — which are to facilitate employment, job retention and career progress for disabled people and to ensure their access to and participation in social life — and sets out measures intended to achieve those goals, including assessment of work ability, job advisory services, etc.','The act targets disabled people. It defines the main goals of occupational and social rehabilitation in Poland — which are to facilitate employment, job retention and career progress for disabled people and to ensure their access to and participation in social life — and sets out measures intended to achieve those goals, including assessment of work ability, job advisory services, etc.','http://isap.sejm.gov.pl/DetailsServlet?id=WDU19971230776',1997,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(490,'BHP INFO Online Platform','PL','This online platform gathers and makes available information related to OSH in Poland, and includes a section on the ageing workforce.','This online platform gathers and makes available information related to OSH in Poland, and includes a section on the ageing workforce.','https://www.ciop.pl/CIOPPortalWAR/appmanager/ciop/pl?_nfpb=true&_pageLabel=P30001831335539182278&html_tresc_root_id=21878&html_tresc_id=21878&html_klucz=19558&html_klucz_spis',NULL,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(557,'Guide for the promotion of Active Ageing and Solidarity Between Generations in the business context','PT','These guidelines address the preparations that need to be made for retirement, the promotion of health in the workplace, the development of corporate responsibility initiatives and the value of an inclusive labour market, as well as tools for the promotion of active ageing. They also include a series of examples of good practice in the promotion of active ageing in companies.','These guidelines address the preparations that need to be made for retirement, the promotion of health in the workplace, the development of corporate responsibility initiatives and the value of an inclusive labour market, as well as tools for the promotion of active ageing. They also include a series of examples of good practice in the promotion of active ageing in companies.','http://fr.scribd.com/doc/157437514/Grace-Guia-Promocao-Envelhecimento-Ativo',2012,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(558,'Resolution on the National Programme of Safety and Health at Work','SI','The resolution focuses on the creation of safe, healthy and stimulating working environments, with an emphasis on risk prevention and health promotion in the workplace, maintaining work ability, and reducing early retirement and absenteeism due to illness. The programme envisaged the development of measures aimed at reducing risks for certain categories of workers, such as older workers. More precisely, the resolution stipulated that workplace health promotion should become part of companies’ policies, with the aim of maintaining workers’ work ability and ensuring their lifelong employability.','The resolution focuses on the creation of safe, healthy and stimulating working environments, with an emphasis on risk prevention and health promotion in the workplace, maintaining work ability, and reducing early retirement and absenteeism due to illness. The programme envisaged the development of measures aimed at reducing risks for certain categories of workers, such as older workers. More precisely, the resolution stipulated that workplace health promotion should become part of companies’ policies, with the aim of maintaining workers’ work ability and ensuring their lifelong employability.','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Slovenia ',2003,'1','1','0','OSH','1','‘Care for a healthy worker’ programme at the Velenje coal mine',NULL,'1','0','0'),(559,'Overview of Measures for the Promotion of Active Ageing','SI','This policy document sets out specific measures to increase the employment rate of older workers (aged 55-64) and assigns responsibility to institutions for their implementation. One of the main target groups is older unemployed people, and the measures focus on their work ability, health problems, rehabilitation and training needs. The document also sets out measures to increase awareness of the safety and health conditions of older workers.','This policy document sets out specific measures to increase the employment rate of older workers (aged 55-64) and assigns responsibility to institutions for their implementation. One of the main target groups is older unemployed people, and the measures focus on their work ability, health problems, rehabilitation and training needs. The document also sets out measures to increase awareness of the safety and health conditions of older workers.','http://www.mddsz.gov.si/fileadmin/mddsz.gov.si/pageuploads/dokumenti__pdf/strategija-_EN-starejsi.pdf',2010,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(560,'Plan for the Implementation of Measures under the Active Employment Policy for 2013 and 2014','SI','One of the measures set out in the plan aims to promote the employment of older workers by granting subsidies to encourage the full-time employment of workers over 50 who have been registered as unemployed for at least six months. The measures include training and education, work replacement and job-sharing, employment incentives, job creation and self-employment incentives.','One of the measures set out in the plan aims to promote the employment of older workers by granting subsidies to encourage the full-time employment of workers over 50 who have been registered as unemployed for at least six months. The measures include training and education, work replacement and job-sharing, employment incentives, job creation and self-employment incentives.','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Slovenia',2013,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(561,'Pension and Disability Insurance Act','SI','According to the provisions of the act, if an employer employs older workers, the employer is entitled to a partial exemption from employer\'s contributions for these workers (for those aged  60 and over there is a reduction of 30 %, and for those who have reached retirement age there is a reduction of 50 %).</br>\n\n<br>The act also regulates occupational rehabilitation as a process of professional, physical and psychological training to allow the recipient to remain employed at their previous workplace and reintegrate into the work environment — with technical workplace adjustments if necessary — or to be trained for another job. The right to receive occupational rehabilitation is granted only to persons with a Category II or III disability under certain conditions.</br>\n\n<br>In addition, the act stipulates that insured employees have a right to reassignment by their employers to another position in the company after completing occupational rehabilitation. Again, this right is granted only to workers over 55 years old with a Category II or III disability under certain conditions.</br>\n\n<br>The costs of occupational rehabilitation are covered by the Pension and Disability Insurance Institute of the Republic of Slovenia. Where occupational rehabilitation requires workplace adjustments, the institute also covers these costs.</br>','According to the provisions of the act, if an employer employs older workers, the employer is entitled to a partial exemption from employer\'s contributions for these workers (for those aged  60 and over there is a reduction of 30 %, and for those who have reached retirement age there is a reduction of 50 %).</br>\n\n<br>The act also regulates occupational rehabilitation as a process of professional, physical and psychological training to allow the recipient to remain employed at their previous workplace and reintegrate into the work environment — with technical workplace adjustments if necessary — or to be trained for another job. The right to receive occupational rehabilitation is granted only to persons with a Category II or III disability under certain conditions.</br>\n\n<br>In addition, the act stipulates that insured employees have a right to reassignment by their employers to another position in the company after completing occupational rehabilitation. Again, this right is granted only to workers over 55 years old with a Category II or III disability under certain conditions.</br>\n\n<br>The costs of occupational rehabilitation are covered by the Pension and Disability Insurance Institute of the Republic of Slovenia. Where occupational rehabilitation requires workplace adjustments, the institute also covers these costs.</br>',NULL,NULL,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(562,'Promoting Healthy Work for Employees with Chronic Illness','SI','The project aimed to raise awareness of employers and other stakeholders about the importance of job retention for workers with chronic diseases.  It also aimed to promote the exchange of experiences on reintegration to work of workers with chronic diseases, including regarding measures to facilitate their return to work after a long-term sickness absence.','The project aimed to raise awareness of employers and other stakeholders about the importance of job retention for workers with chronic diseases.  It also aimed to promote the exchange of experiences on reintegration to work of workers with chronic diseases, including regarding measures to facilitate their return to work after a long-term sickness absence.','http://www.enwhp.org/uploads/media/ENHWP_Guide_PH_Work_SI.pdf',2011,'1','0','0','OTHERS','0','Establishing a health promotion team at Domel',NULL,'1','0','1'),(563,'Motivating Elderly Employees for Training and Change','SI','This was an awareness-raising initiative intended to enhance older workers’ involvement in various training programmes, improve the quality of training at company level and promote skills development of older and less qualified workers.','This was an awareness-raising initiative intended to enhance older workers’ involvement in various training programmes, improve the quality of training at company level and promote skills development of older and less qualified workers.','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Slovenia',2012,'1','0','0','OTHERS','0',NULL,NULL,'1','1','0'),(491,'e-CAPACIT8','PL','The aim of the e-CAPACIT8 project (subtitled ‘Strengthening occupational health professionals’ capacities to improve the health of the ageing workforce’ (Wsparcie kompetencji zawodowych w zakresie umacniania zdrowia starszych pracowników) is to explore and systematise the existing training curricula for occupational health professionals, as well as complementing them with new, country- and sector-specific educational materials.','The aim of the e-CAPACIT8 project (subtitled ‘Strengthening occupational health professionals’ capacities to improve the health of the ageing workforce’ (Wsparcie kompetencji zawodowych w zakresie umacniania zdrowia starszych pracowników) is to explore and systematise the existing training curricula for occupational health professionals, as well as complementing them with new, country- and sector-specific educational materials.','http://www.e-capacit8.eu/',2013,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(492,'Age management methodology as an innovative solution to facilitate professional activity of workers aged 50+','PL','This programme aimed to raise awareness of the age management concept among employers and HR managers. The programme was organised in three phases. Phase 1 involved data collection and analysis and methodology development. During the second phase, employers and HR managers had the chance to apply the proposed solutions in their own companies and also find out about the employees’ perception of age management in the enterprise. One of the deliverables of the project was a handbook on age management, covering issues such as planning for and actual recruitment of people aged 50 and over, professional and career development, workplace adaptation and examples of relevant activities that can be undertaken by employers.','This programme aimed to raise awareness of the age management concept among employers and HR managers. The programme was organised in three phases. Phase 1 involved data collection and analysis and methodology development. During the second phase, employers and HR managers had the chance to apply the proposed solutions in their own companies and also find out about the employees’ perception of age management in the enterprise. One of the deliverables of the project was a handbook on age management, covering issues such as planning for and actual recruitment of people aged 50 and over, professional and career development, workplace adaptation and examples of relevant activities that can be undertaken by employers.','http://www.zarzadzaniewiekiem.com.pl/nasze-publikacje/',2011,'0','0','0','OTHERS','0',NULL,NULL,'1','0','1'),(493,'With age — with advantages','PL','This is an awareness-raising programme by the Polish Agency for Enterprise Development in collaboration with HR managers, focusing on age management and employment.','This is an awareness-raising programme by the Polish Agency for Enterprise Development in collaboration with HR managers, focusing on age management and employment.',NULL,NULL,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(494,'Social Cooperative 50+ from Gdynia','PL','The cooperative, with the involvement of social partners, individual businesses and the Town Hall of Gdynia, offers services tailored to the capabilities of their employees (breast cancer patients, aged 50 or over), including care-giving and cleaning services, distributing leaflets and other promotional materials, and organising classes and support groups for peers aged 50 and over. The cooperative offers flexible forms of employment, including part-time arrangements, allowing its members to accumulate their income with pension. The activities of the cooperative makes a significant contribution to the successful reintegration of older women into the labour market and social life.','The cooperative, with the involvement of social partners, individual businesses and the Town Hall of Gdynia, offers services tailored to the capabilities of their employees (breast cancer patients, aged 50 or over), including care-giving and cleaning services, distributing leaflets and other promotional materials, and organising classes and support groups for peers aged 50 and over. The cooperative offers flexible forms of employment, including part-time arrangements, allowing its members to accumulate their income with pension. The activities of the cooperative makes a significant contribution to the successful reintegration of older women into the labour market and social life.','http://www.ekonomiaspoleczna.pl/x/779945;jsessionid=9D4EAEEBD20FA31D93FB9F066BD1649E',2007,'0','0','0','OTHERS','0',NULL,NULL,'1','1','1'),(495,'Model to enhance the employability of unemployed persons with disabilities','HR','The model aims to enhance the employability of unemployed persons with disabilities by improving their career management skills using tailor made work-related and social activities.','The model aims to enhance the employability of unemployed persons with disabilities by improving their career management skills using tailor made work-related and social activities.',NULL,NULL,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(497,'Norwegian Labour and Welfare Administration (NAV)','NO','The <strong>Norwegian Labour and Welfare Administration (NAV)</strong> deals with occupational rehabilitation in Norway.\r\nThe suggestion to receive occupational rehabilitation can come from the employer or from the medical professional who issued the medical certificate for the worker’s sick leave. However, ultimately, it is the NAV that makes the final decision and refers the worker to rehabilitation measures. If the worker is on sick leave, the medical professional who issued the medical certificate must be notified of the referral. The same procedure applies for occupational and non-occupational injuries or diseases.','The <strong>Norwegian Labour and Welfare Administration (NAV)</strong> deals with occupational rehabilitation in Norway.\r\nThe suggestion to receive occupational rehabilitation can come from the employer or from the medical professional who issued the medical certificate for the worker’s sick leave. However, ultimately, it is the NAV that makes the final decision and refers the worker to rehabilitation measures. If the worker is on sick leave, the medical professional who issued the medical certificate must be notified of the referral. The same procedure applies for occupational and non-occupational injuries or diseases.','https://www.nav.no/Forsiden',NULL,'1','0','1','RTW','0',NULL,NULL,'0','0','0'),(498,'Centre for Senior Policy (CSP)','NO','A resource and competence centre in the field of promoting active ageing in working life, financed by the Ministry of Labour and Social Affairs, working in close cooperation with the social partners (the unions and employers associations) and the Government.','A resource and competence centre in the field of promoting active ageing in working life, financed by the Ministry of Labour and Social Affairs, working in close cooperation with the social partners (the unions and employers associations) and the Government.',NULL,NULL,'1','0','0','OTHERS','0',NULL,NULL,'1','0','0'),(499,'National Programme of Occupational Safety and Health','HU','The programme laid down fundamental long-term strategic principles of workplace health improvement, including risk prevention and the principle of comprehensive partnership. It ran from March 2001 to June 2013. It referred to ‘the creation of a complex and efficient system of occupational rehabilitation to utilise the remaining working capacity of employees and to foster co-operation between occupational health services and public employment services’.</br>\n<br>The objectives of the future National Programme of Occupational Safety and Health (which is under discussion but has not yet been adopted) include reintegrating into the labour market ‘those rehabilitated following workplace accidents or illnesses in connection with their occupation or due to disability’. One of the newly introduced objectives is the protection of certain vulnerable groups of workers, including older workers. The document mentions the need for those with reduced working ability to keep working. It encourages employers to hire people with reduced working ability, as they should not be excluded from work; rather, their special needs and competencies should to be taken into account.</br>','The programme laid down fundamental long-term strategic principles of workplace health improvement, including risk prevention and the principle of comprehensive partnership. It ran from March 2001 to June 2013. It referred to ‘the creation of a complex and efficient system of occupational rehabilitation to utilise the remaining working capacity of employees and to foster co-operation between occupational health services and public employment services’.</br>\n<br>The objectives of the future National Programme of Occupational Safety and Health (which is under discussion but has not yet been adopted) include reintegrating into the labour market ‘those rehabilitated following workplace accidents or illnesses in connection with their occupation or due to disability’. One of the newly introduced objectives is the protection of certain vulnerable groups of workers, including older workers. The document mentions the need for those with reduced working ability to keep working. It encourages employers to hire people with reduced working ability, as they should not be excluded from work; rather, their special needs and competencies should to be taken into account.</br>','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Hungary',2001,'1','1','0','OSH','1',NULL,NULL,'1','0','0'),(500,'Hungarian National Reform Programmes','HU','These programmes aimed to increase the employment rate and improve the health status of the working-age population.','These programmes aimed to increase the employment rate and improve the health status of the working-age population.','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Hungary',2012,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(501,'Social Renewal Operational Programme 2007-2013','HU','The programme set out in detail the implementing activities of the ‘Social Renewal Priority’ of the New Hungary Development Plan. It envisaged a nationwide Work Ability Index survey of ageing workers in the following sectors: health care, construction, education, agriculture and the automotive industry. The results were intended to be used in policy-making.','The programme set out in detail the implementing activities of the ‘Social Renewal Priority’ of the New Hungary Development Plan. It envisaged a nationwide Work Ability Index survey of ageing workers in the following sectors: health care, construction, education, agriculture and the automotive industry. The results were intended to be used in policy-making.','https://oshwiki.eu/wiki/OSH_system_at_national_level_-_Hungary',2007,'1','1','0','OSH','0',NULL,NULL,'0','0','0'),(502,'National Strategy Concerning the Elderly','HU','This strategy was drafted in line with the principles of active ageing presented in the WHO Active Ageing Policy. The aims of the strategy are:</br>\n<ul>\n <li>to increase healthy life years;</li>\n <li>to help older people to maintain an active life;</li>\n <li>to support lifelong learning (including digital training);</li>\n<li>to support active ageing in terms of both physical activity (making it possible for older people to remain active in the labour market) and social activity (increasing older people’s participation in social life). </li>\n</ul>\nThe Strategy emphasises the need to develop programmes for risk prevention, rehabilitation, health promotion and sports for older people and underlines the importance of physical activity in the prevention of musculoskeletal disorders.','This strategy was drafted in line with the principles of active ageing presented in the WHO Active Ageing Policy. The aims of the strategy are:</br>\n<ul>\n <li>to increase healthy life years;</li>\n <li>to help older people to maintain an active life;</li>\n <li>to support lifelong learning (including digital training);</li>\n<li>to support active ageing in terms of both physical activity (making it possible for older people to remain active in the labour market) and social activity (increasing older people’s participation in social life). </li>\n</ul>\nThe Strategy emphasises the need to develop programmes for risk prevention, rehabilitation, health promotion and sports for older people and underlines the importance of physical activity in the prevention of musculoskeletal disorders.','http://www.complex.hu/kzldat/o09h0081.htm/o09h0081.htm',2009,'1','1','0','OSH','0','‘STEP – Take a step for your health’ (MOL Plc)',NULL,'0','0','0'),(503,'National Office for Rehabilitation and Social Affairs','HU','The government designated the office as a medical expertise and rehabilitation body, as well as making it the authority responsible for social affairs supervision. NORSA defines and regularly reviews the criteria for assessing a person’s needs in respect of rehabilitation, social care and services. It has set up and oversees a whole system of comprehensive rehabilitation and social services.</br>\n<br>Since 2012, review procedures in relation to rehabilitation services have been conducted in a complex manner, looking at medical, occupational and social rehabilitation. The actual rehabilitation process also includes medical, occupational and social rehabilitation.</br>\n<br>Occupational rehabilitation aims to reintegrate the recipient into the working community by providing advice, training and help with finding a suitable job on the open labour market, or if this is not possible, in a sheltered workplace while receiving cash benefits. Vocational and occupational rehabilitation advice and training are delivered through NORSA and local government offices, as well as through Public Employment Services (PES) offices.</br>','The government designated the office as a medical expertise and rehabilitation body, as well as making it the authority responsible for social affairs supervision. NORSA defines and regularly reviews the criteria for assessing a person’s needs in respect of rehabilitation, social care and services. It has set up and oversees a whole system of comprehensive rehabilitation and social services.</br>\n<br>Since 2012, review procedures in relation to rehabilitation services have been conducted in a complex manner, looking at medical, occupational and social rehabilitation. The actual rehabilitation process also includes medical, occupational and social rehabilitation.</br>\n<br>Occupational rehabilitation aims to reintegrate the recipient into the working community by providing advice, training and help with finding a suitable job on the open labour market, or if this is not possible, in a sheltered workplace while receiving cash benefits. Vocational and occupational rehabilitation advice and training are delivered through NORSA and local government offices, as well as through Public Employment Services (PES) offices.</br>',NULL,2004,'1','0','1','RTW','1',NULL,NULL,'1','0','0');
